INSERT INTO `home` (`home_id`, `home_title`, `home_detail`, `home_title_eng`, `home_detail_eng`, `admin_id`) VALUES (1,'','<p>\r\n	<img alt=\"\" src=\"/ckfinder/userfiles/images/564630_412436118772743_283313225018367_1784497_1125432247_n.jpg\" style=\"width: 700px; height: 644px;\" /></p>\r\n','','',0),(2,'','<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" height=\"337\" width=\"539\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				<img alt=\"\" height=\"417\" src=\"/prototype-nnit/workphp/images/m-elem1.png\" width=\"240\" /></td>\r\n			<td>\r\n				<img alt=\"\" height=\"396\" src=\"/prototype-nnit/workphp/images/m-elem2.png\" width=\"237\" /></td>\r\n			<td>\r\n				<img alt=\"\" height=\"400\" src=\"/prototype-nnit/workphp/images/m-elem3.png\" width=\"252\" /><img alt=\"\" src=\"/userfiles/workphp/images/49e3420faa514b5bde5e085b5ea6ae35.jpg\" style=\"width: 640px; height: 480px;\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align: center;\">\r\n				Kendo UI Mobile<br />\r\n				on iOS</td>\r\n			<td style=\"text-align: center;\">\r\n				Kendo UI Mobile<br />\r\n				on Android</td>\r\n			<td style=\"text-align: center;\">\r\n				Kendo UI Mobile<br />\r\n				on BlackBerry OS</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p style=\"text-align: center;\">\r\n	<img alt=\"\" height=\"154\" src=\"/prototype-nnit/workphp/images/button_kendo.jpg\" width=\"686\" /></p>\r\n<div class=\"c34 fn ma\">\r\n	<h2 class=\"mt50 mb30 tac\">\r\n		WinPhone8, iOS, Android, BlackBerry and beyond</h2>\r\n	<p class=\"mb30\">\r\n		The UI widgets match the theming and functionality behavior of native controls available for iOS, Android, BlackBerry and (NEW!) WinPhone8 development, including buttons, navigation, and lists.</p>\r\n	<p class=\"mb70\">\r\n		With Kendo UI&rsquo;s flexible styling system, developers can further customize Kendo UI Mobile themes easily to match any mobile environment.</p>\r\n	<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" height=\"648\" width=\"725\">\r\n		<tbody>\r\n			<tr>\r\n				<td>\r\n					<div class=\"c20 fl ml20 mr100\">\r\n						<h2 class=\"mt60\">\r\n							Customize mobile themes &amp; widgets</h2>\r\n						<p>\r\n							When the out-of-the-box mobile themes are not enough, you can use the Mobile ThemeBuilder tool to quickly modify the styles of Kendo UI Mobile widgets as they exist in your apps with an easy to use standalone tool. The simple and intuitive point-and-click configuration wizard makes it a breeze to transform Kendo UI Mobile themes, providing you with the CSS output for use in your app. Try the <a href=\"http://demos.kendoui.com/themebuilder/mobile.html\">Mobile ThemeBuilder</a> now to see how easy it is to customize mobile themes and widgets.</p>\r\n					</div>\r\n				</td>\r\n				<td>\r\n					<img alt=\"\" src=\"/prototype-nnit/workphp/images/mobile-themebuilder.png\" style=\"width: 436px; height: 594px;\" /></td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n</div>\r\n<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" height=\"499\" width=\"715\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				<img alt=\"\" src=\"/prototype-nnit/workphp/images/m-elem7.png\" style=\"width: 476px; height: 458px;\" /></td>\r\n			<td>\r\n				<div class=\"c20 fr ml0 mt100 mb40\">\r\n					<h2>\r\n						Kinetic scrolling</h2>\r\n					<p class=\"pt10\">\r\n						Upgrade your application&rsquo;s scrolling experience with kinetic scrolling, which enables smooth, natural and touch-friendly scrolling through lists, carousels and other components. Kendo UI is optimized for performance and delivers unmatched smoothness among HTML5 and JavaScript mobile frameworks.</p>\r\n				</div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" height=\"515\" width=\"721\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				<h2>\r\n					eady for app stores</h2>\r\n				<p>\r\n					Two easy steps:<br />\r\n					<br />\r\n					1: Build native-looking mobile apps with Kendo UI Mobile.<br />\r\n					<br />\r\n					2: Compile and deploy on popular app stores using packaging tools like <a href=\"http://phonegap.com/\">PhoneGap</a>.</p>\r\n				<p>\r\n					You get all of the benefits of native apps, including access to devices sensors and cameras, without writing and maintaining the same app multiple times.</p>\r\n			</td>\r\n			<td>\r\n				<img alt=\"\" src=\"/prototype-nnit/workphp/images/112.jpg\" style=\"width: 506px; height: 464px;\" /></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<div class=\"sfContentBlock shade nobg pb30\">\r\n	<h2 class=\"pb40 nm tac\">\r\n		What customers say about Kendo UI</h2>\r\n	<blockquote class=\"pl40\">\r\n		<p>\r\n			As our company begins to employ iPads and iPhones across our business, it&#39;s becoming increasingly important that our web applications run properly on mobile browsers. The <mark>native touch support</mark> offered by Kendo UI was one of the biggest appeals. In addition, utilizing <mark> the Kendo framework ensures we build our application on a modern platform </mark> using technologies like HTML5, CSS3, and JavaScript.</p>\r\n		<cite><strong>Jack Szumski</strong> Project Lead <strong>MMC Global Technology Infrastructure</strong> </cite></blockquote>\r\n</div>\r\n','','<p>\r\n	workphp home test</p>\r\n',179),(3,'','<p>\r\n	<img alt=\"\" src=\"/userfiles/test/images/267959_167311000004881_5774397_n.jpg\" style=\"width: 363px; height: 540px;\" /></p>\r\n','','',2),(4,'','<p>\r\n	test Admin</p>\r\n','','<p>\r\n	test</p>\r\n',1),(5,'','<p>\r\n	Test <strong>zcartlet</strong></p>\r\n','','<p>\r\n	Test <strong>zcartlet</strong></p>\r\n',180);
