INSERT INTO `horoday30` (`horoday30_id`, `horoday30_name`, `horoday30_name_id`, `horoday30_work`, `horoday30_money`, `horoday30_love`, `horoday30_around`, `horoday30_dothing`, `horoday30_family`, `horoday30_other`) VALUES (1,'วันที่่1','1','','','','','','','เกิดวันที่ 1 :ทำนายว่า เป็นคนรักเสรี กล้าหาญและไม่ก้มหัวให้ใคร \r\nคนที่เกิดวันที่1ของทุกเดือน เป็นคนที่มีความเป็นตัวของตัวเอง\r\nจนเกือบจะเรียกได้ว่าดื้อรั้นพอใจ ที่จะทำทุกอย่างด้วยตัวเอง\r\nและไม่สนใจว่าใครคิดยังไงกับตนเองด้วย\r\n\r\nมีอารมณ์รุนแรงกระด้างแข็งกร้าว\r\nคิดอย่างไรก็พูดไปอย่างนั้น ไม่กลัวว่าจะพูดอะไร ออกไป\r\nและเมื่อจำเป็นจะต้องต่อสู้ เพื่อสิ่งที่เห็นว่าถูกต้องแล้ว คนเกิดวันที่1จะทุ่มเททุกอย่าง\r\n\r\nคนเกิดวันที่1 จะกำหนดเป้าหมายของชีวิดไว้สูงสุดตั้งใจแสวงหาความเป็นเลิศให้แก่ชีวิตในทุกด้าน แต่จะไม่ยอมบอกหรือแม้แต่แสดงออกให้คนอื่นรู้ว่ากำลังประสงค์อะไร เป็นคนมีเพื่อนสนิทแต่มักจะ เกินกว่าที่จะให้เพื่อนสนิทรู้ว่ากำลังเผชิญปัญหาหรือผิดหวัง\r\n\r\nคนที่จะเอาชนะคนที่เกิดวันที่หนึ่ง ก็คือคนที่มีนิสัยเหมือนกันถ้าได้พบคนที่นิสัยเหมือนกันแล้วเวลา ทั้งหมดที่มีอยู่จะยกให้เพื่อนคนนี้นจนหมดสิ้น แต่กระนั้นก็ตามก็ยังไม่ยอมบอกให้เพื่อนสนิทคนนั้น รับรู้ถึงปัญหาหรือความคิดที่แท้จริงของตนเองอยู่ดี\r\n\r\nคนที่เกิดวันที่1จะหลงรักคนง่าย และรักอย่างลึกซึ้งด้วยแต่เรื่องความรักก็เป็นเป้าหมายอีกอย่าง ที่คนที่เกิดวันที่1ปกปิด ดังนั้น ความรักจึงเป็นเพียงความลึกซึ้งที่เก็บไว้ในใจเท่านั้นความที่ชอบอิสระ และความไม่ชอบง้อใคร ชีวิตส่วนใหญ่จึงมักจะชินอยู่กับการอยู่คนเดียวอย่างเหงาๆ แต่ก็ทรนง คนอื่นจึงมักมองว่าไม่มีน้ำใจ เอาแต่ใจตัวเองดื้อและขี้อิจฉา\r\n	'),(2,'วันที่2','2','','','','','','','เกิดวันที่ 2 :ทำนายว่า : ไม่ใช่คนโลเลต้องคอยทำตามเพื่อน\r\n\r\nแต่เป็นคนที่ต้องการให้เพื่อน(หรือคนรัก) ยอมรับว่าสิ่งที่ทำไปนั้นถูกต้องแล้ว ทั้งๆที่ตัวเองก็รู้ว่าทำถูกต้องแล้วแต่ก็อยากให้มีคนมาบอกว่าทำถูกแล้ว สิ่งที่ทำอยู่นั้น ดีแล้ว เป็นคนที่ฉลาด สามารถหยิบฉวยประโยชน์จากคำแนะนำหรือข้อวิพากษ์วิจารณ์ของเพื่อน นำมาประสมประสาน ให้เกิดผลดีแก่งานอย่างเต็มที่ เวลาทำงานจะคิดแต่เพียงว่า เพื่อนคนใดจะได้ ประโยชน์อันใด บ้างแทนที่จะคิดถึงตัวเองก่อน\r\n\r\nคนที่มีเพื่อนเกิดวันที่2มักได้การเกื้อกูลเป็นอย่างดี โดยปกติแล้วเป็นคนเรียบร้อย อ่อนหวาน ไม่ชอบขัดใจใครและพร้อมที่จะคบหาผู้คน(เพราะอยาก มีเพื่อนมากอยู่แล้ว)แต่มีข้อเสียจะเปลี่ยนแปลงง่าย ใครทำอะไรขัดใจหรือความรู้สึกไม่ได้เลย จะเกิดความน้อยใจ หรือโกรธวู่วามขึ้นมาทันที เมื่อเวลาอารมณ์ดีจะคอยคลอเคลียเหมือนแมวเชื่องๆ แต่อย่าทำให้ผิดใจเชียว\r\n\r\nสิ่งที่คนที่เกิดวันที่2กลัวมากที่สุด คือความเหงา การต้องอยู่คนเดียวคิดคนเดียวทำคนเดียว บางทีแม้จะอยู่ ท่ามกลางเพื่อนก็ยังแอบนึกไปว่าเพื่อนไม่ไห้ความสนใจ ถ้าเพื่อนของท่าน เกิดวันที่2ก็อย่าแปลกใจเลยที่จะ เห็นว่าเพื่อนงอนเก่งขี้หึงและบางทีก็เจ้าอารมณ์เพราะนั่นเป็น เรื่องธรรมดา แต่เขาหรือเธอก็เป็นเพื่อนที่รัก ท่านมาก เพราะคนที่เกิดวันที่/ ชอบคบคน ...เค้าจะวนเวียนอยู่แต่กับเพื่อนเท่านั้น '),(3,'วันที่3','3','','','','','','','คนที่เกิดวันที่3ของทุกเดือน เป็นคนเฉลียวฉลาด มีความคิดสร้างสรรค์\r\n\r\nความคิดของคนที่เกิดวันนี้ไม่เคยหยุดนิ่ง\r\nและหากใครทำตามความคิดนั้นก็จะเป็นได้พบกับความสำเร็จในการสรรค์สร้าง สิ่งที่ดีขึ้นกว่าเดิม เป็นผู้นำทางความ คิดในการพัฒนาเหมาะมากสำหรับงานในตำแหน่ง ฝ่ายวางแผนและพัฒนา นอกจากจะมีความติดสร้างสรรค์แล้ว ยังมักคะเนเหตุการณ์ต่างๆ ข้างหน้าได้อย่างถูกต้องแม่นยำ ทั้งนี้มิใช่อาศัยโหราศาสตร์ แต่อาศัยความใฝ่รู้และดวง ปัญญา อันแจ่มใสมากกว่า\r\n\r\nคนเกิดวันที่3 มีเสน่ห์อยู่ที่ความเปิดเผย มีความคิดความเห็นอย่างไร ก็พูด ออกมาอย่างนั้นตรงๆ ไม่เคยเกรงว่าคน ที่ได้ฟังจะมีความรู้สึกอย่างไรต่อตนเอง ถ้าเห็นว่าสิ่งใด ไม่ถูกต้อง หรือแม้แต่ไม่ถูกใจก็จะพูดไปตามความรู้สึก ซึ่งบางครั้งหรือหรือบ่อยครั้งก็พูดแรงเกินไป และแสดงกิริยาไม่ชอบใจออกมาให้เห็นทีเดียว\r\n\r\nสิ่งที่คนเกิดวันที่3 ชอบมากที่สุดก็คือ การที่ได้อยู่ในกลุ่มของเพื่อนสนิทมิตรสหายได้คุยแลกเปลี่ยน ความเห็นกันอย่างเต็มที่และตรงไปตรงมา จะว่าคนเกิดวันนี้พูดเป็นแต่เรื่องจริงจัง ไม่มีเรื่อง โรแมนติคก็คงจะได้ แต่ที่จริงแล้วคนที่เกิด วันที่3 เป็นคนชอบความงามตามธรรมชาติ และความ แปลกใหม่ ถ้าท่านมีเพื่อนเกิดวันที่ 3 ท่านไม่ควรพาเค้าไปเที่ยวที่เก่า ไม่ควรสั่งอาหารชุดเดิม มาเลี้ยงเขา หรือเธอเป็นอันขาด เพราะสิ่งเก่า ๆ ขัดกับความคิดที่ไม่หยุดนิ่งของเขา ใครที่ชอบนัด ที่เก่าเวลาเดิม จะทำให้คนที่เกิดวันที่3เบื่อ\r\n\r\nคนที่เกิดวันที่3 ไม่ชอบให้ใครมากำกับ ให้ทำหรือไม่ให้ทำอย่างโน้นอย่างนี้ บางทีจะทำสิ่งที่ตรงกันข้าม กับข้อห้ามหรือ คำแนะนำ เหล่านั้น เพื่อเป็นการประท้วงไปเลยก็ได้ ...ในขณะที่คนเกิดวันที่3 เป็นคนรักเพื่อน ตรงไปตรงมาและ จริงใจกับเพื่อน รับผิดชอบการงานอย่างฉลาดและสร้างสรรค์ แต่ในความเป็นจริงก็เป็นเช่นนั้น ไม่ค่อยมีใครสนิท กับคนเกิดวันนี้นัก\r\n\r\nถ้าท่านมีเพื่อนที่เกิดวันที่ 3 จงให้ความจริงใจต่อคนผู้นั้นให้ความรักและเอาใจใส่ ท่านจะได้รับน้ำใจ ตอบสนองอย่างเพื่อนที่แสนดี หรือถ้าท่านรักกับคนที่เกิดวันที่3 ท่านก็จะได้เพื่อนที่ดีที่สุดเป็นคู่ชีวิต'),(4,'วันที่4','4','','','','','','','คนที่เกิดวันที่4ของทุกเดือน เป็นคนที่มีความจริงใจต่อเพื่อน\r\n\r\nนอกจากมีความจริงใจต่อเพื่อนแล้ว คนที่4ยังต้องการความจริงใจจากเพื่อนเป็นผลตอบสนองด้วย คุณสมบัติประการต่อมาคือการเป็น คนรักการทำงาน เอาการเอางาน มีความรับผิดชอบเป็นเลิศ ที่สำคัญคือเป็นคนที่มุ่งมั่นใน การสร้างชีวิตให้มั่นคง การสร้างหลักฐานให้แก่ชีวิตของตนเองเป็น เรื่องสำคัญอย่างหนึ่งของชีวิต ดังนั้น คนเกิดวันนี้จึงทำงานหนัก เพื่อตอบสนองความหวังของตัวเอง\r\n\r\nคนเกิดวันที่4 เป็นคนที่รักเพื่อนมีความจริงใจต่อเพื่อน และความต้องการให้เพื่อนจริงใจด้วยนั้น บางทีรุนแรงไปจนถึงจุดที่เรียกร้องความสนใจจากเพื่อน หรือหึงหวงไปเลยก็มี และในขณะที่ คนเกิดวันที่4 เป็นคนเอางานเอาการทำให้บางครั้งถูกมองไปว่าเผด็จการ หรือเข้มงวดกับเพื่อนฝูง ได้ง่ายๆ แต่ลักษณะที่แสดงถึงความหึงหวง ความเข้มงวดบางอย่างก็ดี เป็นลักษณะที่บ่งบอกถึงความ จริงใจในการคบหากันมากกว่าที่จะเป็นจุดอ่อน\r\n\r\nคนที่เกิดวันที่4 มักเป็นคนที่ค่อนข้างระมัดระวังตัว มีความคิดรอบคอบ แต่คุณสมบัติประการนี้มิได้เป็นผลร้าย แก่เพื่อนฝูงที่สุจริตใจเป็นการสร้างกลไก ระมัดระวังตัวเท่านั้น เพราะคนเกิดวันนี้จะทุ่มเททุกอย่างให้กับคน ที่ตนเองเห็นว่ามีความจริงใจต่อกัน อย่างแท้จริง คนเกิดวันที่4 ถ้าคิดจะช่วยใครก็ช่วยจนหมดตัวสุดชีวิต\r\n\r\nในการคบเพื่อนที่เกิดวันที่4 นี้ ท่านต้องระมัดระวังพยายามหลีกเลี่ยงที่จะทำให้คนเกิดวันนี้โกรธหรือเกลียดท่าน เป็นอันขาด เพราะเค้าจะร้ายกาจกับคนที่ร้ายกาจด้วยอย่างที่ใคร ๆ ก็คาดไม่ถึงจริงๆและสิ่งที่คนเกิดวันที่ 4 เกลียดมากๆก็คือการที่รู้สีกว่าตัวเองถูกหลอกลวง แต่ถ้าท่านมีทุกข์หนักท่านควรไปหาคนที่เกิดวันที่4 เค้าจะเป็นห่วงและปลอบใจท่านอย่างจริงใจ ...ถ้าท่านจะรักเพื่อนที่เกิดวันที่4อย่างจริงใจแล้ว ท่านก็จะได้เพื่อนแท้ที่รักท่านอย่างจริงใจเช่นกัน '),(5,'วันที่5','5','','','','','','','เกิดวันที่ 5 :คน2บุคลิก\r\n\r\nถ้าคนที่คุณรักใคร่คบหาอยู่ขณะนี้เกิดวันที่5ของเดือนใดก็ตาม คุณก็ต้องตระหนักไว้ว่า คุณได้คบ กับคนที่มีลักษณะนิสัยสองอย่างอยู่ในตัวคนเดียว\r\n\r\nแต่นิสัยที่แท้จริงของคนที่เกิดวันที่5 ก็คือ การเป็นคนมองโลกในแง่ดี เป็นคนมีเหตุผล และยอมรับ ความเป็นจริงทุกอย่างที่เกิดขึ้น แต่จะไม่ยอมปล่อยชีวิตไปตามยถากรรม ถ้าจะเปรียบกับหัวหน้าทีมกีฬา เขาก็เป็นหัวหน้าทีม ที่ไม่เคยเสียใจถ้าทีมของเขาประสบความพ่ายแพ้แต่เขาก็จะรีบปรับปรุงทีมของเขา อย่างรีบเร่ง และพยายามเพื่อประสบความสำเร็จในครั้งหน้า\r\n\r\nคนเกิดวันที่5 จะเกลียดการถูกบังคับให้เป็นอย่างนั้นอย่างนี้ ถ้าเขารู้ตัวว่าถูกสั่งถูกบังคับ เขาจะมีปฎิกิริยา ในการต่อต้านขึ้นมาทันทีเช่นถ้าท่านมีลูกๆหรือแฟนเป็นคนที่เกิดวันที่ 5 แล้ว ท่านบอกเค้าว่า จงเลิกบุหรี่ เขาจะไม่มีทางยอมเลิกเป็นแน่ทั้งๆที่เขาเห็นด้วยกับคำพูดของคุณ คุณควรค่อยๆพูดกับเค้า เค้าก็จะยอมโดยดีแต่อาจต้องให้เวลากับเค้าสักหน่อยเพราะว่า คนที่เกิดวันนี้จะเป็นคนที่ต้องการทำตามใจ ที่ตัวเองอยากจะทำ ถ้าคนที่เกิดวันนี้เป็นเด็ก คุณก็ควรปล่อยให้เขาเล่นโลดโผนตามใจชอบ เพียงแต่คอย ดูแลเค้าห่างๆไม่ให้เกิดอันตราย ร้ายแรงก็พอ หากเค้าคนนั้นเป็นแฟนคุณหากต้องการเล่นกีฬาโลดโผน หรือลงทุนเสี่ยงทางธุรกิจ หากพอยอมได้ก็ควรยอม ถ้ายอมไม่ได้ท่านควรค่อยๆหว่านล้อมโดยไม่ใช้ วิธีชี้นำหรือสั่งมิฉะนั้น เค้าอาจเป็นศัตรูกับคุณก็ได้แม้จะรักกันมากเพียงใด อย่างไรก็ตามโดยปกติแล้วเป็นคนที่อ่อนหวาน และขี้เกรงใจและช่างเอาอกเอาใจอยู่แล้ว เขาจะดื้อต่อเมื่อถูก บังคับเท่านั้น\r\n\r\nคนที่เกิดวันที่นี้เป็นคนที่มีอารมณ์ทางเพศค่อนข้างสูงและชอบกิจกรรมทางเพศที่ประณีต เป็นคนกล้าได้กล้าเสียในเรื่องเพศสัมพันธ์ แต่เขาจะเป็นคนชอบเผด็จการในเรื่องนี้ ดังนั้นในเรื่องนี้คุณอย่าเผลอไปแนะนำอะไรเขา(หรือเธอ)เป็นอันขาดปล่อยให้เขามีความสุข แบบที่เขาต้องการจะดีที่สุด '),(6,'วันที่6','6','','','','','','','เกิดวันที่ 6 : เกิดมาเพื่อเป็นแม่บ้านพ่อเรือน\r\n\r\nสถานที่ๆเขารู้สึกว่าเหมือนวิมานก็คือบ้านอันอบอุ่นด้วยความรัก เด็กที่เกิดมาในวันที่6ในครอบครัวที่แตกร้าวจะเป็นเด็กที่น่าสงสารและจะโตขึ้นเป็นผู้ใหญ่ที่น่าสงสาร ด้วยเพราะคนที่เกิดวันนี้จะอยู่ไม่ได้ในที่ๆขาดความรัก คนที่เกิดวันนี้หากมาจากครอบครัวที่ไม่อบอุ่น เขาจะเทใจทั้งหมดให้คนที่หยิบยื่นความรักให้เค้าอย่างไม่ลังเลใจ\r\n\r\nคนที่เกิดวันนี้ค่อนข้างจะให้ความสำคัญกับคนที่เขารักเอามากๆแม้ว่าตัวเขาหรือเธอจะสวยหรือ หล่อมากแค่ไหนก็ตาม แต่เค้าและเธอก็จะไม่ค่อยมั่นใจตัวเองเรื่องความรักและเพศตรงข้าม เขาเกรงและกลัวว่า ถ้าเขาตัดสินใจผิดความรักก็จะหลุดลอยไป\r\n\r\nถ้าคุณเป็นผู้หญิงและมีแฟนที่เกิด วันที่6 คุณไม่ต้องสงสัย ว่าทำไมแฟนของคุณไม่กล้าแม้แต่จะแตะแขนของคุณ แต่อย่างไร คนที่เกิดวันนี้มักจะไม่ขาดเพื่อนต่างเพศเพราะเป็นคนที่หน้าตาดี รูปงาม นิสัยดี อ่อนหวานซื่อๆ และไม่คิดที่จะหักหลังต่อความรัก ที่คุณหยิบยื่นให้เลย แหมก็ขนาดคุณเค้ายังไม่ค่อยกล้าที่จะแตะมือ เลยแล้วจะกล้าไปจับมือใครกัน หากคุณได้คู่รักที่เกิดวันนี้คุณก็จะได้พ่อบ้านแม่เรือนที่อยู่กับเหย้า เฝ้ากับเรือน ในส่วนที่ไม่เกี่ยวกับความรักคนที่เกิดวันนี้เป็นคนที่มุ่งมั่นมานะ ใจคอหนักแน่นมั่นคง ไม่วอกแวก ไม่ว่าเรื่องใด เป็นคนที่ไว้ใจและพร้อมที่จะช่วยเหลือคนที่ตัวรักทุกวิถีทางนิสัยใจคอที่แท้จริงๆ จึงน่าจะเป็นครูบาอาจารย์ นักสังคมสงเคราะห์ เนื่องจากใจอ่อน รักเด็ก รักสัตว์เลี้ยง ถ้าได้มีอาชีพ ที่ว่านี้จะมีความเจริญ ก้าวหน้าได้ดี\r\n\r\nคนเกิดวันนี้ค่อนข้างปิดบังตัวเองในเรื่องรสนิยมทางเพศทั้งที่ความจริงตัวคุณเองเป็นไฟแต่มักจะ แสดงออก ในรูปของน้ำแข็ง ถ้าหากคุณเกี่ยวข้องสัมพันธ์กับคนที่เกิดวันนี้คุณควรต้องใช้ ความอ่อนโยนของคุณช่วย จุดไฟให้เขาหรือเธอ คุณควรเป็นฝ่ายนำแล้วเขาก็จะค่อยๆเกาะตามคุณ ไปได้เองและคุณไม่ต้องห่วงว่าเค้าจะ ตามไม่ทันเพราะผลสุดท้ายคุณอาจเป็นฝ่ายตามไม่ทันซะเอง\r\n	'),(7,'วันที่7','7','','','','','','','เกิดวันที่ 7 ผู้มีสติที่อ่อนไหว\r\n\r\nลักษณะเด่นของคนที่เกิดวันนี้คือการแสวงหาประสบการณ์ในเรื่องต่างๆด้วยตัวเองชอบประสบการณ์ตรง มากกว่า ที่จะเรียนรู้จากคนอื่น แต่เป็นคนที่มีภูมิคุ้มกันตัวเองสูง ไม่ลุ่มหลงอะไรง่ายๆไม่ว่าจะเป็นเหล้า บุหรี่ ยาเสพติด การพนัน หรือแม้แต่เพื่อนต่างเพศ\r\n\r\nการที่คนเกิดวันที่7ไม่ลุ่มหลงอะไรง่ายๆ ย่อมเป็น ผลดีต่อการชอบลองของเขาเอง เพราะเขาจะเรียนรู้โดยไม่ติดสิ่งเหล่านั้น ถ้าท่านคิดว่าจะเอาตัวเอาใจ ของท่านไปให้เค้าทดลองเพื่อให้คนที่เกิดวันที่7หลงใหลในตัวท่านก็เป็นการคิดที่ผิดถนัด\r\n\r\nคนที่เกิดวันนี้โดยปกติเป็นคนที่มีศีลธรรมและมีเมตตาเป็นคนใจง่าย และซื่อตรงและค่อนข้างขี้สงสาร แต่สำหรับเรื่อง ที่เกี่ยวกับตนเอง คนเกิดวันนี้กลับไม่ค่อยแน่ใจตัวเอง มักจะขัดแย้งกับตนเอง หรือลังเลในสิ่งที่จะตัดสินใจอยู่บ่อยๆ โดยเฉพาะอย่างยิ่งการขัดแย้งในข้อที่จะว่า จะใช้ชีวิตอย่างไรดี ยึดกฎเกณฑ์หรือปล่อยตามใจตนเอง\r\n\r\nคนเกิดวันนี้เป็นคนที่อารมณ์อ่อนไหวง่าย ซึ่งเป็นลักษณะ ของคนชอบลอง เพราะถ้าใครชวนถูกหูแล้วจะให้ทำอะไรก็ ทำ เป็นคนตรงไปตรงมาเรื่องความคิด ถ้าเชื่ออะไรแล้วจะพูดออกไปโดยไม่ต้องคิดเลย โดยที่ไม่สนว่าจะไปขัดแย้งกับ ใครเป็นคนรักหมู่คณะ แต่ก็ค่อนข้างอวดตัวและถ้าหมู่คณะมอบหมายงานให้แล้วก็จะทุ่มจนชีวิต\r\n\r\nคนเกิดวันนี้ไม่ใช่คนที่ไม่เพียงพอในความรัก แต่เป็นคนที่มีความรักมากพอที่จะแจกจ่าย ให้ใครๆได้โดยไม่จบสิ้น ชอบคู่ครองที่เข้มแข็งใจกว้างพอที่จะให้เขามีเสรีในด้านความรักและ ไม่จุกจิก แต่เขาไม่ชอบให้ท่านมีรักที่เสรี เขาชอบให้ท่านรักเขาหรือเธอคนเดียว '),(8,'วันที่8','8','','','','','','','เกิดวันที่ 8 : Perfectionist\r\n\r\nลักษณะเด่นของคนที่เกิดวันนี้คือทุกๆอย่างต้องพร้อมหรือที่ชาวต่างชาติเรียกว่า Perfectionist ถ้าชีวิตของคนประกอบไป ด้วยความสุภาพ ความมั่นคงและความมีการศึกษาดีแล้ว คนที่เกิดวันที่8 ก็คือคนที่ขวนขวายหาสิ่งนี้มาเพื่อให้ชีวิตของเขา สมบูรณ์แบบ การแสวงหาความสมบรูณ์ของเขา อาจทำให้เพื่อนฝูงหรือคนรักต้องเหน็ดเหนี่อยไปด้วย คำว่า ทุกอย่างต้องพร้อม ของคนที่เกิดวันที่8\r\n\r\nถ้าสังเกตให้ดี คนที่เกิดวันนี้จะปรากฎตัวในที่สาธารณะต่อเมื่อมั่นใจว่าตัวเอง พร้อมเท่านั้น คนเกิดวันนี้ ตามปกติส่วนใหญ่จะไม่รับแขกโดยแต่งชุดตามสบาย\r\n\r\nถ้าท่านมีเจ้านายเกิดวันที่8 และจะเชิญ ไปเปิดงานตรวจงานท่านต้องเตรียมให้พร้อม มิฉะนั้นท่านอาจถูกตัดเงินเดือน เพราะเค้าก็จะขาดหวังให้คนที่อยู่รอบข้าง เตรียมพร้อมตลอดเวลา สมบรูณ์เสมอ นั่นล่ะ เค้าละคนที่เกิดวันที่ 8\r\n\r\nคนเกิดวันนี้มักมีสมองเป็นเลิศ ฉลาดหลักแหลมจนดูเหมือนมีเล่ห์เหลี่ยม ทั้งที่เป็นเพียงคนตรงต่อ กฎเกณฑ์เท่านั้น ความหลักแหลมทำให้มีความสามารถหลายด้าน เรียนหนังสือเก่ง ทำงานเก่ง ปรับตัวให้เข้ากับวิทยาการสมัยใหม่ ได้ดีและถึงแม้ว่าเขาเกิดคิดจะเป็นนักโหราศาสตร์ เขาก็จะเป็น นักพยากรณ์ชั้นเยี่ยม ในอีกด้านหนึ่ง\r\n\r\nคนเกิดวันที่8มีจิตใจอ่อนไหว รับรู้ความปรารถนาดี จากคนข้างเคียงได้ง่าย แต่จะเก็บความรู้สึกนี้ไว้ โดยใช้ความเข้มแข็งพรางตา เขาจะรับรู้ได้เองว่า ท่านรักใคร่ผูกพันตัวเขาหรือเธออยู่ ไม่ต้องบอกรัก และในคืนวิวาห์หรือเวลาอันเป็นส่วนตัว ท่านช่วยจัดบรรยากาศดีๆห้องสะอาด เตียงเรียบ ข้าวของ เป็นระเบียบแล้ว ท่านจะรู้สึกถึงความรักที่เขามีต่อท่าน เรื่องที่ควรปรับปรุงของคนเกิดวันนี้คือ การรับและการให้เพราะคนเกิดวันนี้บางครั้งจะมุ่งมั่นเพื่อความสมบรูณ์ มากเกินไปควรรู้จัก ลดความทะเยอทะยานลงบ้าง '),(9,'วันที่9','9','','','','','','','เกิดวันที่ 9 ผู้มีลักษณะของนักปราชญ์\r\n\r\nคนที่เกิดวันที่9 บ่งบอกถึงนักอนุรักษ์นิยมและลักษณะของนักปราชญ์ เป็นคนที่ท่าทางเคร่งขรึม สุภาพและขี้อาย และมีความวิตกกังวลเป็นนิสัยเป็นคนเอาจริงเอาจังต่อชีวิตและโลกมากเกินไป เป็นคนที่เห็นว่าการพักผ่อนเป็น เรื่องแปลกประหลาดหรือใหญ่โต แต่เห็นว่าการทำงานเป็นเรื่อง ที่ต้องทุ่มเทตลอดชีวิต\r\n\r\nที่น่าเป็นห่วงคือ เขาทำงานจนไม่รู้จักความสุขอีกด้านหนึ่งของชีวิต อันเป็นความสุขที่ได้จากการพักผ่อนหย่อนใจ ท่านจะไม่เห็น คนเกิดวันนี้ออกไปร้องรำทำเพลง กับใครบ่อยนักถ้านั่งในรถทัศนาจรประเภทฉิ่งฉับทัวร์ท่าจะไม่พบคนเกิดวันนี้ ออกไปตีฉิ่งฉับเลย\r\n\r\nคนเกิดวันที่9มีพรสวรรค์ในด้านการอธิบายหรือเล่าเรื่องต่างๆให้คนเข้าใจง่าย แต่การพูดการอธิบาย ของเขาดูเป็นจริงเป็นจังและไม่มีมุขตลกมากนักจึงเป็นการพูดการอธิบายของเขาดูจริงจังและไม่มี มุขตลกมากนัก จึงเป็นนักพูดที่ดีมีสาระจึงเป็นครูมีลูกศิษย์นิยมหรือเป็นนักพูดที่มีผู้คนยกย่องปกติ\r\n\r\nคนที่เกิดวันที่9ชอบอยู่คนเดียวเงียบๆ'),(10,'วันที่10','10','','','','','','','คนที่เกิดวันที่10 เข้มแข็ง เด็ดขาดแกร่งกล้า\r\n\r\nคนที่เกิดวันที่10เป็นคนที่มีปัญหาบางอย่างมาตั้งแต่เด็กจะโดยรู้ตัวหรือไม่ก็ตาม แต่คตนเกิดวันนี้ จะรู้สึกว่าตัวเองอยู่คนเดียวในโลกบ่อยๆอาจเป็นเพราะว่าเมื่อเยาว์วัยต้องพลัดพรากจากครอบครัว ไปอยู่กับ ปู่ย่าตายายหรือะอาจเป็นลูกที่เกิดมาในช่วงที่ครอบครับเผชิญปัญหา ทำให้คนเกิดวันที่10 รู้สึกว่าตัวเอง ถูกทอดทิ้งและต้องอยู่คนเดียวในโลกแต่ก็ไม่ใช่คนประเภทอ่อนแอ ตรงกันข้ามกลับทำให้ เป็นคนเข้มแข็ง เด็ดขาดแกร่งกล้า กล้าตัดสินใจ กล้าที่จะพูดในสิ่งที่ต้องการกล้าสู้ กล้ายืนอยู่คนเดียว จนคนพากันมองว่า เป็นคนแสดงอำนาจและเจ้าอารมณ์\r\n\r\nแต่ถ้าคุณมีเพื่อนที่เกิดวันนี้คุณ จะเรียนรู้ได้ไม่ยากเลยว่าเขาหรือ เธอผู้นั้นจะเป็นคนเด็ดขาดขึ้นมา ต่อเมื่อรู้สึกว่าถูกรังแกหรือถูกดูถูก หรือถูกท้าทายเท่านั้น ถ้าคุณมีคู่รักหรือคู่ครองที่เกิดวันที่10 อย่าเผลอไปท้าทายให้เขาหรือเธอเลิกราฟ้องหย่าเป็นอันขาด เพราะคุณจะไม่มีวันได้เพชรเม็ดนั้นกลับมาอีกเลย\r\n\r\nคนเกิดวันนี้พร้อมที่จะก้าวขึ้นสู่ความเป็นเลิศด้วย ความเต็มใจในตัวเองเพราะเป็นคนฉลาดที่วางแผนทุกอย่างไว้ในใจได้รอบคอบและอดทนรอผลได้ อย่างใจเย็นเป็นคนที่เก็บปัญหา ต่างๆไว้ในใจได้ดี แม้แต่เพื่อนสนิทก็ไม่มีวันจะรู้จากปากของเขา หรือเธอว่าต้องการความช่วยเหลือแต่ไหน\r\n\r\nในเรื่องความรัก ถ้าคุณมีคนรักเกิดวันที่10คุณจะต้องรู้ว่าเขาหรือเธอจะอาทรห่วงหาคุณอย่างมาก แต่ความรักนั้นซ่อนเร้นอยู่ในใจของเขาหรือเธอเท่านั้น อย่างดีก็ปรากฎออกมาในสายตา ถ้าคุณรอ ให้เขาหรือเธอบอกรักรับรัก คุณต้องรอไปชาติหนึ่งเพราะคนเกิดวันนี้ไม่มีวันจะเอ่ยปากขอให้ใครมารัก และในเรื่องความสัมพันธ์ในฐานะคบคู่กับคุณก็เช่นกันคุณจะต้องสังเกตและตัดสินใจเองว่าควรเลือก แบบไหนคุณไม่ต้องถามแต่คุณจะต้องเสนอแบบที่ถูกใจเขาหรือเธอให้ได้ด้วยตนเองแล้วก็ไม่ต้อง ถามด้วยว่าชอบแบบนี้ไหม'),(11,'วันที่11','11','','','','','','','เกิดวันที่ 11 คนอ่อนไหวที่ช่างฝัน\r\n\r\nคนที่เกิดวันที่11เป็นคนที่ต้องการเอาอกเอาใจมากกว่าวันที่เกิดวันที่อื่นๆเป็นคนซื่อตรง และปราศจากเลห์เหลี่ยมแต่ก็มักจะใจน้อยและเจ้าอารมณ์ดังนั้นจึงมักทำงานที่ต้องอดทน หรือมีรายละเอียดกวนใจมากเกินไปไม่ค่อยได้\r\n\r\nคนที่เกิดวันที่11 จึงไม่ชอบเป็นผู้บริหารราชการ ที่มีระเบียบมากมายจุกจิกแต่ชอบที่จะเป็นศิลปิน ซึ่ง สามารถสร้างสรรค์งานได้โดยจินตนาการและ อารมณ์ของตัวเองและด้วยเหตุที่เป็นคนมีจินตการแจ่มชัด มี อารมณ์อ่อนไหวช่างคิดช่างฝันนี้เอง จึงเป็นผู้ที่มีความสุขมากถ้ามีโอกาสได้ทำงานด้านประดิษฐ์ สร้างสรรค์ ถ้าคุณมีบุตรธิดา คนรัก หรือแม้แต่ผู้ใต้บังคับบัญชาอย่ามอบงานบริหารให้เลย มอบงานประดิษฐ์คิดค้นให้ดีกว่า คุณจะได้ประโยชน์และเขาหรือเธอจะมีความสุขด้วย\r\n\r\nคนเกิดวันที่11ค่อนข้างหัวแข็งในสายตารอบข้าง แต่ที่จริงเป็นคนที่เรียกว่าหยิ่งในตัวเองมากกว่า ว่ากันว่าถ้าตรวจ สอบวันเกิดกันได้คุณพจมาน สว่างวงศ์คงเกิดวันที่11 เพราะเป็นคนหยิ่งในศักดิ์ศรี ตัวเองมาก และถ้าอยากจะทำ ให้อ่อนน้อมนุ่มนวลได้เป็นอย่างดี ใครที่ทำให้คนที่เกิดวันนี้เกลียดหรือ หมั่นไส้ จะถูกโจมตีโดยไม่ทันตั้งตัว เลย แต่ก็เป็นไปเพื่อป้องกันตนเองเท่านั้น คนเกิดวันที่11 จะไม่ รุกรานผู้อื่นเลย\r\n\r\nและเมื่อพูดกันถึงเรื่องความรัก คุณคงไม่ต้องบอกรักคนที่เกิดวันนี้ก็ได้ ถ้าคุณสามารถทำตัวให้ เป็นคนที่เป็นเพื่อนกับคนเกิดวันนี้ได้ในทุกสถานการณ์เป็นกำลังใจในการทำงานให้แก่เขาหรือ เธอผู้นั้น ที่สำคัญ คือคุณต้องเป็นหลักให้เขาหรือเธอที่เกิดวันที่11 ได้ ในการเป็นผู้นำและตัดสินใจ ในเรื่องที่เขาหรือเธอไม่ชอบ '),(12,'วันที่12','12','','','','','','','เกิดวันที่ 12 คนเก่งมีความสามารถ\r\n\r\nคนที่เกิดวันที่12 เป็นผู้ได้พรจากพระเจ้าในเรื่องต่างๆเกือบทุกเรื่องเพราะไม่ว่าจะจับทำสิ่งใด ก็จะสำเร็จไปหมด อย่างน้อยก็ทำได้ดีในทุกเรื่อง เกิดมาเป็นคนเก่ง&bsp;มีความสามารถ ในการงานเป็นอย่างดี โดยนิสัยแล้วคนเกิดวันที่12เป็นคนเปิดเผย ตรงไปตรงมาและไม่ชอบ ถูกเอาเปรียบจึงต้องการเพื่อนที่คบกัน ด้วยความบริสุทธิ์ใจ ไม่หวังผลตอบแทน ต้องการเพื่อน ที่พูดคุยได้อย่างสนิทใจ เพียงแต่คุณมีความจริงใจ คุณก็จะเป็นเพื่อนที่ดีของคนเกิดวันที่12 ได้ไม่ยากเลย\r\n\r\nแต่คนที่มีเพื่อนเกิดวันที่12 ก็ต้องรู้ใจเพื่อนด้วยว่า คนเกิดวันนี้เป็นคนที่มีแต่ ความซื่อ พูดตรงไปตรงมาโดยไม่กลังใครจะว่าอย่างไร เมื่อคนที่เกิดวันนี้ต้องการจะตำหนิ ใครก็จะพูดด้วยถ้อยคำที่รุนแรง จนกระทั่งคนฟังรู้สึกว่าแรงเกินไป และเมื่อไม่พอใจใครหรือ อะไร ขึ้นมา คนที่เกิดวันนี้ก็จะแสดงให้รู้อย่างชัดเจนทีเดียวว่าไม่พอใจ\r\n\r\nคนเกิดวันที่12เป็นคนเก่งที่มีเพื่อนน้อย ทั้งที่เจ้าตัวเป็นคนรักเพื่อนและมีความสุขมากเมื่ออยู่ในกลุ่ม เป็นคนมีอารมณ์ ขัน และโต้ตอบคำพูดของคนอื่นๆได้อย่างคมคายแต่กลับมีเพื่อนน้อย หาเพื่อนสนิท ได้ยาก ดังนั้น ถ้าคุณเข้าไปอยู่ใน ฐานะเพื่อนสนิทได้ ในใจของคนเกิดวันที่12ก็จะมีแต่คุณคนเดียว วิธีที่จะทำให้คนเกิดวันนี้พอใจอย่างหนึ่งก็คือ การพาไปท่องเที่ยวตามสถานที่ต่างๆ รสนิยมของแต่ละคน ต่างกันไปบ้าง บางคนอาจชอบให้คุณพาไปเที่ยวป่าเขาลำเนาไพร บางคนอยากให้คุณไปดูหนังละคร กับเขาบ่อยๆ\r\n\r\nแต่ที่แน่ๆคือ คนที่เกิดวันที่12นี้เกลียดการจำเจ แม้แต่แต่งงานแล้วถ้าคู่ครองของคุณ เกิดวันที่12นี้คุณก็ต้องหาวิธีพากันไปเที่ยวนอก บ้านบ่อยๆ\r\n\r\nคนที่เกิดวันที่12ไม่ชอบการห้ามไม่ให้ทำอย่างโน้นอย่างนี้โดยไม่มีเหตุผลอันเห็นได้ชัดและเกลียด การห้ามเพราะ ความอิจฉาหรือเพราะกลัวว่าจะขัดผลประโยชน์ของคนห้าม ดังนั้นถ้าคุณมีคนรักเกิด วันนี้ แล้วคุณแสดงความหึงหวงหรือแสดงความเป็นเจ้าของ ความรักก็จะจบลงง่ายๆแค่นั้นที่จะเกี่ยวข้อง '),(13,'วันที่13','13','','','','','','','เกิดวันที่ 13 คนน่ารักที่อ่อนไหว\r\n\r\nคนที่เกิดวันที่13 เป็นคนน่ารักมากไม่ว่าโดยบุคลิกภาพภายนอกที่อ่อนหวานแช่มช้อย หรือภายใน จิตใจที่ซื่อตรง อ่อนโยน เมตตาปรานี และเต็มไปด้วยน้ำใสใจจริง คนเกิดวันนี้รับรู้ความดีง่าย ใจอ่อน และมักพอใจที่ ที่จะเอื้อเฟื้อผู้อื่นเป็นคนสนใจในการเรียนรู้และปฎิบัติธรรม\r\n\r\nคนเกิดวันที่13 เป็นคนที่ปราศจากเล่ห์เหลี่ยม มีความรับผิดชอบสูงต่อครอบครัว และหน้าที่การงาน (หาคนเกิดวันนี้ มาเป็นคู่เถิด) คนที่เกิดวันนี้ต้องการให้ชีวิตมั่นคงเป็นอันดับแรกดังนั้น จึงต้องทำงานหนัก และทำได้อย่างไม่ย่นย่อ ท้อถอย เป็นคนอดทนได้ที่จะรอผลอันยาวนาน คนเกิดวันที่13นี่แหละ คือพวกที่เป็นอย่างเพลงลูกทุ่ง ร้องเอาไว้ว่า ผัวตายเมื่อไรบอกด้วย แล้วพี่จะช่วยเลี้ยงลูกทุกคน\r\n\r\nคนเกิดวันนี้มีจุดอ่อนอยู่ตรงที่เป็นคนอ่อนไหวง่าย น้อยใจเก่ง คุณอาจเห็นน้ำตาของคนที่เกิดวันที่13 ได้บ่อยๆ นอกจากนี้คนที่เกิดวันนี้ก็ยังเป็นคนที่ชอบตัดสินใจตามผู้ใหญ่ เชื่อผู้ใหญ่มากกว่าตนเอง อาจเป็นเพราะได้อาศัยอยู่ใน ครอบครัวที่ดี ได้พึ่งพาอาศัยพ่อแม่มาตลอด พอมีปัญหาอะไร ก็วิ่งไปพ่อแม่ก่อนเสมอ\r\n\r\nคนที่เกิดวันที่13นี้อาจทุ่มเทความรักให้กับใครก็ได้(อาจเป็นคุณ)ถ้าคุณได้พิสูจน์ให้คนเกิดวันที่13 ได้ประจักษ์ว่า คุณมี ความจริงใจกันอย่างแท้จริง คนเกิดวันที่13นี้ถือว่าน้ำใจไมตรีมีค่าสูงที่สุดถ้าเขา หรือเธอรักคุณ แล้วก็จะรักจนสุดหัวใจ และจะรักอยู่อย่างนั้นไปจนตลอดชีวิต แม้คุณจะ(บังเอิญ)แต่งงาน ไปแล้วก็ตาม และอย่าทำให้คนวันนี้โกรธเชียวหรือไม่พอใจมากๆคุณจะรู้ทันทีว่าคารมของคนที่เกิดวันนี้ ร้ายกาจมากกว่าสิ่งใด '),(14,'วันที่14','14','','','','','','','คนที่เกิดวันที่14เป็นคนอ่อนหวานขี้เกรงใจ\r\n\r\nซึ่งเป็นลักษณะที่คุณเห็นได้จากภายนอกและเป็นคนที่มี ความซื่อสัตย์ อยู่ภายใน ดังนั้นจึงเป็นคนที่น่ารักน่าคบ แต่คุณต้องรู้ไว้ด้วยว่าความเป็นคนซื่อสัตย์, ขี้เกรงใจ,ช่างเอาอกเอาใจ และช่างเอาอกเอาใจ มีอยู่เฉพาะเมื่อคุณปล่อยให้คนเกิดวันนี้มีความสุข ตามแบบที่เขาหรือเธอต้องการ เท่านั้น ถ้ามีใครมาสั่งให้ทำอย่างนั้นอย่างนี้คนที่เกิดวันที่14จะหงุดหงิด พลุ่งพล่านขึ้นมาทันที คนอ่อนหวานน่ารักช่างเอาอกเอาใจของคุณจะกลับกลายเป็นแม่เสือที่ดุร้าย ดื้อรั้นเอาแต่ใจตัวขึ้นมาทันที\r\n\r\nคนเกิดวันที่14เป็นคนมีอำนาจใจตนเอง มีพลังใจสูงสามารถจูงใจตนเองให้ทำอย่างจนสำเร็จได้ดัง ประสงค์ มีอำนาจ ลึกลับที่จูงใจตนเองให้ทำตามอย่างที่ตนต้องการ มักได้รับอำนาจที่คนอื่นรับรู้ได้ คนเกิดวันนี้หากมีอำนาจจึงมักเอา แต่ใจตนเองหรือชอบเผด็จการ แต่จุดอ่อนอันเกิดจากความมี อำนาจ และชอบใช้อำนาจนี้ก็จะถูกลดลงไปโดยนิสัยที่ เป็นคนมองโลกในแง่ดี ใจกว้าง มีเหตุผล ยอมรับความเป็นจริงที่เกิดขึ้นทั้งทางด้านดีและด้านร้าย เป็นคนเข้าใจ ความเป็นกายได้ง่าย และยอมรับความเป็นไปได้ในเรื่องต่างๆเป็นอย่างดี ซึ่งคุณลักษณะเช่นนี้ทำให้การใช้อำนาจ ของคนเกิดวันที่14เป็นไปอย่างมีเหตุผลและนุ่มนวลขึ้น\r\n\r\nทำให้คนเกิดวันที่14 รักคุณได้ง่ายๆด้วยการสนับสนุนความสุขของคนเกิดวันนี้ตามแบบที่เขา หรือเธอต้องการ(ถ้าคุณยอมรับได้) เปิดโอกาสให้แสดงออกหรือได้ทำในสิ่งที่เขาหรือเธอต้องการ เป็นต้นว่าถ้าเขาหรือเธอชอบเล่นเทนนิส ก็หาทางส่งเข้าแข่งขันชิงถ้วยอะไรไปเลย หรือว่าถ้าเธอ หรือเขาชอบเล่นดนตรี ก็หาโน้ตเพลงหาเครื่องดนตรีมาให้แล้ว ก็จัดคอนเสิร์ตเปิดตัวให้รู้แล้วรู้รอด ไปเลย '),(15,'วันที่15','15','','','','','','','คนที่เกิดวันที่15 คนที่คุณจะเห็นง่ายแต่รู้จักยาก\r\n\r\nเพราะภายนอกดูเป็นคนร่าเริง รักความมีอิสระเสรีชอบ\r\nแสดงให้เห็นว่าเป็นคนมีความกร้าวแกร่ง จนแม้บางครั้งจะต้องทำอะไรแผลงๆ เพื่อให้ดูเก่งในสายตาเพื่อนๆ ก็ตาม\r\n\r\nสิ่งที่ปรากฎภายนอกคนเกิดวันที่15จึงมักเป็นภาพของคนที่ ชอบอยู่กลางแจ้ง ชอบการผจญภัย ชอบแสดง เด่น เป็นนักกีฬานักแข่งขัน นักทำงานเสี่ยงอันตราย แต่ในลักษณะที่เป็นอุปนิสัยภายใน คนเกิดวันนี้เป็นคนที่ใจอ่อน อ่อนไหวง่าย สงสารคนง่าย ขี้งอน และซ่อนความอ่อนหวานน่ารักไว้ภายใน มีความรักบ้านและครอบครัว เป็นคนขี้อ้อนและต้องการ คนเอาใจที่ปกปิด จิตใจของตนเองด้วยการแสดงออกให้คนอื่นเห็นว่าเป็นคนกร้าวแข็ง\r\n\r\nน้ำใจของคนที่เกิดวันที่15 เป็นน้ำใจที่ประเสริฐ เพราะเป็นคนที่รักครอบครัว รักบ้านมีความรับ ผิดชอบในสิ่งที่ได้กระทำลงไปเป็นอย่างดีเป็นคนที่มีน้ำใจรักหมู่คณะและพร้อมที่จะทำทุกอย่าง เพื่อส่วนรวมได้โดยไม่ลังเล รีรอ นอกจากนั้น ยังมีคุณสมบัติพิเศษในด้านความคิดริเริ่มและมี พรสวรรค์ในการประดิษฐ์คิดค้นอีกด้วย\r\n\r\nคนเกิดวันนี้จึงเป็นคนแปลกตรงที่ว่าข้างนอกดูเข้มแข็ง และง้อใครไม่เป็น แต่ความจริงกลับต้องการให้คน มารัก มาเอาใจมากๆยิ่งถ้าตอนไหนต้องอยู่ คนเดียว แล้วก็ยิ่งต้องการเพื่อน ต้องการคนรักคนเอาใจมากขึ้นไปอีก คุณคงรู้แล้วว่า จะเริ่มต้นและสานต่อความรักกับคนเกิดวันที่15ได้อย่างไร ยอมรับความเด่น ที่เขาหรือเธอแสดง ออกทุกอย่างเมื่ออยู่ต่อหน้าผู้คน และเมื่อคุณอยู่ด้วยกันอย่างเป็นส่วนตัวแล้ว คุณเติมความอ่อนหวาน ความเป็นคน ช่างรู้ใจของคุณเข้าไปอีกนิดหน่อย ทำตัวเป็นที่พึ่ง ที่ปรึกษาและร่วมทุกข์ร่วมสุขอยู่เงียบๆคนเกิดวันที่15ก็จะเกาะ อยู่กับคุณตลอดไป '),(16,'วันที่16','16','','','','','','','เกิดวันที่ 16 : ชอบแสวงหาประสบการณ์\r\n\r\nคนเกิดวันนี้เป็นคนเห็นชีวิตมีค่า แต่คิดว่า จะต้องใช้ชีวิต ให้คุ้มค่า ดังนั้นจึงชอบทำอะไรที่เป็นการโลดโผนผจญภัยแต่ได้รสชาติแปลกใหม่ สำหรับชีวิตแม้จะเป็น เรื่องที่ต้องเรียนรู้ด้วยชีวิตเช่นยาเสพติด การพนัน เกมส์กรีฑา คนเกิด วันที่16ก็ไม่ลังเลที่จะเรียนรู้ ดังนั้น คุณอย่าตกใจเมื่อพบใครสักคนที่ลองทุกอย่างจนดูเหมือน คนชั่วคนเกเร แต่คุณอย่าห่วงเลยคนเกิดวันที่16 ไม่ลุ่มหลงอะไรง่ายๆไม่ว่าจะเป็นเหล้า,ยาเสพติด หรือเพื่อนต่างเพศ\r\n\r\nที่จริงแล้วคนเกิดวันที่16เป็นคนมีศีลธรรม เข้าใจเห็นใจเพื่อนมนุษย์และชอบ ช่วยเหลือ ผู้คนที่กำลังมีปัญหาเป็นคนมีความจริงใจและรักคนที่จริงใจตอบ เป็นคนที่ชอบคาดการณ์ ล่วงหน้าและมีพรสวรรค์ในการคาดการณ์ด้วย\r\n\r\nคนเกิดวันที่16เป็นคนตรงไปตรงมาและมีกฎเกณฑ์ แต่กฎเกณฑ์ที่ว่ามักเป็นกฎที่เขาคิดและตั้งขึ้น เองว่าอะไรผิดอะไรถูกอะไรควรทำอะไรไม่ควรทำ และเมื่อตั้งกฎเกณฑ์ขึ้นมาแล้วก็ทำไปตามนั้น โดยไม่สนใจว่าจะ ขัดแย้งกับใคร\r\n\r\nคนเกิดวันนี้มีความรักแจกจ่ายเหลือเฟือ คุณต้องเข้าใจข้อนี้และต้องยอมรับธรรมชาติข้อนี้ก่อนที่จะรัก กับคนเกิด วันที่16 ซึ่งถือว่าความรักเป็นประสบการณ์อย่างหนึ่งที่ต้องแสวงหา คนเกิดวันที่16ต้องการ รักคู่ครองที่แท้จริง รักอิสระเสรีและพึ่งตัวเองได้ อยู่ได้โดยไม่มีกันและกัน และอยู่อย่างมีความสุข เมื่อมีกันและกัน แต่แปลกเมื่อถึงจุดหนึ่งของการใช้ชีวิตคู่แบบเสรีนี้เองคนเกิดวันที่16 ก็จะกลับมาเป็นคนขี้หึงเอาดื้อๆ '),(17,'วันที่17','17','','','','','','','คนเกิดวันที่17 เป็นคนที่มีความสามารถสูง เป็นคนฉลาดและมีไหวพริบ\r\n\r\nดี มีบุคลิกลักษณะอันเป็นผู้นำที่ผู้คน เชื่อถือ มีความสามารถเป็นอย่างดีในการโน้มน้าวจิตใจคน ใช้คน และบริหารงานด้าน บุคคล แก้ปัญหาเก่ง โดยเฉพาะอย่างยิ่ง ความสามารถในการแก้ปัญหาเฉพาะหน้า\r\n\r\nคนเกิดวันนี้ จึงมักได้รับความนับถือว่าเป็นหัวหน้า เป็นที่พึ่งของคนในกลุ่มนี่เป็นกายภาพภายนอกเมื่อมองห่างๆ เมื่อมองใกล้เข้าไป ก็จะเห็นได้อีกว่าคนเกิดวันที่17ไม่สู้จะคงเส้นคงวานัก บางครั้งก็เข้มแข็ง เด็ดเดี่ยวและดูเอา จริงเอาจังกับชีวิต แต่บางครั้งบางคราวก็เป็นคนอ่อนไหวง่าย เจ้าอารมณ์ นุ่มนวลเห็นอกเห็นใจ บางคราวดู เหมือนมีเล่ห์เหลี่ยม\r\n\r\nคนเกิดวันนี้เป็นคนที่ปรารถนาในชีวิตค่อนข้างสูง ทุกสิ่งทุกอย่างของคนเกิดวันนี้ต้องสมบูรณ์ และคนเกิดวันนี้ จะพยายามอย่างมากที่จะสร้างความสมบรณ์ในชีวิต สุขภาพดี มีปัญญา มีทรัพย์ มีคู่ครองที่ดีเลิศ ดังนั้นจึง ต้องทำงานหนักเพื่อให้ได้สิ่งเหล่านี้มา\r\n\r\nจุดอ่อนของคนที่เกิดวันนี้คือโดยปกติจะใช้ชีวิตแบบเรียบง่าย แต่จะ เปลี่ยนเป็นคนเครียด หรือเอาแต่ใจตัวเองขึ้นมาเมื่อไรก็ได้ คนที่อยู่ด้วยหรือเป็นเพื่อนสนิท จึงต้องคอยปรับตัวปรับใจ อยู่เสมอ\r\n\r\nและจุดอ่อนอีกประการหนึ่งก็คือคนเกิดวันนี้มักเป็นคนประเภทเล็งผลงานมากกว่ามุ่งความ สัมพันธ์กับผู้คน ดังนั้นคนที่สนิทควรต้องคอยดูแลช่วยเหลือเรื่องมนุษย์สัมพันธ์ของคนที่เกิดวันที่17 จุดดีของคนที่เกิดวันนี้คือเมื่อแต่งงานมีครอบครัวไปแล้วความอ่อนไหวแปรปรวนของอารมณ์จะลดลง ไปมาก เป็นคนที่คงเส้นคงวามากขึ้น มีมนุษย์สัมพันธ์ที่ดีขึ้น '),(18,'วันที่18','18','','','','','','','เกิดวันที่18 ผู้แสวงหาความรู้\r\n\r\nถ้าเกิดวันที่18 คุณอาจค้านคำทำนายนี้แต่ถ้าคุณใกล้ชิดกับคนที่เกิดวันที่18คุณอาจเห็นด้วย มากๆเลยทีเดียว คนเกิดวันนี้เป็นคนชอบแสวงหาความรู้และความจริงของชีวิตตลอดเวลา เป็นคนเอาจริงเอาจังต่อชีวิตมากเกินไป จนต้องอารมณ์เสียเสมอ หงุดหงิดง่ายและไม่เคยพอใจ ตนเองเลย บ่อยครั้งที่รู้สึกรำคาญตัวเอง และไม่เคยพอใจ ตนเองเลยบ่อยครั้งที่รู้สึกรำคาญตัวเอง และรู้สึกที่ตัวเองไม่ได้ดังใจ เป็นคนที่หาอะไรมาทำอยู่ได้โดยไม่ชอบพัก ผ่อน กังวลเก่ง จนเครียด และมักนอนไม่หลับบ่อยๆ\r\n\r\nคนเกิดวันนี้เป็นคนที่ละเอียดอ่อนและสนใจในรายละเอียดต่างๆจนคนอยู่ใกล้เห็นเป็นเรื่องขบขัน หรือบางทีก็ รำคาญไปเลย คนเกิดวันที่18จึงเป็นคนที่ใครๆพากันเห็นว่า เคร่งครัดเกินไป\r\n\r\nจุดเด่นของคนที่เกิดวันนี้มีอยู่ไม่น้อย แม้ว่าจะเป็นคนอารมณ์ปรวนแปรง่าย และอาจเป็นคนขี้อิจฉา ก็ตาม จุดดีที่ว่านี้เป็นคนเต็มใจที่จะให้คำแนะนำช่วยเหลือผู้อื่นอย่างเต็มที่ ประกอบกับมีความสามารถ ในการพูดการอธิบาย หรือการโน้มน้าวใจคน จึงทำให้มีคนไปมาหาสู่ด้วยเสมอในฐานะที่ปรึกษา และจุดเด่นอีกอย่างหนึ่งก็คือ รับผิดชอบสูงต่อคนรัก ถ้ารักใครแล้วจะทุ่มให้อย่างเต็มที่ทั้งร่างกาย ชีวิต และจิตใจ และก็หวังจะได้รับความรักตอบแทนเต็มที่เช่นแต่ว่าก็ว่าเถอะ\r\n\r\nคนที่เกิดวันนี้ความหวังที่จะได้ รับความรักตอบแทนมักล้มเหลว ความดีที่คนที่เกิดวันที่18 มักได้รับ การตอบแทนกลับมาในรูปของความนับถือ เสียเป็นส่วนใหญ่ ใครๆที่คบกับคนเกิดวันนี้ มักอยาก ให้คนที่เกิดวันนี้เป็นพี่ชาย พี่สาวมากกว่าอยากได้ไว้เป็นคู่รัก ถ้าคุณเกิดนึกรักคนเกิดวันนี้ขึ้นมาจริงๆ คุณก็ต้องเป็นคนเป็นระเบียบเรียบร้อยในทุกโอกาสทุกกรณี พยายามหาวิธี ทำให้คนเกิดวันนี้มั่นใจ และกังวลน้อยล โดยรับภาระบางอย่างไว้เสียบ้าง '),(19,'วันที่19','19','','','','','','','เกิดวันที่ 19 : มี3กำลังภายใน\r\n\r\n\r\n\r\nกำลังภายในที่คนเกิดวันที่19มีอยู่นั้น มีถึงสามประการคือ กำลังความมานะพยายาม กำลังความ เมตตา และกำลังสติปัญญา คนเกิดวันนี้เป็นคนที่มีความมานะพยายามสูงมาก อดทนไม่ย่อท้อต่อ ความยากและอุปสรรคไม่ว่าจะรุนแรงเพียงใด คนเกิดวันนี้มีพลังสติปัญญาที่จะนำเอาความรู้ความสามารถประสบการณ์ที่มีอยู่ออกมาใช้ได้อย่าง เต็มที่ และทรหดอดทน ทั้งเป็นคนหนักแน่นไม่สะดุ้งสะเทือนต่อสิ่งใดทั้งสิ้น คนเกิดวันอื่นที่เป็น นักสู้อาจต้องการกำลังใจจากคนอื่น แต่คนวันนี้เขามีกำลังใจให้กับตัวเอง อย่างเต็มเปี่ยมอยู่เสมอ ทีเดียว เป็นนักสู้ที่สู้ได้ทั้งประเภทเดี่ยว และประเภททีมนี่เป็น กำลังภายในประการแรก ที่มีอยู่ในตัวคนเกิดวันที่19\r\n\r\nกำลังภายในประการที่2ของคนเกิดวันที่19 คือความเมตตา คนเกิดวันนี้เป็นคนที่มีความเมตตาสูง ความเมตตาคือ ความรู้สึกต่อคนอื่นเหมือนรู้สึกต่อตนเอง รักคนอื่นเหมือนรักตัวเองมีอยู่ในตัวคน เกิดวันนี้อย่างเต็มเปี่ยม มี ความเห็นอกเห็นใจคนที่อ่อนด้อยกว่า ถ้าเป็นครูบาอาจารย์ก็สอน ลูกศิษย์ด้วยความอดทนต่อความร้ายกาจต่างๆ ของลูกศิษย์ เป็นเพื่อนที่เห็นอกเห็นใจเพื่อน และเป็นที่พักพิงใจที่ดีสำหรับคนรักที่หัวใจร้าวรานมาก่อนที่จะได้พบ กับคนเกิดวันที่19 และที่สำคัญถ้าเขาเป็นคนรักหรือคู่ครองของใครแล้ว เขาจะรับผิดชอบต่อคนรัก เขาจะรับผิดชอบ ต่อคนรักและครอบครัวอย่างดีเยี่ยม\r\n\r\nกำลังภายในประการที่3ของคนเกิดวันที่19ก็คือความ เป็นผู้มีระดับสติปัญญาสูง มีปฏิภาณไหวพริบดี ว่าที่จริงคนที่ เกิดวันนี้เป็นคนฉลาดหลักแหลมและมักรู้ได้ว่าจะทำตัวให้ได้เปรียบคนร่วมงาน ได้อย่างไร แต่เขาไม่ทำเพราะเป็น คนมีเมตตาเป็นคุณธรรมอยู่แล้ว ความมีสติปัญญาและปฏิภาณ ไหวพริบของเขาจึงใช้เพียงเพื่อทำความสำเร็จให้แก่ ตัวเอง และป้องกันการรังแกของคนอื่นเท่านั้น ไม่ได้ใช้เพื่อรังแกคนอื่น คนที่มีสติปัญญาเฉียบแหลม มีมานะพยายาม มีเมตตาเป็นคุณธรรมอย่างนี้ ถ้าใครพบแล้วปล่อยให้ผ่านไปก็เป็นเรื่อง น่าเสียใจนะเนี่ย จุดด้อยของคนที่เกิดวันที่19ก็มีอยู่อารมณ์ของตัวเองซึ่งแปรปรวนไปได้บ่อยๆ แต่ด้วยสาเหตุเดียว เท่านั้นคือความหึงและมักจะหึงอย่างไม่มีเหตุผลด้วย....แต่คนเกิดวันนี้เป็น คนดีที่รักครอบครัว มากนะครับ '),(20,'วันที่20','20','','','','','','','เกิดวันที่ 20 : คนเก่งที่อารมณ์แปรปรวน\r\n\r\nลักษณะนิสัยของคนเกิดวนนี้ดูเหมือนจะเป็นลักษณะที่ค่อนข้างจะอ่อนไหวง่าย อารมณ์ปรวนแปร บางวัน อาจชอบท่านอย่างมากมาย แต่โดยที่ท่านยังไม่รู้สาเหตุเขาอาจไม่ชอบท่านแล้วก็ได้ และเมื่อถามไถ่กันถึงสาเหตุ อาจได้คำตอบซึ่งตอบมาอย่างจริงใจว่า ก็ไม่รู้เหมือนกัน แล้วก็กลับ มาชอบท่านอีก\r\n\r\nคนเกิดวันนี้เป็นคนค่อนไปในทางเจ้าอารมณ์ แต่ก็มักรู้ตัวเองจึงต้องระมัดระวัง อารมณ์ตัวเองอยู่เสมอ จนกระทั่ง ค่อยๆเกิดเป็นความกดดันภายใน อารมณ์จึงแปรปรวนได้ง่าย จึงปรากฎบุคลิกภาพในทำนองที่ว่า โดยปกติจะเป็นคนสุภาพเรียบร้อย น่ารักอ่อนหวานและผ่อนปรน แต่ถ้าเกิดความกดดันจนยับยั้งชั่งใจไม่อยู่ก็จะระเบิดอารมณ์ออกมาราว ภูเขาไฟ ที่กล่าวอย่างนี้ ทำให้ดูเหมือนว่าคนเกิดวันนี้ มีอารมณ์อ่อนไหวเป็นจุดด้อยที่สำคัญและน่ากลัว ที่จริงแล้วมิใช่ เช่นนั้น ตามปกติเมื่อพูดถึงคนเกิดวันที่ต่างๆ19วันที่ผ่านมามักเริ่มต้นด้วยการพูดในจุดเด่นก่อน แต่วันที่20นี้คนเขียน เกิดอารมณ์แปรปรวนขึ้นมาก็เลยหยิบด้านอ่อนด้อยขึ้นมาพูดก่อนเท่านั้น\r\n\r\nที่จริงแล้วคนเกิดวันที่20นี้เป็นคนเก่ง ( ม.ร.ว.คึกฤทธิ์ ปราโมช เป็นคนหนึ่งที่เกิดวันที่20 ) คนเกิดวันนี้มักมีมันสมอง เป็นเลิศ ฉลาดรู้ทันเล่ห์เหลี่ยมของคนอื่น และลึกซึ้งพอที่จะทำเป็นรู้ ไม่ทันเพื่อตลบหลังศัตรูอีกด้วยซ้ำ เป็นคนที่ มีความสามารถรอบด้าน รอบรู้ในปรัชญา การเมือง การเศรษฐกิจ ทำธุรกิจเก่ง เขียนหนังสือก็ดี วิทยาการสมัยใหม่ ก็เยี่ยมยอด แถมยังมีน้ำใจกว้าง ขวางในเรื่องความรู้ความคิด พร้อมที่จะให้ความคิดเห็น คำแนะนำ ความรู้แก่ใครก็ตามที่ถูกใจ และกล้าเข้าไปขอคนเกิดวันที่20เป็นคนชอบมีเพื่อนฝูงจะมีความสุขถ้าได้อยู่กับเพื่อน โดยเฉพาะ อย่างยิ่งเพื่อนที่เข้าใจอารมณ์ และรู้จัก ความสามารถของเขา ยิ่งถ้ามีความรู้ความสามารถในระดับ เดียวกันแล้วจะยิ่งชอบเป็นพิเศษ\r\n\r\nถ้าท่านพบคนเกิดวันที่20และนึกพอใจถูกใจแล้ว ท่านต้องเรียนรู้วิธีที่จะเข้าใจอารมณ์ของเขา และต้องทำตัวเป็นผู้แสดง ความยอมรับความสามารถของเขาอย่างถูกจังหวะ ไม่ใช่หัวประจบ คนเกิดวันที่20อาจมีอารมณ์รุนแรงไปบ้างในบาง ครั้ง แต่ถ้าคบกันนานๆและเข้าใจกันขึ้นเรื่อยๆ ท่านจะพบว่า คนเกิดวันเป็นคนที่น่าคบและพร้อมที่จะเป็นหลักพัก พิงหัวใจรักของคุณได้ดี '),(21,'วันที่21','21','','','','','','','เกิดวันที่21 มีเสน่ห์ สร้างมิตรภาพ\r\n\r\nคนเกิดวันที่21เป็นคนที่ใครๆถ้าได้สัมผัสใกล้ชิดหรือแม้เป็นเพื่อนร่วมงานด้วยก็จะรู้สึกในความ นุ่มนวลเจ้าเสน่ห์น่าคบ ได้เป็นอย่างดี เพราะคนเกิดวันนี้เป็นคนง่ายๆคบใครก็ทำตัวเรียบง่าย เสมอหน้ากันหมดทุกคนทุกระดับขั้น ความสามารถ พิเศษของคนที่เกิดวันนี้ก็คือความสามารถ ในการปรับตัวให้เข้ากับสถานการณ์ และความสามารถในการแก้ไขสถานการณ์ ตึงเครียดลงได้ ด้วยความนุ่มนวลที่มีอยู่ในตัว คุณสมบัติยอดเยี่ยมอีกอย่างหนึ่งคือ การเก็บซับรายละเอียดต่างๆ อย่างรอบคอบตลอดเวลา เมื่อถึงเวลาตัดสินใจก็ทำได้รอบคอบถูกต้องซึ่งจุดนี้เป็นเรื่องสำคัญ สำหรับคนที่มีเพื่อนเกิดวันที่21 ควรรู้เพราะถ้าจะเสแสร้งเพื่อให้ถูกใจคนเกิดวันนี้ได้ยาก ท่านจะถูกสังเกตอยู่เสมอโดยไม่รู้ตัวว่ากำลังถูกสังเกต\r\n\r\nคนที่เกิดวันนี้ มีพรสวรรค์ในการสร้างมิตรภาพ มีวิธีการที่แนบเนียนและนุ่มนวลในการทำความ รู้จักกับคนอื่นๆยิ่งเมื่อ ประกอบกับนิสัยร่าเริงสนุกสนาน เป็นคนง่ายๆเข้ากับคนได้ทุกระดับชั้น ด้วยแล้วคนเกิดวันนี้จึงเป็นคนมีมิตรสหายมากมาย\r\n\r\nคนเกิดวันนี้แม้จะชอบพูดถึงความสามารถ ที่ตนเองมีอยู่บ้างเหมือนกับคนที่เกิดวันอื่นๆก็ตาม แต่ก็จะไม่พูดโอ้อวดเกินจริง และที่สำคัญ คนที่เกิดวันนี้จะไม่ยกคนข่มคนอื่นเป็นอันขาด และเขาไม่ชอบคนที่ข่มคนอื่นด้วย จึงเป็นคน ที่ทำให้คนที่ รู้จักรู้สึกสบายใจและปลอดภัยเมื่อได้พูดคุยด้วย แล้วท่านจะหลีกเพื่อนที่ดีน่ารัก เช่นนี้ไปได้อย่างไร?\r\n\r\nคนเกิดวันที่21เข้าใจคน เห็นอกเห็นใจและเป็นคนช่างเอาใจและมีจิตสำนึก คือมีความรู้สึกนึกคิด ในทางที่ดีงามเสมอ เมื่อมี ปัญหาใดๆก็พอใจที่จะเข้าไปแก้ปัญหาด้วยการเจรจาอย่างนุ่มนวลแบบ นักการฑูตมากกว่าที่จะใช้วิธีการที่รุนแรง แต่คนที่เกิดวันนี้เมื่อถึงคราวจะต้องใช้ความเด็ดขาด รุนแรงขึ้นมาก็จะใช้ได้อย่างเฉียบขาด และเฉียบคมมีคำพูดที่เชื่อดเฉือนหัวใจยิ่งกว่าที่เรียกว่า ใบมีดโกนอาบน้ำผึ้งซะอีก\r\n	'),(22,'วันที่22','22','','','','','','','คนเกิดวันที่22 มีบุคลิกภาพที่ซ้อนกันอยู่\r\n\r\nแต่ถ้าสังเกตดีๆแล้วก็จะพบว่า นิสัยที่แท้จริงของคนเกิด วันนี้คือ ความคงเส้นคงวาที่ซ่อนอยู่ภายในความอ่อนไหวเปราะบาง แต่เมื่อดูภายนอกจะเห็นว่า เมื่อเผชิญกับ สถานการณ์ที่เปลี่ยนไปจะมีปฏิกิริยาตอบสนองในทันที จึงจำเป็นที่จะต้องมีคน มาประคับประคองให้กำลังใจปลอบใจ\r\n\r\nคนเกิดวันนี้เมื่อผิดหวังจะแสดงความเสียใจทันที แต่จะค่อยๆรับฟังเหตุผล ทบทวน ไตร่ตรองตามความเป็นจริง รับฟังคำวิพากษ์วิจารณ์แยกแยะ ปัญหา แล้วก็จะค่อยกลับคืนมาทำใจยอมรับ ความเป็นจริง เรียกความมั่นใจกลับคืนมาได้\r\n\r\nในส่วนที่เป็นบุคลิกภาพทางจิตใจที่แท้จริงของคนเกิดวันนี้นั้นก็คือ การเป็นคนที่ทำอะไรเป็น ระเบียบเรียบร้อย ละเอียดละออ รักษากฏเกณฑ์ได้ครบถ้วน และใช้หลักเหตุผลในการตัดสินใจ ที่เด่นมากคือความเป็นคนเสมอต้นเสมอปลาย คงเส้นคงวา ไม่ว่าจะในด้านการทำงาน ความสัมพันธ์ กับคนอื่นหรือเรื่องความรักและ ครอบครัว คนเกิดวันนี้จะแสดงให้เห็นอย่าง สม่ำเสมอ ถึงความรักแหละห่วงใยคนรักหรือคู่ครอง ซึ่งก็หมายความว่า ถ้าท่านเป็นคนยุ่งเหยิง ไร้ระเบียบและตามอารมณ์แล้ว ท่านก็คงไม่ถูกใจคนเกิดวันที่22นัก\r\n\r\nคนเกิดวันที่22เป็นคนเอาใจใส่ รับผิดชอบการงานเป็นอย่างดี ให้ความสำคัญกับสิ่งที่เรียกว่า มิตรภาพ มากทีเดียวทั้งเป็นคนจริงใจต่อมิตร พร้อมที่จะให้ความช่วยเหลือมิตรทุกคนอย่างเต็มที่ ปัญหาจึงมีอยู่ว่า ท่าน จะทำให้คนเกิดวันนี้รับท่านมิตรได้อย่างไร คำตอบมีอยู่แล้วถ้าท่านอ่านทบทวน ท่านก็จะสามารถทำได้\r\n\r\nคนเกิดวันที่22เกลียดคนที่แสดงอารมณ์ต่อคนอื่น เกลียดคนที่ชอบทำให้คนอื่น เสียหน้าหรือขาดความมั่นใจ แต่เป็นที่น่าแปลกว่าคนที่เกิดวันนี้มีความสามารถเพียงพอ ที่จะเป็นผู้นำที่ดีและคุมคนมากๆได้ '),(23,'วันที่23','23','','','','','','','คนเกิดวันที่23 มีบุคลิกภาพที่สง่า\r\n\r\nคนเกิดวันที่23 มีลักษณะที่คนมักจะมองดูห่างๆด้วยความระแวดระวังหรือเกรงกลัว เพราะเป็นคน ที่มีบุคลิกภาพที่สง่า มั่นคง และมักแสดงออกให้เห็นได้ชัดเจนว่ามีความมั่นใจในตัวเองสูง คนเกิดวันนี้แม้ไม่อยู่ในตำแหน่งที่ มีอำนาจใดๆ แต่ก็มีอำนาจและอาจก้าวขึ้นสู่อำนาจได้จริงๆ คนเกิดวันที่23จึงเป็นคนที่ใครๆเห็นว่า มีความไว้ตัวและดื้อรั้น ซึ่งก็เป็นการมองที่ถูกต้อง ในลักษณะนิสัยด้านหนึ่ง\r\n\r\nแต่ในอีกด้านหนึ่งนั้นคนเกิดวันนี้เป็นคนเข้าใจซาบซึ้งใน บทกวี ดนตรี ศิลปะ ปรัชญา มีความอ่อนโยนต่อธรรมชาติเป็นอย่างยิ่ง ท่านที่จะเป็นมิตรกับคนเกิด วันที่23 จึงควรเป็นคนรอบรู้ศิลปวิทยาการเหล่านี้ และควรเรียนรู้ที่จะใช้ชีวิตกับคนที่เกิดวันนี้ อย่างผู้มีรสนิยมอันเลิศด้วย คนกลุ่มนี้พร้อมที่จะตกหลุมรักใครง่ายๆโดยเฉพาะอย่างยิ่งกับคน ที่มีนิสัยและรสนิยมตรงกัน แต่ถ้าเกิดขัดแย้งกันนิดเดียว เขาก็จะปล่อยคนที่เคยรักไว้อย่าง ไม่แยแสได้เหมือนกัน\r\n\r\nชีวิตของคนเกิดวันที่23 เป็นชีวิตที่มีการทำงานเป็นส่วนสำคัญ คนเกิดวันนี้ต้องการทำงานและ ทำอย่างอิสระ ต้อง การโอกาสที่จะแสดงความสามารถ และถ้าใครสักคนเข้าไปปิดกั้นโอกาส ไม่ให้แสดงความสามารถ หรือได้ทำสิ่งที่ เขาต้องการ แม้จะรักใคร่กันเพียงใด ก็อาจเป็นศัตรู คู่ปรปักษ์กันได้ทันที ไม่ว่าจะคนที่เป็นสามีหรือภรรยา\r\n\r\nคนเกิดวันนี้เป็นคนโลกทรรศกว้าง และพอใจที่จะคบคนโลกทรรศ์กว้างด้วยเช่นเดียวกัน เขาจะเป็นนักธุรกิจหรือ นักบริหารที่เก่งมาก โดยไม่ยอมให้ใครมาชี้นำ ไม่ยอมให้สิ่งแวดล้อมต่างๆมาทำให้หวั่นไหวได้ ไม่เปลี่ยนหลักการ โดยไม่มีเหตุผลเปลี่ยนหลักการได้ทันทีถ้าเหตุผลถูกต้องชัดเจน เมื่อทำงานใจก็จะมุ่งมั่น อยู่แต่ตามหลักการ เพื่อให้งานบรรลุผลเท่านั้น\r\n\r\nคนเกิดวันนี้มีความสามารถที่จะติดต่อกับคนทุกชั้นให้ประสบผลสำเร็จได้ อย่างไรก็ตาม คนเกิดวันนี้จะมีจุดอ่อนอยู่ที่สามารถเป็นคนใจหินขึ้นมาง่ายๆ เมื่อเกิดไม่สบอารมณ์ขึ้นมา '),(24,'วันที่24','24','','','','','','','เกิดวันที่24 ผู้มีน้ำใจ\r\n\r\nถ้าท่านมีเพื่อนเกิดวันที่24ก็นับว่าท่านมีโชค และถ้าตัวท่านเองเกิดวันที่24ตัวท่านก็นับได้ว่า เป็นผู้มีบุญมาแต่กำเนิดคนหนึ่งเหมือนกัน ลักษณะเด่นของคนที่เกิดวันนี้คือความมีน้ำใจ พร้อมที่จะช่วยเหลือเพื่อน หรือแม้แต่คนอื่นที่มิใช่เพื่อน หากตกอยู่ในภาวะที่จะต้องได้รับ ความช่วยแล้วคนเกิดวันที่24จะให้ความช่วย เหลือทันทีด้วยไมตรีจิต และไม่สนใจการตอบแทน\r\n\r\nคนเกิดวันที่24เป็นมิตรที่ดี เมื่อท่านมีความทุกข์ คนแรกๆที่จะมาให้ท่านเห็นคือคนที่เกิดวันที่24 และเมื่อท่าน มีความสุขคนที่จะมาถึงก่อนก็คือคนเกิดวันนี้ด้วยจะเป็นเพื่อนที่นำสิ่งที่มีประโยชน์ ชักชวนให้ทำสิ่งที่ดีงาม และ นำความสุขสมบรูณ์มาให้ท่านเสมอ\r\n\r\nคนเกิดวันนี้เป็นคนมีเสน่ห์ช่างรู้ใจ ถ้าท่านมีคนรักเป็นคนเกิดวันที่24 จะรู้ซึ้งถึงเสน่ห์ของคนเกิดวันนี้ว่า เป็นคน ช่างรู้ใจ และเป็นคน ช่างเอาอกเอาใจเสียจนท่านรู้สึกว่าท่านห่างเขาหรือเธอได้ยาก หรือขาดเขาไปแล้ว ท่านมีความสุข เหลือน้อยมา ด้วยเหตุนี้ใครที่รู้จักมักคุ้นจึงทั้งรักทั้งหลงคนเกิดวันที่ 24\r\n\r\nลักษณะนิสัยที่ดีเยี่ยมอีกอย่างหนึ่งของคนเกิดวันนี้ ก็คือความเป็นคนรับผิดชอบสูง ทั้งการงาน และครอบครัว โดยเฉพาะในเรื่องครอบครัวแล้ว คนเกิดวันนี้ถือว่าครอบครัวเป็นชีวิตจิตใจ ของเขาหรือเธอเลยทีเดียว การมี คู่สร้าง-คู่สมที่รักและรับผิดชอบครอบครัว นับเป็นโชคอย่าง วิเศษและถ้าท่านมีคนรักเกิดในวันที่24นี้ท่านก็มีโชคไปด้วย\r\n\r\nเสน่ห์อีกประการหนึ่งของคนที่เกิด วันที่24 คือ เสน่ห์ในการสนทนา คนเกิดในวันนี้เป็นนักฟังที่ดีและเห็นอกเห็นใจผู้พูดที่พูดไม่เก่ง เล่าเรื่องที่เต็มไปด้วยปัญหา เพราะเขาจับใจความเก่ง จับความคิดของผู้พูดได้ไวและเมื่อถึงเวลาพูด คนเกิดวันที่24ก็พูดได้เพราะ ฉลาด สามารถเจรจาชักจูงใจหรือให้ทัศนะที่เป็นประโยชน์ หรือ สามารถนำไปปฏิบัติได้จริงๆ\r\n\r\nจุดอ่อนของคนที่เกิดวันที่24 อยู่ที่ความรักเพื่อน และกลัวว่าตนจะเป็นภาระทำให้เพื่อนเดือดร้อนนี่เอง จึงทำให้คนเกิดวันนี้เป็นคนไม่ค่อยแสดงความรู้สึกในใจออกมา และยากที่จะปริปากบอกใคร ถึงความรู้สึกตนเอง ดังนั้น คนที่ทำงานด้วยหรืออยู่ใกล้ชิดต้องคอยสังเกตดูแลสักหน่อยมิฉะนั้น คนที่เกิดวันนี้อาจฟุบไปเฉยๆก็ได้ เพราะความ อ่อนเพลียแต่ไม่ยอมบอกใครและเพราะความที่ ชอบเก็บความรู้สึกนี้หากประสบปัญหาบ่อยๆเข้าอาจกลาย เป็นโรคประสาทได้ '),(25,'วันที่25','25','','','','','','','เกิดวันที่25 ผู้มีสติปัญญาดี\r\n\r\nถ้า ท่านมีเพื่อนเกิดวันที่25เป็นตัวอย่างอันีดสำหรับการอธิบายภาษิตที่ว่ารวง ข้าวที่มีเมล็ดมาก ย่อมน้อมต่ำติดดิน โดยพื้นฐานทางสติปัญญา คนเกิดวันที่25นี้เป็นคนที่มีสติปัญญาดี เป็นคนเรียนอะไรก็เข้าใจง่าย จะจับทำอะไร ก็ทำเป็นทำได้ดี แต่ไม่ว่าเขาหรือเธอที่เกิดวันนี้ จะมีความรู้ความสามารถสักแต่ไหน ก็จะไม่มีวันประกาศ สรรพคุณของตัวเองเลย และถ้าหากว่า จำเป็นจะต้องใช้ความรู้คู่ความสามารถให้ปรากฏ เขาหรือเธอที่เกิดวันที่25 ก็จะแสดงออกอย่างชนิด ที่ถ่อมตัว แสดงตนว่าไม่ใช่ผู้รู้วิเศษกว่าใครแม้แต่สักครั้ง\r\n\r\nลักษณะนิสัยดีเด่นอีกอย่างหนึ่งก็คือ เห็นธุระของเพื่อนสำคัญกว่าเสมอ ถ้ามีธุระที่ต้องทำพร้อมๆกันเขาหรือเธอ ที่เกิดวันนี้จะทำให้ เพื่อนเป็นอันดับแรก และให้ความรักใคร่ไว้วางใจเพื่อนเต็มที่เสมอ และคนที่เกิดวันนี้เป็นคน ที่มีความคิดสร้างสรรค์ แสวงหาสิ่งใหม่ๆดังนั้นเขาหรือเธอซึ่งเกิดวันที่25 มักไม่ยอม อยู่เฉยๆ ชอบให้มีการเปลี่ยนแปลงที่ท้าทายและตื่นเต้น คนเกิดวันที่25 อาจไม่ชอบเพื่อนหรือคนรัก ที่อนุรักษ์นิยม หรือเป็นคนที่ค่อนข้างเฉื่อย และคนที่เกิดวันนี้เป็นคนที่มีความคิดริเริ่มสูง และชอบที่จะมีเพื่อนวิจารณ์ความคิด ริเริ่มของเขาอย่างเฉียบคม\r\n\r\nคนเกิดวันนี้เป็นคนที่มีลักษณะเด่นอยู่ในตัว ดังนั้นไม่ว่าจะออกไปในงานสังคมใดก็เป็นที่น่าสน ของคนในกลุ่ม ในงานนั้น ทั้งที่คนเกิดวันที่25มิได้เป็นคนมีรูปร่างใหญ่โตหรือสวยหล่อสะดุดตา ผู้ใดเกินปกติ แต่บุคลิกภาพทีท่า และการแต่งกายและลักษณะเด่นในตัวเองจะจูงความสนใจ จากคนอื่นได้มาก ความสามารถในการเลียนแบบก็ เป็นความเด่นอีกอย่างหนึ่งของคนเกิดวันที่25 คนเกิดวันนี้มีความสามารถในการเลียนแบบหรือล้อเลียนคนอื่นได้ อย่างแนบเนียน ทำให้คนอื่น รู้สึกสนุกสนานและพอใจ\r\n\r\nคนเกิดวันที่25ไม่ชอบที่จะอยู่ในสถานการณ์เผชิญหน้าดังนั้น เมื่อมี ปัญหาขัดแย้งกับคนรัก คู่ครอง เพื่อน หรือแม้แต่ปัญหาในงาน คนที่เกิดวันนี้จะทำเป็นไม่สนใจ หรือปล่อยให้เป็นไปตามปกติก่อน แล้วจึงไป ชวนคุยนอกเวลาและปรับความเข้าใจทีหลัง จุดอ่อนของคนที่เกิดวันนี้ ความรู้สึกที่อ่อนไหวได้ง่ายต่อคำพูด ในบางครั้งคนที่เกี่ยวข้องพูดผิดหู นิดเดียว และโดยไม่ได้เจตนาเลย คนที่เกิดวันนี้ก็เก็บไปน้อยใจเสียยกใหญ่ '),(26,'วันที่26','26','','','','','','','เกิดวันที่ 26 ผู้มีกำลังใจเข้มแข็ง\r\n\r\nใครที่รู้ตัวว่าไม่ค่อยมั่นใจในตนเอง ขอได้โปรดคบเพื่อนหรือรักกับคนที่เกิดวันที่26 เถิด เพราะคนที่เกิดวันนี้เป็นคนสุขุม มั่นคงและมองการณ์ไกล ถ้าท่านอยู่ใกล้ก็จะค่อยๆมีความ มั่นใจตัวเองขึ้นได้\r\n\r\nความมีกำลังใจเข้มแข็งมั่นคงเป็น คุณลักษณะเด่นประการแรกของ คนเกิดวันที่26 ดังนั้นไม่ว่าในชีวิตของเขาหรือเธอจะเผชิญกับอะไร อุปสรรคหนักแค่ไหน คนเกิดวันที่26 ก็ไม่เคยหวั่น อาจร้องไห้แต่ไม่เคยยอมพ่ายแพ้แต่จะใช้สติปัญญา เริ่มต่อสู้กับอุปสรรคอย่างสุขุม ต่อไป ความสุขุมมองการณ์ไกลเป็นสิ่งเสริมความมั่นใจตัวเอง ที่สำคัญของคนที่เกิดวันที่26 คนเกิดวันนี้มักไม่ตื่นเต้น กับเหตุการณ์ ไม่หวาดกลัวแต่จะ แก้ปัญหาต่างๆอย่างฉลาดรอบคอบสุขุม\r\n\r\nคนเกิดวันนี้เป็นคนที่มีความเห็นอกเห็นใจคนอื่น และมีคุณสมบัติที่ทำให้เข้าใจปัญหาของคนอื่น ได้ง่าย ความฉลาดรอบคอบ สุขุม ความคิดลึกซึ้งที่มีอยู่ ทำให้คนที่เกิดวันนี้เป็นคนเห็นอกเห็นใจ ผู้อื่น มีอะไรเกิดขึ้นเพียงนิดเดียวก็จะเข้าใจ ความเป็นมาเป็นไปได้อย่างรวดเร็วทันที\r\n\r\nคุณสมบัติเด่นอีกอย่างหนึ่งของคนที่เกิดวันที่26ก็คือความเป็นผู้นำ คนเกิดวันนี้จะเป็นผู้นำที่ดี มีความสามารถในการจัดการ และเป็นนักบริหารที่มีความสามาถ เป็นคนมีความรอบรู้และเก่ง หลายด้าน ประกอบกับเป็นคนที่มีความทะเยอทะยานสูงไม่ชอบเป็นลูกน้องใคร จึงทำให้คนเกิด วันที่26ปรากฏภาพโดดเด่นในฐานะ เจ้าพ่อ ลูกพี่หรือหัวหน้า คนเกิดวันที่26เป็นคนที่ไม่ชอบ ความปนเปก้าวก่ายโดยนิสัยส่วนตัวจะค่อนข้างปราณีต เช่นเสื้อผ้าแต่งกายของเขาหรือเธอ อาจต้องจัดไว้เป็นชุดอย่างถูกต้อง เสื้อผ้าแต่งกายของคนที่เกิดวันนี้อาจต้องจัดไว้เป็นชุดอย่าง ถูกต้อง ท่านจะไม่ค่อยพบคน ที่เกิดวันนี้แต่งกายชนิดสีรองเท้าไปทางหนึ่ง สีเสื้อผ้าไปทางหนึ่ง สีเสื้อผ้าไปอีกทางหนึ่ง กระเป๋าถือไปอีกสีหนึ่งเป็นอันขาด\r\n\r\nคนเกิดวันนี้จะหงุดหงิดง่ายกับการประชุม ที่ไม่ตรงเวลา ห้องอาหารที่ผู้คนสับสนส่งเสียงดัง หรือการชุลมุนแย่งกัน รีบบริการโดยไม่เรียงลำดับ คนเกิดวันที่26จะไม่ยอมให้ชีวิตครอบครัวเข้ามายุ่งเกี่ยวกับการงานอย่างเด็ดขาด ถ้าเป็นคู่รัก คู่ครอง หรือเพื่อนสนิทจงอย่าน้อยใจเลยถ้าท่านไม่รู้เรื่องราวเกี่ยวกับงานของเขาหรือเธอผู้ที่เกิด วันนี้ คนเกิดวันนี้แม้ว่าจะเป็นคนเห็นอกเห็นใจผู้อื่น สุขุมรอบคอบมั่นคงไม่หวั่นไหวและอยากให้ ทุกคน รักใคร่เข้าใจกัน แต่ก็เป็นคนที่ยึดมั่นในลักษณะของตนอย่างมั่นค งอาจกล่าวได้ว่าเป็นคนดื้อ ทีเดียว อย่าไปขอให้คนเกิดวันที่26ทำตามใครโดยไม่ถูกหลักเกณฑ์เป็นอันขาดถ้ายังอยากมีไมตรี อันยืนยาวต่อกัน '),(27,'วันที่27','27','','','','','','','เกิดวันที่ 27 ผู้ทรงความยุติธรรม\r\n\r\nมี บางคนพูดว่าบางทีเปาบุ้นจิ้น อาจเป็นคนที่เกิดวันที่27ก็ได้ คนที่เกิดวันที่27มีความสามารถ เป็นพิเศษในการ แยกแยะสิ่งที่ถูกกับสิ่งที่ผิด สิ่งที่ดีกับสิ่งที่เลวออกจากกันได้ง่าย และเมื่อเห็นว่า สิ่งใดผิดสิ่งใดไม่ดีแล้ว คน เกิดวันนี้ก็จะถูกจิตสำนึกมโนกรรมภายในคอยบังคับมิให้กระทำสิ่งนั้น เป็นอันขาด และถ้าบังเอิญได้กระทำลงไป จะด้วยประมาทหรือสถานการณ์ยังบังคับก็ตาม คนที่เกิดวันนี้ก็จะไม่ลืมเรื่องนั้นเป็นอันขาด จะจดจำเหตุการณ์ นั้นเป็นความไม่สบายใจไปตลอด ชั่วชีวิต หรือจนกว่าจะมีการแก้ไขสิ่งที่ผิดให้ถูกต้อง คนเกิดวันนี้แหละ คือคนที่จะแน่วแน่แก้ไข ในสิ่งผิด\r\n\r\nคนเกิดวันนี้เป็นคนที่มีความเมตตาสูง รักคนอื่นเหมือนรักตัวเอง แต่ความเมตตานี้มี ขอบเขตโดยจะมีให้อย่างเหลือเฟือกับคนที่ถูกต้องทำนองคลองธรรม แต่ถ้าคนผิดคนชั่วแล้ว สิ่งที่คนเกิดวันที่27 มีให้ก็คือ ความเห็นใจ ความเสียใจ คนเกิดวันนี้จึงเป็นคนที่มีความรับผิดชอบสูง เป็นพ่อแม่ที่ดี เป็นครูที่ดี และเป็นหัวหน้าผู้เที่ยงธรรม\r\n\r\nคนเกิดวันที่27 เป็นคนค่อนข้างอนุรักษ์นิยม ยึดมั่นในแบบธรรมเนียมประเพณีและมักใช้แบบแผน ธรรมเนียมประเพณี เป็นเกณฑ์ในการแยกถูก-ผิด ดีชั่ว จึงมีลักษณะเป็นคนหัวโบราณ คนเกิดวันนี้ มักจะค่อนข้างดื้อรั้นในสายตาคนอื่น แท้จริงแล้ว ความดื้อของเขาอยู่บนพื้นฐานแห่งการแยกชั่ว-ดี แล้วมากกว่า คนเกิดวันนี้จะมีความกังวลใจอยู่ตลอดเวลา ถ้า หากเขาได้กระทำสิ่งที่ทำให้คนอื่น เดือดร้อน ความกังวลอย่างนี้จะทำให้ชีวิตของคนเกิดวันนี้ค่อนข้างเครียดและจะไม่คลายลงจนกว่า เขาหรือเธอจะอธิบายให้อีกฝ่ายหนึ่งเข้าใจ คนเกิดวันนี้มีลักษณะบางอย่างที่ขัดแย้งในตัว คือมักชอบ คบมิตรสหายฮาเฮแต่ก็ชอบนิ่งเงียบๆอยู่กับความคิด ของตัวเองบ่อยๆดังนั้น ถ้าเพื่อนผู้เกิดวันที่27 ของท่านอยู่ๆก็หายหน้าไปท่านไม่ต้องติดใจอันใด อีกไม่นานคนผู้นั้นก็จะกลับมา\r\n\r\nคนเกิดวันที่27จะเก็บความรู้สึกเจ็บปวดในใจอันเกิดจากความรักได้เป็นอย่างดี ถ้าคนรักจะ แยกทางไป เขาหรือเธอก็จะเพียงนิ่งเฉยและเก็บความเจ็บปวดไว้ในใจไม่ให้ใครได้เห็น และถ้าท่านเกิดวันนี้ลดความ เอาจริงเอาจังอีกนิดเครียดน้อยอีกหน่อย ท่านก็จะมีความสุขอัน บริบูรณ์ ด้วยความดีในตัวของท่านเอง\r\n	'),(28,'วันที่28','28','','','','','','','คนเกิดวันที่28เป็นคนที่มีความสุขกับชีวิตที่ไม่เคร่งครัด\r\n\r\nหลักเกณฑ์หรือกำหนดการต่างๆของชีวิต มิได้มีความสำคัญแก่ชีวิตมากนัก ชีวิตของคนเกิดวันที่28จึงค่อนข้างเป็น ชีวิตที่ตามสบาย คนเกิดวันนี้เป็นคนมีจิตใจอ่อนโยน สงสารคนง่ายรักคนง่าย ไว้ใจคนง่าย ชอบความสะดวก สบายและชอบอำนวยความสะดวก ให้กับเพื่อนหรือคนรัก เป็นคนที่รักใครๆและอยากให้ใครๆรัก อยาก ให้ทุกคนรักกันและอยาก ให้เพื่อนๆรักกันอย่างมีความสุขดังนั้นความทุกข์ของคนเกิดวันที่28 จึงมักเกิดจากการที่เพื่อน ของเขาเกิดทะเลาะกันเอง เขาจะรู้สึกโชคร้ายที่สุดเมื่อถูกเพื่อนหลอกลวง\r\n\r\nเพื่อน เป็นคำที่มี ความหมายที่สุดสำหรับคนเกิดวันที่28 เพราะคนเกิดวันนี้ขี้เหงา และอยู่คนเดียวไม่ได้เด็ดขาด ต้องมีเพื่อนชีวิตจึงจะเป็นสุข ท่านจึงพบคนเกิดวันนี้เริงร่าอยู่ในหมู่เพื่อนเสมอๆ มิใช่น้อยเลย ที่ถึงแม้จะแต่งงานมี ครอบครัวแล้วก็ยังแบ่งเวลาให้เพื่อนมากกว่าครอบครัวตัวเอง ถ้าคู่ครอง ไม่เข้าใจกันก็ถึงกับโกรธกันก็บ่อยไป แต่ อย่างไรก็ตามแม้คนเกิดวันนี้จะรักเพื่อนและให้ความ สำคัญกับเพื่อนมาก แต่ก็จะตัดสินใจเรื่องสำคัญๆด้วยตัวเอง เสมอ รักเพื่อน แต่ไม่ยอมให้เพื่อน มีอิทธิพลเหนือตน\r\n\r\nลักษณะที่ขัดแย้งกันของคนเกิดวันที่28 จะพบได้ในเรื่องความดื้อรั้น คนเกิดวันนี้เป็นคนรักเพื่อนเป็นคนสนุก สนานมีอารมณ์ขันแต่มักดื้อดึงอย่างไม่มีใครเทียบ ถ้าหากเขาหรือเธอคิดจะดื้อขึ้นมา คนเกิดวันนี้แม้ว่าจะเป็น คนสะเทือนใจได้ง่าย ใจอ่อนกับ เหตุการณ์ซึ่งแม้จะมิได้เกิดขึ้นกับตัวเองก็ตาม แต่คนเกิดวันนี้ก็เป็นคนกล้าที่จะพูด และทำ เพื่อป้องกันสิทธิของตัวเองและผู้อื่นอย่างเต็มที่เมื่อถึงความจำเป็น ดังนั้น บางทีท่านจึงอาจแปลกใจ ที่เพื่อน ผู้ดูเหมือนเป็นคนตามสบายเกิดเอาจริงเอาจังขึ้นมาในเมื่อพบเห็นการรังแกหรือถูกรังแก\r\n\r\nจุดอ่อนของคนเกิดวันที่28ก็อยู่ตรงที่ว่าปกติแล้วเป็นคนไม่เคร่งครัดอันใด ปล่อยชีวิตไปเรื่อยๆ ตามสบาย แต่เมื่อมีอะไร มากระทบกระเทือนใจแล้วมักวู่วามทำให้ความสุขน้อยลงไป จนกว่า จะรู้จักระงับและหาทางระบายออกที่นุ่มนวลขึ้น ถ้าท่านมีเพื่อนเกิดวันนี้ขยับเข้าใกล้เขาอีกนิด เพราะคนเกิดวันนี้อยู่คนเดียวไม่ได้เด็ดขาด ถ้าขาดเพื่อนแล้วจะรู้สึกว้าเหว่ ที่สุด '),(29,'วันที่29','29','','','','','','','เกิดวันที่29 ผู้มีพรสวรรค์ทางสร้างสรรค์\r\n\r\nคนเกิดวันที่29 มีโชคเบื้องต้นหรือจะเรียกว่าพรสวรรค์อยู่หนึ่งอย่าง คืออยู่ที่ความคิดสร้างสรรค์ และความสามารถในการ ประดิษฐ์อันเป็นการทำให้ความคิดสร้างสรรค์กลายเป็นสิ่งที่จับต้องได้ คนเกิดวันนี้เป็นคนช่างฝัน และสามารถทำความฝัน ให้เป็นจริงได้ นักวิทยาศาสตร์ นักประดิษฐ์ หลายคนเกิดในวันที่29 คนเกิดวันนี้ส่วนใหญ่จะมีความสุขมาก ถ้าได้ทำงาน ในด้านการประดิษฐ์ คิดค้น การทดลองทางวิทยาศาสตร์และเทคโนโลยี และเขาหรือเธอมักจะประสบความสำเร็จในด้านนี้ อย่างรุ่งโรจน์ ด้วยเหตุที่พื้นนิสัยเป็นเช่นนี้\r\n\r\nคนที่เกิดวันที่29จึงมีเพื่อนหรือคนรักที่มีความเข้าใจไม่ปล่อยให้เขาหรือเธอ จมอยู่กับเครื่องมื่อ ทดลองวิจัยทางวิทยาศาสตร์ หรือในห้องcomputer แต่ควรจะต้องพาเขาหรือเธอออกไปสู่สังคม รู้จักโลก ที่เป็นจริง รู้จักชื่นชมกับความสุขและความงามของมนุษย์ ของธรรมชาติซึ่งเรื่องนี้บางที พ่อแม่ควรจะต้องทำ แทนที่จะดีใจว่าลูกของท่านเป็นคนขยันเรียนอย่างเดียว ความทุกข์ของคน เกิดวันนี้จะเกิดขึ้นในเมื่อเขาหรือเธอต้องทำงานที่ตัวเขาหรือเธอไม่ชอบทำ หรือต้องเรียนรู้ หรือทำความเข้าใจ ในเรื่องที่เขาไม่สนใจ เขาจะเบื่อเรื่องดังกล่าวง่ายๆ คนเกิดวันนี้เบื่อง่าย ถ้าไม่ได้งานที่ชอบก็จะเบื่อทันที\r\n\r\nอันที่จริงแล้วคนเกิด วันนี้เป็นคนที่มีเสน่ห์ และน่ารักกับคน ที่เขาหรือเธอพอใจ เป็นคนที่เรียกได้ว่ารักเดียวใจเดียว เมื่อได้พอใจหรือรักใครแล้วก็ จะไม่ผันแปรไปได้ มีความรับผิดชอบต่อคนรักและครอบครัวดี แต่ใครก็ตามที่เป็นคนรักกับคน ที่เกิดวันนี้ก็จะต้องพบกับข้อ ยุ่งยากบ้าง โดยเฉพาะความยุ่งยากอันเกิดจากความเก่งซึ่งทำให้ เขาเป็นคนมองโลกอย่างไม่เข้าใจ หรือบางครั้งถึงกลับกลายเป็น คนหลงตัวเองหรือหลงกลุ่มไปได้ เช่นหลงผิดไปว่ากลุ่มของตนเท่านั้นที่มีความเก่งชำนาญในสาขาอาชีพนี้เป็นเลิศ เป็นพวกที่ ชอบมองว่าคนต่างกลุ่มมีเกียรติน้อยกว่าตน บางทีเผลอๆยังแอบดูถูกภรรยาสามีและญาติของแฟน ว่าโง่กว่าตนก็มี\r\n\r\nและที่สำคัญคนเกิดวันที่29เป็นคนที่แม้แต่คนใกล้ชิดที่สุดก็ยากที่จะหยั่งรู้ความรู้สึกจริงๆของเขา หรือเธอได้ เป็นคนพวกที่ชอบ มีชีวิตลึกลับชวนให้คนพิศวง และเขาหรือเธอผู้เกิดวันที่29จะรู้สึก อึดอัดมาก ถ้าคนรู้เกี่ยวกับตัวเขาหรือเธอมากกว่าที่ต้องการ ให้รู้'),(30,'วันที่30','30','','','','','','','คนเกิดวันที่30 ฉลาด เข้มแข็ง\r\n\r\nคนเกิดวันที่30 มีพื้นนิสัยที่ดีหลายอย่าง แต่สิ่งที่พระเจ้าลืมประทานมาให้เขาหรือมีมาให้ก็มีน้อย ก็คือความมีเสน่ห์ โดยพื้นฐานของดวงชะตา คนเกิดวันที่30 มักจะเป็นคนฉลาดและมีความ มั่นใจในตัวเองสูง ไม่ว่าดูภายนอกจะมีลักษณะ อย่างไร แต่ภายในจิตใจ ของเขามี วิธีการ หรือคำตอบหรือคำตัดสินของปัญหาที่จะต้องเผชิญไว้พร้อมแล้ว และเมื่อตัดสินใจแล้ว ก็เป็นอันจบกัน ไม่ต้องหวนกลับมาพูดกันด้วยเรื่องเก่านั้นอีก การคิดในใจอย่างฉลาดนี้เอง ทำให้คนเกิดวันนี้สามารถแก้ปัญหาต่างๆลุล่วงไปได้ด้วยดี สามารถตัดสินใจทำอะไรได้โดย ไม่ลังเลใจ\r\n\r\nคนเกิดวันที่30มีบุคลิกภาพที่เข้มแข็งแสดงให้เห็นความเป็นคนเด็ดขาด ดูน่าเกรงขาม เป็นคนที่รู้ว่าตัวเองมีดีอะไรและศัตรู คู่แข่งขันมีอะไรดี สามารถใช่ความได้เปรียบที่มีอยู่เอาชนะ คู่แข่งได้ไม่ยากลำบาก อ่านความคิดคนอื่นได้ปรุโปร่ง หรือ มีญาณสังหรณ์ที่ช่วยป้องกันกลอุบาย ของคู่แข่งขันได้จึงมักจะเอาชนะคนอื่นได้เสมอ อำนาจก็ยิ่งมีมากขึ้น คนที่เกิดวันนี้มีสติปัญญาหลักแหลมเรียนรู้อะไรได้เร็วกว่าคนอื่น โดยเฉพาะอย่างยิ่งถ้าเรื่องนั้น เป็นเรื่องของการตีความ ถ้อยคำสัญลักษณ์และปรัชญาต่างๆแต่ก็ไม่ค่อยชำนาญเรื่องเครื่องกลไก ต่างๆมากนัก\r\n\r\nคนเกิดวันที่30ชอบทำอะไรยากๆ ที่คนธรรมดาสามัญไม่ค่อยทำกัน จะทำแต่สิ่งที่ดีเลิศ จริงๆแม้ในเรื่องความรัก คนเกิดวันนี้ก็มักจะพุ่งความสนใจ ไปยังคนที่มีลักษณะเป็นดอกฟ้า หรือท่านชายมากกว่าที่สนใจคนธรรมดา ถ้าท่านอยากให้คนที่เกิดวันที่30 สนใจ ท่านต้องทำตัว ให้เป็นงานที่ยากกว่าธรรมดา\r\n\r\nนอกจากจะเป็นคนชอบทำอะไรยากๆ แล้ว คนเกิดวันนี้เป็นคนที่มีอะไรบางอย่างแปลกไปจากคนอื่น มีความสามารถพิเศษที่คนทั่วๆไปอาจทำไม่ได้ หรือนึก ไม่ถึงว่าจะมีใครทำได้เช่นนั้น เป็นคนที่มี ความเห็นที่รุนแรงมาก โดยเฉพาะในด้านการเมือง ศาสนา ชีวิตแม้กระทั่ง ความรัก คนเกิดวันนี้ กับความรักนั้นมีลักษณะของคนที่ขาดเสน่ห์ คนที่เกิดวันนี้ค่อนข้างพอใจที่รักคนเก่งกาจ แต่ต้อง เก่งน้อยกว่าตนเอง ชอบใช้อำนาจแสดงให้เห็นว่าตนเองมีอำนาจเหนือคู่ครอง '),(31,'วันที่31','31','','','','','','','คนเกิดวันที่31 ได้รับพรจากพระเจ้าเรื่องสติปัญญา\r\n\r\nจึงเป็นผู้มีสติปัญญาดีเฉลียวฉลาดแบบที่เรียก กันว่าไหวพริบดี (ไม่ใช่เรียนหนังสือเก่ง)ดังนั้นเมื่อจะจับทำงานใดก็มักจะประสบความสำเร็จ ระดับสูงเสมอ โดยลักษณะนิสัย คนที่เกิด วันนี้เป็นคนสุภาพอ่อนน้อมถ่อมตน และไม่ชอบโอ้อวด หรือแม้แต่แสดงตนเกี่ยวกับความสำเร็จหรือความก้าวหน้าต่างๆ คนทั่วไปแม้จะรู้ว่าเขาหรือเธอ ซี่งเกิดวันที่31เป็นคนที่ประสบความสำเร็จ แต่ก็ไม่มีใครรู้จริง แม้แต่เพื่อนสนิท ว่าที่จริงแล้ว ความสำเร็จที่คนอื่นเห็นนั้นเป็นเพียงเศษส่วนเท่าใดของความสำเร็จที่เขาได้รับ\r\n\r\nคนเกิดวันที่31 เป็นคนรักเพื่อนฝูง ความสุขที่แท้จริงของคนเกิดวันนี้ก็คือการได้อยู่ท่ามกลางเพื่อนฝูง เขาหรือเธอที่เกิดวันนี้ เป็นคนเอื้อเฟื้อเผื่อแผ่แก่คนที่รักเป็นอย่างดี ความมีมนุษยสัมพันธ์ ( หรือจะเรียกว่ามีเสน่ห์ก็ได้ ) เป็นคุณลักษณะที่สำคัญอีกอย่างหนึ่งของคนเกิดวันนี้ เขาหรือเธอ ที่เกิดวันนี้มีบุคลิกภาพอันสง่างาม เด่น เป็นที่ต้องตาต้องใจและผู้คนมักอยากปราศรัยทักทายด้วย ประกอบกับความมี มนุษยสัมพันธ์ สามารถเข้ากับคนทุกระดับชั้นได้ดี คนเกิดวันที่31 จึงเป็นผู้ที่มีคนรู้จักมาก ในด้านความรัก\r\n\r\nคนเกิดวันนี้จะต้องเยี่ยมกว่าคนอื่นเสมอ เป็นคนที่ตั้งกฎเกณฑืหรือหลักการไว้สูง ถ้าท่านปรับตัว ตามเขาหรือเธอไม่ได้ ทำตัวอย่างที่คนเกิดวันนี้ต้องการไม่ได้ เขาหรือเธอที่เกิดวันนี้ก็จะไม่ลังเล ที่จะเมินคุณไปได้อย่าง ปราศจากเยื่อใย ที่สำคัญที่สุด ท่านอย่าทรยศหรือหักหลังคนที่เกิดวันนี้ เป็นอันขาด แม้แต่จะตุกติกมีเล่ห์เหลี่ยมท่านก็ไม่ ควรทำ เพราะเขาหรือเธอผู้เกิดวันที่31 จะโต้ตอบท่านอย่างเต็มที่และรุนแรงทันที และท่านไม่มีทางที่จะเอาชนะเขาหรือเธอได้เลย\r\n\r\nจุดอ่อนของคนเกิดวันนี้อยู่ที่ว่าแม้ดูภายนอกจะเข้มแข็งเด็ดขาด แต่ในเบื้องลึก คนเกิดวันนี้มักจะ ขาดความเชื่อมั่นในตัวเอง คนเกิดวันนี้มักไม่ทำสิ่งใดโดยปราศจากคำยืนยันจากคนที่ไว้ใจได้ เสียก่อนว่า สิ่งที่เขาทำนั้นถูกแล้วดีแล้ว ดังนั้น ถ้าท่านเป็นคู่รักคู่ครอง หรือเพื่อนของคนเกิดวันนี้ จะต้องรับบทบาทนี้ให้ได้ และข้อสำคัญที่ท่านลืมไม่ได้ก็คือ อย่าแสดงตัวว่าเขาขาดท่านไม่ได้ แต่จง แสดงให้เห็นว่าท่านขาดเขาไม่ได้ ซึ่งเป็นวิธีที่ดีที่สุดที่จะช่วยสร้างความมั่นใจ ให้เขาหรือเธอ ผู้เกิดวันที่31 ');
