INSERT INTO `horoday7` (`horoday7_id`, `horoday7_name`, `horoday7_name_id`, `horoday7_work`, `horoday7_money`, `horoday7_love`, `horoday7_around`, `horoday7_dothing`, `horoday7_family`, `horoday7_other`) VALUES (1,'วันอาทิตย์','1','','','','','','','ดวงอาทิตย์ คือ สิ่งที่มักจะเริ่มต้นหรือก่อเกิด เช่น เริ่มต้นวันใหม่ คนเกิดวันอาทิตย์ จึงเป็นคนที่ชอบทำอะไรใหม่ๆ เสมอ พระอาทิตย์ขึ้นแต่เช้ามืด คนเกิดวันอาทิตย์ก็มักจะเป็นคนที่ชอบตื่นเช้าเป็นส่วนใหญ่ ดวงอาทิตย์เป็นลูกไฟลูกมหึมา ร้อนแรงมาก ให้พลังงานมาก คนเกิดวันอาทิตย์ก็มักจะเป็นคนใจร้อนเป็นหลักเลย ถึงแม้ข้างนอกจะดูสุขุมนุ่มลึก แต่เชื่อเถอะภายในจิตใจร้อนระอุเชียวล่ะและก็มีพลังในการทำอะไรต่อมิอะไรมาก ด้วย จริงจัง บ้าอำนาจ เผด็จการ ค่อนข้างเป็นคนดุโกรธง่ายแต่ก็หายเร็วนะ โออ่าหรูหราสง่างาม สงบนิ่งน่าเกรงขาม เพื่อนฝูงเยอะเพราะเป็นผู้ให้ ใจคอกว้างขวางหาเงินเก่งและก็ใช้เงินเก่งด้วย รักชื่อเสียงเกียรติยศเป็นอย่างยิ่ง เสียอะไรไม่ว่าเสียหน้าข้าไม่ยอม จะทำอะไรต้องมีมาดมีฟอร์มและไม่ชอบที่จะอยู่นิ่งๆ มันร้อน ฉลาดเจ้าความคิด จัดระบบเก่ง ไม่ค่อยยอมคน ชอบเป็นผู้นำมากกว่าคล้อยตาม แต่จะชอบความเป็นอิสระไม่ขึ้นอยู่กับใครหรือไม่ชอบให้ใครมาบังคับ หยิ่งทะนงหรือมักจะเดินเชิดๆ หน่อย หน้าที่การงาน ก็มักต้องทำงานที่มีเกียรติหรืองานที่ได้เป็นใหญ่ เป็นเจ้าของ เป็นผู้นำ หรืองานที่ทำแล้วดูน่าภาคภูมิใจ หรือทำงานในสถานที่ที่หรูหราใหญ่โตเป็นที่รู้จักของคนทั่วไป สีที่เกี่ยวข้อง ก็พวกสีแดง สีขาว สีเงิน สีที่ร้อนแรง ก็ดวงอาทิตย์เป็นไฟขนาดนั้นน่ะ สุขภาพ มักเป็นโรคเครียด ระบบประสาท ความดันหัวใจ ระบบหายใจ สายตา ตระคริว ลมชัก และปวดสันหลัง'),(2,'วันจันทร์','2','','ดฟหกด','','','','','บอกแล้วว่าดวงจันทร์ ตรงข้ามกับดวงอาทิตย์ไง มืดกับสว่าง แต่ไม่ใช่ว่าคนเกิดวันจันทร์จะมีนิสัยไม่ดีด้านมืดนะจ๊ะแต่กลับตรงกันข้ามใน บางด้านโดดเด่น คนที่เกิดวันจันทร์ เป็นคนที่ไม่ใจร้อนเหมือนคนวันอาทิตย์แต่ออกแนวโลเลไปมากกว่า จะตัดสินใจอะไรได้สักอย่างตัดสินใจไม่ค่อยเก่งเดี๋ยวเอาเดี๋ยวไม่เอา ไม่คอยเชื่อมั่นในตัวเอง มองโลกในแง่ดี มักถูกหลอกได้ง่าย ๆ และบ่อย ๆก็บอกแล้วไงว่า ดวงจันทร์มักเกี่ยวข้องกับน้ำขึ้นน้ำลงและอารมณ์ของมนุษย์ คนเกิดวันจันทร์จึงเอาแน่ไม่ค่อยได้เดี๋ยวขึ้นเดี๋ยวลง เจ้าอารมณ์ ขี้เกรงใจ น้อยใจ เอาแต่ใจ แสนงอน ขี้อิจฉา ใจอ่อน บอบบางไม่แข็งแรงเหมือนคนวันอาทิตย์ แต่การพูดจามักไพเราะเป็นที่น่าฟัง ไม่ชอบความรุนแรง มีความอ่อนโยนมากกว่า มีเสน่ห์น่ารักในตัวอย่างเห็นได้ชัด มีจิตใจไวต่อความรัก เจ้าชู้ มินิสัยคล้ายเด็กอยู่ในตัว คืออยากรู้อยากเห็นอยากได้โน่นได้นี่ พอได้รู้ได้เห็นแล้วก็เบื่ออยากเล่นอย่างอื่นๆ หรือมอ งหาของใหม่ แล้วก็เป็นคนสนุกสนานแจ่มใสร่าเริง อารมณ์ดี รักสนุก รักธรรมชาติ รักสวยรักงาม ร้องเพลงเก่ง โรแมนติก หน้าที่การงาน มักจะทำงานอะไรที่นุ่มนวล เช่น พยาบาล หรืออาชีพที่เกี่ยวข้องกับน้ำ หรือธาตุเหลวต่างๆ หรือทำงานใกล้หรือในสถานที่ที่เกี่ยวข้องกับน้ำเป็นส่วนใหญ่ หรือเกี่ยวข้องกับสาธารณะชน เพราะมีเสน่ห์ดึงดูด สีที่เกี่ยวข้อง สีขาว นวล สีครีม สีเหลือง สีไข่มุก สุขภาพ โรคที่เกี่ยวกับต่อมน้ำเหลือง โรคที่มีส่วนเกี่ยวข้องกับหน้าอก เต้านม และหลัง\r\n'),(3,'วันอังคาร','3','','','','','','','ดาวอังคารแต่โบราณถือ ว่าเป็นดาวแห่งสงคราม เพราะถ้าเรามองขึ้นไปบนท้องฟ้า เราจะเห็นว่าดาวอังคารมีสีแดงเรียกว่า สู้รบกันจนเลือดสาด คนที่เกิดวันอังคารก็เช่นกัน จึงมักเป็นคนที่ขี้หงุดหงิดมีโทสจริตง่าย ชอบทะเลาะวิวาท สีหน้าแสดงออกเลยถึงความรู้สึก เลือดร้อน อารมณ์ร้อน บุ่มบ่ามมุทะลุ ชอบเสี่ยงภัย ชอบใช้กำลัง บ้าขยันทำงาน กล้าหาญและอดทนมาก ชอบอาหารยังมีรสชาติที่ร้อนแรงเลยมีความคิดสร้างสรรค์ เป็นนักกีฬา อยู่นิ่งไม่เป็น เป็นคนคล่องมาก…มากถ้าเป็นผู้หญิงสวยแค่ไหนก็มักจะซุ่มซ่าม ทำอะไรเสียงดัง ไม่ว่าจะเปิดปิดประตู หรือเดินเสียงดัง ไม่ค่อยเป็นผู้หญิงนิสัยโผงผาง กล้าหาญไม่กลัวใคร ในบางครั้งกลายเป็นคนก้าวร้าวก็มี แถมยังหยิ่งผยองอยู่ตลอด เป็นคนจริงจังเปิดเผยไม่ค่อยท้อแท้ ปากกล้าวิชาดี ฉลาด แก้ปัญหาได้ดี แต่ในบางครั้งก็ยอมหักไม่ยอมงอ ในบางครั้งคนเกิดวันอังคารก็น่ารัก ปรับตัวได้เก่ง อดทนสูง ควบคุมตัวเองได้ดี รักสงบ มีจิตใจดี พวกแข็งนอกอ่อนใน สามารถพึ่งลำแข้งของตัวเองได้ ไม่ยอมแพ้ใครง่าย ๆ หน้าที่การงาน เนื่องจากดาวอังคารเปรียบเป็นเทพเจ้าแห่งสงคราม อาชีพหนีไม่ค่อยได้ เกี่ยวข้องกับข้าราชการทหาร ตำรวจ นั่นเอง หรืออาชีพที่มักจะใช้กำลังมากกว่าสมอง หรืองานที่ไม่หยุดนิ่งอยู่กับที่ งานกลางแจ้ง แต่ไม่ถึงกับเป็นกรรมกรแบกหาม พ่อค้า นักกีฬา วิศวกรรม หรืองานที่ทันสมัยทันเหตุการณ์ เทคโนโลยีใหม่ ๆ พวกงานคอมพิวเตอร์ สีที่เกี่ยวข้อง สีชมพูเกือบแดง สีชมพูอ่อนๆ สุขภาพ ต้องระวังโดนของมีคม ฟืนไฟ ซุ่มซ่ามโดนโน่นโดนนี่ โรคที่เกี่ยวกับสมอง\r\n'),(4,'วันพุธ','4','','','','','','','ดาวพุธเป็นดาวที่อยู่ ใกล้กับดวงอาทิตย์มากที่สุด โบราณว่าไว้ว่า คนที่เกิดวันพุธ มักหมายถึง ปัญญา ความเฉลียวฉลาด มีไหวพริบปฏิภาณดี คล่องแคล่วว่องไวมาก เอาตัวรอดได้ตลอดเวลา ช่างพูด ช่างเจรจา จนในบางพุธกลายเป็นคนกะล่อน ฉลาดแกมโกง เจ้าเล่ห์ มีเล่ห์เหลี่ยม ชั้นเชิง เป็นนักธุรกิจได้ดี ดาวพุธเป็นดาวที่ค่อนข้างเกเรเอาแน่ไม่ค่อยได้ เป็นดาวที่เดินเร็วและยังไม่ค่อยแน่ว่าเมื่อไรจะหยุด เดินหน้าหรือถอยหลัง คนที่เกิดวันพุธ เป็นคนที่ในบางครั้งเราจับทางไม่ถูก รวดเร็วทันใจ ไม่ว่าจะตัดสินใจเร็ว พูดเร็ว ทำอะไรเร็วและปรับตัวได้เก่งมากไม่ว่าจะอยู่สภาวะใดก็ตาม ไม่ค่อยขัดแย้งใคร มีมนุษย์สัมพันธ์ดี ทำมาหากินเก่ง แต่มักจะมีความโลเลไม่แน่นอนอยู่ในตัวตลอดเวลา ยิ่งถ้าเกิดกลางคืนแล้วล่ะก็ จะเข้มแข็งห้าวหาญไม่ค่อยเกรงกลัวอะไร บางครั้งก้าวร้าว พูดจาไม่ค่อยคิดมักขัดหูคนฟัง เจ้าอารมณ์ คนวันพุธมักเรียนรู้อะไรได้เร็ว เชื่อคนง่าย รักใครรักจริงและขี้หึงด้วย เป็นคนสนุกสนานร่าเริง เป็นคนที่มองโลกในแง่ดี มีเมตตาไม่ชอบความรุนแรง หน้าที่การงาน ด้วยความที่คนเกิดวันพุธมักพูดเก่ง งานที่ถนัดก็เป็นพวก พี อาร์ ประชาสัมพันธ์ นักพูด นักคิดนักเขียน นักการทูต ครู นายหน้า แม่ค้าพ่อค้า เลขา ทนายความ นักการเมือง งานที่ใช้สมองและปากในการหากิน สีที่เกี่ยวข้อง สีเขียวมรกต สีธรรมชาติ สุขภาพ ระบบประสาท ระบบหายใจ โรคที่เกี่ยวกับลำคอ หวัด หอบหืด ระบบเสียงและระบบการฟัง คนวันพฤหัสบดีดาวพฤหัสเป็นดาวที่มีขนาดใหญ่อย่างที่เรารู้ๆ กัน โบราณท่านว่า คนที่เกิดวันพฤหัสบดีเป็นคนที่มีวาจาศักดิ์สิทธิ์พูดอะไร คนที่ได้ยินได้ฟังก็จะเคารพนับถือ เชื่อฟัง เลยยกให้เป็นวันครูไง ทางโหราศาสตร์ ดาวพฤหัสยกให้เป็นประธานของความดีงาม มีคุณธรรมสูง มีหน้าที่ปกป้องคุ้มครอง เป็นที่น่าชื่นชมและน่ายกย่อง คุณสมบัติของคนที่เกิดวันพฤหัสบดี จึงมักหมายถึง ผู้ที่มีปัญญาดีเฉลียวฉลาด เป็นนักปราชญ์ผู้รอบรู้ เป็นคนที่มักไม่ค่อยตกอับ เพราะเป็นคนดี แม้ในบางพฤหัสก็มีที่ผิดแผกแตกต่างจากพี่น้องไปบ้าง เช่น อาจดูเป็นพวกมีเล่ห์เหลี่ยม หรือทำอะไรไม่ค่อยเหมือนที่ชาวบ้านชาวช่องเขาคิด เขาทำกันไปบ้างแต่ยังไงก็จะเป็นคนที่มีเหตุมีผลพอจะมีสติยั้งคิดได้และมี คุณธรรมประจำใจอยู่ดีนั่นแหล่ะ คนวันพฤหัสมักเป็นคนที่เกี่ยวข้องกับศาสนา การศึกษา มีความเพียร มีความมุ่งมั่นที่ดี สงบสันโดษ มีคุณธรรมมองโลกในแง่ดี ใจอ่อน ขี้เกรงใจ รักบ้านรักครอบครัว แต่กลับเป็นคนเจ้าอารมณ์ ขี้หงุดหงิด ขี้เบื่อ ขี้เหงา ไม่ชอบให้ใครมาบังคับ ถ้าดื้อจะดื้อหัวชนฝาเลยล่ะ ชอบเป็นที่ปรึกษาให้ชาวบ้านชาวช่อง ชอบพูดชอบสอนแนะนำมองการณ์ไกล แต่ก็มีนะที่อะไรใกล้ๆ หรือเรื่องของตัวเองกลับนึกไม่ค่อยออก เลยแก้ปัญหาของตัวเองไม่ค่อยได้ หน้าที่การงาน ครูบาอาจารย์ ทนายความ เพราะเป็นคนที่รอบรู้ อาชีพอะไรก็ได้ที่เกี่ยวข้องกับการศึกษา ศาสนา การใช้ความคิด ความดีงามช่วยเหลือชาวบ้าน ความเลื่อมใส หรือเกิดประโยชน์ต่อส่วนรวมสังคม สีที่เกี่ยวข้อง สีแสด สีส้ม สีน้ำตาล น้ำตาลแดง สีเหลืองแก่ สุขภาพ ตับ ม้าม ปอด สมองและเท้า การทรงตัวไม่ค่อยดี'),(5,'วันพฤหัสบดี','5','','','','','','','ดาวพฤหัสเป็นดาวที่มี ขนาดใหญ่ อย่างที่เรารู้ ๆ กัน โบราณท่านว่าคนที่เกิดวันพฤหัสบดีเป็นคนที่มีวาจาศักดิ์สิทธิ์ พูดอะไร คนที่ได้ยินได้ฟังก็จะเคารพนับถือ เชื่อฟัง เลยยกให้เป็นวันครูไง ทางโหราศาสตร์ ดาวพฤหัสยกให้เป็นประธานของความดีงาม มีคุณธรรมสูง มีหน้าที่ปกป้องคุ้มครอง เป็นที่น่าชื่นชมและน่ายกย่อ ง\r\nคุณสมบัติของคน ที่เกิดวันพฤหัสบดี จึงมักหมายถึงผู้ที่มีปัญญาดีเฉลียวฉลาด เป็นนักปราชญ์ผู้รอบรู้ เป็นคนที่มักไม่ค่อยตกอับ เพราะเป็นคนดี แม้ในบางพฤหัสก็มีที่ผิดแผกแตกต่างจากพี่น้องไปบ้าง เช่นอาจดูเป็นพวกมีเล่ห์เหลี่ยม หรือทำอะไรไม่ค่อยเหมือนที่ชาวบ้านชาวช่องเขาคิด เขาทำกันไปบ้างแต่ยังไงก็จะเป็นคนที่มีเหตุมีผล พอจะมีสติยั้งคิดได้และมีคุณธรรมประจำใจอยู่ดีนั่นแหล่ะ\r\nคนวันพฤหัสมัก เป็นคนที่เกี่ยวข้องกับศาสนา การศึกษา มีความเพียร มีความมุ่งมั่นที่ดี สงบสันโดษ มีคุณธรรม มองโลกในแง่ดี ใจอ่อน ขี้เกรงใจ รักบ้านรักครอบครัว แต่กลับเป็นคนเจ้าอารมณ์ ขี้หงุดหงิด ขี้เบื่อ ขี้เหงา ไม่ชอบให้ใครมาบังคับ ถ้าดื้อจะดื้อหัวชนฝาเลยล่ะ ชอบเป็นที่ปรึกษาให้ชาวบ้ านชาวช่อง ชอบพูดชอบสอนแนะนำ มองการณ์ไกล แต่ก็มีนะที่อะไรใกล้ ๆ หรื่อเรื่องของตัวเองกลับนึกไม่ค่อยออกเลยแก้ปัญหาของตัวเองไม่ค่อยได้\r\nหน้าที่การงาน\r\nครู บาอาจารย์ ทนายความเพราะเป็นคนที่รอบรู้ อาชีพอะไรก็ได้ ที่เกี่ยวข้องกับการศึกษา ศาสนา การใช้ความคิด ความดีงามช่วยเหลือชาวบ้าน ความเลื่อมใส หรือ เกิดประโยชน์ต่อส่วนรวม สังคม\r\nสีที่เกี่ยวข้อง\r\nสีแสด สีส้ม สีน้ำตาล น้ำตาลแดง สีเหลืองแก่\r\nสุขภาพ\r\nตับ ม้าม ปอด สมอง และเท้า การทรงตัวไม่ค่อยดี\r\n'),(6,'วันศุกร์','6','','','','','','','ดาวศุกร์เป็นดวงดาวที่ เราจะรู้จักในนามดาววีนัส ดาวแห่งความรัก เป็นดาวที่เราสามารถมองเห็นด้วยตาเปล่าและมักจะส่องแสงสุกสกาวบนท้องฟ้าให้ เราเห็นเสมอๆ เมื่อแหงนหน้าขึ้นมองบนฟ้า แต่ถ้าเป็นบนทางโหราศาสตร์ถือว่าดาวศุกร์เป็นดาวแห่งกิเลสตัณหา ราคะจริต สมบัติ หมายถึง ทรัพย์สมบัติ ความสวยสดงดงาม ความสนุกสนาน ศิลปะบันเทิง ความฟุ้งเฟ้อ มีเสน่ห์มาก มีความรักได้บ่อยๆ มีคนอยากเข้ามาให้รักและก็อยากให้คนอื่น ๆมารักตน เลยกลายเป็นคนเจ้าชู้มากรักหลายใจ แต่ไม่มีใครรู้หรอกว่า แท้จริงแล้วมีรักหลายครั้งก็จริง แต่ก็อกหักหลายหนเหมือนกัน ถ้ารักใครรักจริง รักเกิน ๆ จนกลายเป็นขี้หึง เรื่องมากและเลือกมากในความรัก ค่อนข้างเป็นคนที่รักสวยรักงามมีระเบียบ สะอาด มารยาทงาม อ่อนหวานได้ มีความรู้รอบตัวฉลาด แก้ปัญหาเฉพาะหน้าได้เก่ง พลิกแพลงทุกอย่างด้วยมันสมอง ไม่ค่อยชอบใช้กำลัง บางทีก็คิดอะไรไม่ค่อยเหมือนชาวบ้านแต่ก็อนุรักษ์นิยม ชอบเดินทางท่องเที่ยวรักธรรมชาติ ศิลปะ ดนตรี ในเรื่องการเงินก็ไม่ค่อยขัดสน จึงทำให้เป็นคนใช้เงินไม่ค่อยคิดสักเท่าไร หน้าที่การงาน พ่อค้าแม่ค้า นักดนตรี นักร้อง ดาราหนัง นักบัญชี ธนาคาร อาชีพอะไรก็ได้ที่เกี่ยวข้องกับ งานฝีมือ ศิลปะ งานที่ใช้สมองความคิดสร้างสรรค์ มีรสนิยม งานที่ให้ความบันเทิงใจแก่ประชาชน งานที่เกี่ยวกับเงินๆ ทอง ๆ สีที่เกี่ยวข้อง สีฟ้า สีขาว สีน้ำเงิน สีคราม สีเขียวน้ำทะเล สุขภาพ โรคที่เกี่ยวกับเพศสัมพันธ์ มดลูก กระเพาะปัสสาวะ บั้นเอว ริดสีดวง และลำไส้'),(7,'วันเสาร์','7','','','','','','','ดาวเสาร์เป็นดาวที่ อยู่ไกลจากดวงอาทิตย์มาก และก็เดินช้ามากด้วย ทางโหราศาสตร์ดาวเสาร์จะหมายถึง ดาวที่มีความเป็นโทษและทุกข์ การพลัดพราก ตายจาก รกร้าง ยากจน เหงา เปล่าเปลี่ยว จนใคร ๆ ก็ไม่อยากยุ่งกับดาวเสาร์ แต่แท้ที่จริงแล้ว ดาวเสาร์ก็มีความน่ารักและความดีของดวงดาวอยู่นะจ๊ะ เพราะในความหมายที่ดีก็คือดาวเสาร์เป็นดาวที่โคตรอดทนเลย มีความสุขุมรอบคอบและสงบ ถึงแม้จะเชื่องช้าและเนิ่นนานก็ตาม แต่มั่นคงนะจะบอกให้ คนที่เกิดวันเสาร์มักเป็นคนที่ตระหนี่ มัธยัสถ์ ขี้เหนียว งก จริง ๆ แล้วดีออก มักรวยมีทรัพย์สินและก็หมายความไปถึงขี้หึงและหวงของเป็นที่สุด จู้จี้ขี้บ่นก็เท่านั้น เพราะความที่เป็นคนที่ขี้ระแวงและวิตกกังวลอยู่ตลอดเวลา ทำอะไรก็ชอบย้ำคิดย้ำทำไม่ค่อยจบง่ายๆ ส่วนใหญ่เป็นคนที่ฉลาดมาก เพราะเป็นคนที่ชอบคิดอะไรลึกซึ้งและช่างสังเกตเสมอ คิดแล้วก็มักจะทำเอง เพราะไม่ค่อยยอมไว้ใจใคร ใครทำก็ไม่ได้ดั่งใจเลยต้องมาเหนื่อยซะเอง งานหนักเอางานเบาสู้ ดุจกรรมกรยังไงยังงั้นแหล่ะ เป็นคนที่จริงจังกับชีวิตจนดูหน้าดุ หรือยิ้มยาก หรือหน้าแก่ไปเลยก็มี ทำอะไรคิดอะไรดูเหมือนจะช้า เพราะมัวแต่ประณีตอยู่นั่นแหล่ะ กลัวการผิดพลาดคิดมากตลอดเวลา จึงไม่ค่อยกล้าตัดสินใจอะไรได้ทันทีทันการณ์ หน้าที่การงาน งานที่เกี่ยวกับความรับผิดชอบสูง งานที่ใช้กำลัง งานที่ต้องจัดระเบียบ งานที่เกี่ยวกับที่ดิน เกษตร หรืองานเร้นลับ ความตาย อย่างสัปเหร่อ กรรมการแบกปัญหาชาวบ้าน งานที่ต้องรอและใช้ความอดทน หาเช้ากินค่ำ สีที่เกี่ยวข้อง สีดำ สีเทา สีเงิน สีม่วง สีคราม สุขภาพ โรคกระดูก ปวดตามข้อ โรคผิวหนัง โรคเครียดและระบบประสาท\r\n');
