INSERT INTO `horozodiac` (`horozodiac_id`, `horozodiac_name`, `horozodiac_name_id`, `horozodiac_bigen_date`, `horozodiac_end_date`, `horozodiac_work`, `horozodiac_money`, `horozodiac_love`, `horozodiac_around`, `horozodiac_dothing`, `horozodiac_family`, `horozodiac_other`, `horoyear_id`) VALUES (1,'ราศีมังกร','1','','','','','','','','','ปี 2553 ที่กำลังจะมาถึงเป็นปีแห่งการต่อสู้ของชาวราศีมังกร เพราะต้องพบการงานที่หนักหน่วง ทำงานจนไม่มีเวลาพักผ่อน อาจเป็นสาเหตุให้ต้องล้มป่วยได้ง่าย ฉะนั้นต้องต่อสู้กับตัวเองอย่างหนักในการดูแลสุขภาพและออกกำลังกายเป็นพิเศษ เรื่องของหัวใจก็ต้องต่อสู้กับรักซ้อนที่จะเข้ามาพิสูจน์หัวใจของคุณว่ามั่น คงในความรักแค่ไหน แต่ถ้าสามารถผ่านพ้นวิกฤติครั้งนี้ไปได้ ความรักของคุณจะดำเนินไปด้วยดีจนถึงขีดสุด เรื่องของวัตถุนอกกายก็เป็นสิ่งที่เย้ายวนใจชาวมังกรเป็นอย่างมาก ต้องสู้กับใจของคุณเอง กำจัดความอยากในสิ่งที่ไม่จำเป็น มิเช่นนั้นจะชักหน้าไม่ถึงหลัง','1'),(2,'ราศีกุมภ์','2','','','','','','','','','ปี 2553 จะเป็นปีแห่งความสำเร็จทางด้านการงานของชาวราศีกุมภ์ จะได้ทำงานใหม่ๆ ที่ท้าทายความสามารถ หรือเริ่มต้นโครงการที่จะเกิดความสำเร็จสมบูรณ์ ใครที่ตกงานอยู่จะได้รับข่าวดี มีโชคในการสมัครงาน คนที่อยู่ในวัยเรียนจะสมหวังในสิ่งที่ปรารถนา ความรักของคนโสดจะเข้ามาอย่างหวือหวา ต้องศึกษากันให้ถ้วนถี่ มิเช่นนั้นอาจจะพบกับรักลวง สำหรับคนมีคู่ต้องใช้ความไว้ใจเป็นที่ตั้งแล้วจะผ่านอุปสรรคไปได้ด้วยดี สุขภาพระวังการกำเริบของโรคประจำตัว หรือโรคที่เป็นอยู่บ่อยๆ','1'),(3,'ราศีมีน','3','','','\r\n','\r\n','','\r\n','\r\n','','ปี 2553 เป็นปีแห่งความสุขของชาวราศีมีน จะมีสิ่งใหม่ๆ สิ่งดีๆ เกิดขึ้นมากมาย เริ่มจากการงานที่จะได้ริเริ่มทำงานแปลกใหม่ มีความคิดที่จะทำธุรกิจ ได้หุ้นส่วนที่ดีมีคุณธรรม ได้เพื่อนร่วมงานที่มาช่วยแบ่งเบาและร่วมผลักดันผลงานให้เข้าตาผู้บังคับ บัญชา และผลจากการกรำงานหนักจากปีที่แล้วส่งผลให้ค่าตอบแทนสูงตามไปด้วย คุณจะมีเงินไว้จับจ่ายของชิ้นใหญ่ที่อยากได้มานาน ด้านความรักหวานชื่นกว่าที่เคย นอกจากจะได้เดินทางร่วมกันอย่างสนุกสนานแล้ว คนรักยังจะนำโชคลาภมาสู่คุณอีกด้วย','1'),(4,'ราศีเมษ','4','','','','','','','','','ในปี 2553 ชาวราศีเมษจะมีอารมณ์ร้อนกว่าปีที่ผ่านมา ฉะนั้นไม่ว่าจะตัดสินใจเรื่องใด ต้องใช้สติเป็นอย่างมาก เรื่องการงานต้องระวังให้ดีถ้าจะมีการเซ็นสัญญาหรือการร่วมทุนระวังจะถูกต้ม ตุ๋น การทำงานกับคนหมู่มากก็ต้องระวังความคิดคำพูดให้จงหนักแล้วทุกอย่างจะดำเนิน ไปได้ด้วยดี เรื่องคาวมรักสำหรับคนมีคู่ต้องใช้หลักน้ำพึ่งเรือ เสือพึ่งป่า ครองรักกันด้วยเมตตาจิต สำหรับคนโสด เมื่อตกหลุมรักใครอย่าปักใจเชื่อแต่แรก รอให้เวลาเป็นเครื่องพิสูจน์ เพราะอาจมีรักลวงเข้ามาทำให้ปวดใจได้ง่ายในปีนี้ สุขภาพโดยรวมดีแต่ต้องระวังโรคที่เกิดจากความเครียด','1'),(5,'ราศีพฤษภ','5','','','','','','','','','ปี 2553 เป็นปีอันรุ่งโรจน์ทางด้านการงานของชาวราศีพฤษภ มีความคิดสร้างสรรค์มากล้น นำมาซึ่งความก้าวหน้าทางด้านการงาน จะได้ริเริ่มโครงการใหม่ๆ ได้เป็นหัวหน้า ได้เป็นผู้นำทีม และด้วยการที่ต้องเป็นผู้นำคนอื่นอาจมีเรื่องให้เครียดจากผู้ใต้บังคับบัญชา บ้าง ฉะนั้นต้องปกครองคนด้วยคุณธรรม เอาใจเขามาใส่ใจเรา ในด้านความรักอาจจะมีเวลาให้กันน้อยไปสักนิด เพราะเป็นปีที่กำลังมุ่งมั่นกับการงาน เมื่อใดที่มีเวลาว่างควรหากิจกรรมที่ทำร่วมกันในครอบครัว จะทำให้บรรยากาศดีขึ้นได้ ทางด้านสุขภาพแข็งแรงดี แถมจะอ้วนท้วนขึ้นด้วยเพราะทุ่มเทเวลาให้กับการงานมากไป ควรเจียดเวลาให้กับการออกกำลังกายด้วย','1'),(6,'ราศีมิถุน','6','','','','','','','','','ปี 2553 เป็นปีแห่งความสุขของชาวราศีเมถุน เต็มไปด้วยเงินทอง ยศถาบรรดาศักดิ์ นำมาซึ่งความสมบูรณ์ทั้งร่างกายและจิตใจ ได้กินของดีของอร่อย ท่องเที่ยวอย่างสำราญ ในด้านของหัวใจจะชุ่มชื่นกว่าที่เคย คนที่มีคู่จะสุขใจยิ่งขึ้น มีเกณฑ์มีบุตร คนโสดจะตกหลุมรักอย่างง่ายดาย และมีโอกาสพบการพัดหวนของรักเก่า อย่างไรต้องพิจารณาให้ถ้วนถี่ แต่แม้ชีวิตส่วนตัวที่ดำเนินไปด้วยดี แต่อาจมีเรื่องของครอบครัวและบริวารมาให้ร้อนใจบ้างเป็นครั้งคราว แต่ก็ไม่หนักหนา คำแนะนำสำหรับราศีนี้คือหมั่นทำบุญทำทาน เข้าวัดฟังธรรมบ้าง เพราะชีวิตที่มีความสุขเกินไปอาจจะทำให้เกิดความประมาทได้','1'),(7,'ราศีกรกฎ','7','','','','','','','','','ปี 2553 ชาวกรกฏต้องมีสติอย่างมาก เพราะจะมีอุปสรรคผ่านเข้ามาให้ฝ่าฟัน เริ่มจากเรื่องสุขภาพที่จะต้องดูแลอย่างเคร่งครัด ห้ามละเลย อย่างน้อยต้องหาเวลาไปตรวจสุขภาพบ้าง เรื่องของการงานและความรักจะมีการเปลี่ยนแปลงที่ทำให้ต้องอึดอัดใจ แต่ทั้งหมดนี้จะผ่านเข้ามาและผ่านไปในที่สุด ชีวิตที่สวยงามรอคุณอยู่ที่ปลายทางแน่นอนถ้าคุณมุ่งมั่นที่จะแก้ปัญหา ความสุขในชีวิตของชาวกรกฏในปีนี้จะต้องสร้างขึ้นจากตัวเองเป็นหลักแล้ว ทุกอย่างจะดำเนินไปด้วยดี','1'),(8,'ราศีสิงห์','8','','','','','','','','','ชาวราศีสิงห์ จะพบความมั่งคั่งในปี 2553 เพราะด้วยพลังความสร้างสรรค์และพลังกายอันเต็มเปี่ยม ทำให้มีงานเข้ามาให้ทำไม่ขาดสาย ยิ่งขยันมากก็ยิ่งได้เงินเยอะ ถือเป็นปีที่จะได้เงินเป็นกอบเป็นกำ ได้ใช้จ่ายคล่องมือ ได้ของที่อยากได้มานาน มีดวงดีในการเสี่ยงโชค จะได้ลาภผลที่คาดไม่ถึง แต่ก็อย่าประมาทกับชีวิตเกินไป เพราะอาจจะมีเรื่องท้าทายเข้ามาทดสอบคุณเช่นกัน ในด้านความรัก ชาวสิงห์มีพลังงานแห่งความสุขสูงมากในปีนี้ คนที่มีคู่จะรักกันหวานชื่น คนโสดจะสมหวัง ไม่ว่าคุณจะอกหักหรือเหงาหงอยมานานก็จะได้ชื่นใจแน่นอน ครึ่งหลังของปีมีโอกาสลุ้นสูง','1'),(9,'ราศีกันย์','9','','','','','','','','','ปี 2553 ชาวราศีกันต์ต้องก้าวให้ช้าแต่เป็นความช้าที่นำมาซึ่งความมั่นคงในชีวิต ในเรื่องของรายได้ เงินจะไหลมาอย่างช้าๆ แต่สม่ำเสมอ ถ้าอดทนเก็บหอมรอมริบและบริหารเงินอย่างลงตัว คุณจะรวยแบบที่คุณคาดไม่ถึงเลยทีเดียว ในเรื่องของความรักก็เช่นกัน คุณต้องดำเนินชีวิตคู่ให้ช้าลง แต่ก้าวไปข้างหน้าอย่างมั่นคงและมีสติ เร่งสร้างรากฐานครอบครัวให้แข็งแรงเพื่อชีวิตคู่ที่คุณฝันไว้ในอนาคต สำหรับคนโสดคุณจะพบรักอย่างคาดไม่ถึงจากการเดินทาง','1'),(10,'ราศีตุลย์ ','10','','','','','','','','','ปี 2553 เป็นปีที่เหมาะกับการแก้ไขสิ่งผิดพลาดในปีที่ผ่านมาของชาวราศีตุลย์ เพราะมีโอกาสทางการงานการเงินให้คุณได้เริ่มต้นมากมาย ลองเลือกเป้าหมายมาสักหนึ่งสิ่งและลงมือทำอย่างค่อยเป็นค่อยไป รับรองว่าคุณจะได้ลาภผลและความมั่นคงในชีวิตแน่นอน แต่บนเส้นทางแห่งความสำเร็จคุณอาจสะดุดได้ด้วยอุปสรรคทั้งเรื่องคนและเรื่องงาน แต่ปัญหาทุกอย่างจะคลี่คลายลงได้เพียงแต่คุณต้องค่อยๆ คิดแก้ไขปัญหา อย่ารีบร้อน ส่วนเรื่องความรักจะมีเรื่องการเงินเข้ามาเกี่ยวข้องด้วย ในที่นี้หมายถึงคุณต้องการใช้เงินเพื่อจริงจังกับคนรักหรือสร้างรากฐานครอบครัวให้แข็งแรง','1'),(11,'ราศีพิจิก','11','','','','','','','','','ชาว ราศีพิจิกที่คิดว่าปีที่แล้วเป็นที่ไม่ดี ปี 2553 ที่กำลังจะมาถึงจะเป็นปีที่ดีของคุณ เต็มไปความสุขสมหวัง ลาภ ยศ สรรเสริญ เด่นมากในเรื่องของความรัก สำหรับใครที่โสด คุณจะได้พบรักแท้ เจอคู่ที่ถูกใจเป็นที่สุด คนที่มีคู่แล้วความรักของคุณจะลงตัวขึ้น มีความพร้อมที่จะสร้างรากฐานครอบครัวให้มั่นคง ในด้านชีวิตการงาน จะก้าวหน้าเป็นอย่างดี โดยเฉพาะการทำงานเป็นทีมจะสำเร็จลุล่วงเป็นพิเศษ และถ้าชาวพิจิกที่คิดริเริ่มงานใหม่ๆ ก็ต้องเริ่มต้นอย่างรอบคอบ เตรียมพร้อมรับความท้าทายที่จะผ่านเข้ามา แต่ปลายทางจะเป็นปลายทางแห่งความสุขแน่นอน','1'),(12,'ราศีธนู','12','','','','','','','','','ปี 2553 เป็นปีที่ชาวราศีธนูต้องใช้ชีวิตอย่างพอเพียงและไม่ประมาท ในด้านของการงานคุณอาจจะได้ทำงานที่ดี มีรายได้เข้ามามาก แต่ก็มีเรื่องให้ต้องเสียเงินโดยใช่เหตุเช่นกัน จึงอาจมีบางช่วงที่ทำให้เงินขาดมือ แต่ก็ไม่ต้องกังวลให้มากเพราะจะมีคนเข้ามาอุปถัมภ์ให้รอดพ้นวิกฤติได้เสมอ แต่ทางที่ดีควรจะประหยัดการใช้จ่ายจะดีที่สุด ความช่วยเหลือจากคนอื่นจะได้เป็นทางเลือกสุดท้าย ในด้านความรักก็เช่นกันชาวธนูยังคงรักอย่างออมใจ แอบรัก แอบชอบ แต่นั่นก็เป็นสิ่งที่ดีเพราะคนดีๆ ก็ต้องดูกันนานๆ ด้านสุขภาพห้ามประมาทเด็ดขาด หมั่นตรวจสุขภาพ เพราะถ้าปล่อยปละละเลยจะทำให้ล้มหมอนอนเสื่อได้ง่าย','1'),(13,'ราศีมังกร','1','','','','','','','','','ปี 2553 ที่กำลังจะมาถึงเป็นปีแห่งการต่อสู้ของชาวราศีมังกร เพราะต้องพบการงานที่หนักหน่วง ทำงานจนไม่มีเวลาพักผ่อน อาจเป็นสาเหตุให้ต้องล้มป่วยได้ง่าย ฉะนั้นต้องต่อสู้กับตัวเองอย่างหนักในการดูแลสุขภาพและออกกำลังกายเป็นพิเศษ เรื่องของหัวใจก็ต้องต่อสู้กับรักซ้อนที่จะเข้ามาพิสูจน์หัวใจของคุณว่ามั่น คงในความรักแค่ไหน แต่ถ้าสามารถผ่านพ้นวิกฤติครั้งนี้ไปได้ ความรักของคุณจะดำเนินไปด้วยดีจนถึงขีดสุด เรื่องของวัตถุนอกกายก็เป็นสิ่งที่เย้ายวนใจชาวมังกรเป็นอย่างมาก ต้องสู้กับใจของคุณเอง กำจัดความอยากในสิ่งที่ไม่จำเป็น มิเช่นนั้นจะชักหน้าไม่ถึงหลัง','2'),(14,'ราศีกุมภ์','2','','','','','','','','','ปี 2553 จะเป็นปีแห่งความสำเร็จทางด้านการงานของชาวราศีกุมภ์ จะได้ทำงานใหม่ๆ ที่ท้าทายความสามารถ หรือเริ่มต้นโครงการที่จะเกิดความสำเร็จสมบูรณ์ ใครที่ตกงานอยู่จะได้รับข่าวดี มีโชคในการสมัครงาน คนที่อยู่ในวัยเรียนจะสมหวังในสิ่งที่ปรารถนา ความรักของคนโสดจะเข้ามาอย่างหวือหวา ต้องศึกษากันให้ถ้วนถี่ มิเช่นนั้นอาจจะพบกับรักลวง สำหรับคนมีคู่ต้องใช้ความไว้ใจเป็นที่ตั้งแล้วจะผ่านอุปสรรคไปได้ด้วยดี สุขภาพระวังการกำเริบของโรคประจำตัว หรือโรคที่เป็นอยู่บ่อยๆ','2'),(15,'ราศีมีน','3','','','\r\n','\r\n','','\r\n','\r\n','','ปี 2553 เป็นปีแห่งความสุขของชาวราศีมีน จะมีสิ่งใหม่ๆ สิ่งดีๆ เกิดขึ้นมากมาย เริ่มจากการงานที่จะได้ริเริ่มทำงานแปลกใหม่ มีความคิดที่จะทำธุรกิจ ได้หุ้นส่วนที่ดีมีคุณธรรม ได้เพื่อนร่วมงานที่มาช่วยแบ่งเบาและร่วมผลักดันผลงานให้เข้าตาผู้บังคับ บัญชา และผลจากการกรำงานหนักจากปีที่แล้วส่งผลให้ค่าตอบแทนสูงตามไปด้วย คุณจะมีเงินไว้จับจ่ายของชิ้นใหญ่ที่อยากได้มานาน ด้านความรักหวานชื่นกว่าที่เคย นอกจากจะได้เดินทางร่วมกันอย่างสนุกสนานแล้ว คนรักยังจะนำโชคลาภมาสู่คุณอีกด้วย','2'),(16,'ราศีเมษ','4','','','','','','','','','ในปี 2553 ชาวราศีเมษจะมีอารมณ์ร้อนกว่าปีที่ผ่านมา ฉะนั้นไม่ว่าจะตัดสินใจเรื่องใด ต้องใช้สติเป็นอย่างมาก เรื่องการงานต้องระวังให้ดีถ้าจะมีการเซ็นสัญญาหรือการร่วมทุนระวังจะถูกต้ม ตุ๋น การทำงานกับคนหมู่มากก็ต้องระวังความคิดคำพูดให้จงหนักแล้วทุกอย่างจะดำเนิน ไปได้ด้วยดี เรื่องคาวมรักสำหรับคนมีคู่ต้องใช้หลักน้ำพึ่งเรือ เสือพึ่งป่า ครองรักกันด้วยเมตตาจิต สำหรับคนโสด เมื่อตกหลุมรักใครอย่าปักใจเชื่อแต่แรก รอให้เวลาเป็นเครื่องพิสูจน์ เพราะอาจมีรักลวงเข้ามาทำให้ปวดใจได้ง่ายในปีนี้ สุขภาพโดยรวมดีแต่ต้องระวังโรคที่เกิดจากความเครียด','2'),(17,'ราศีพฤษภ','5','','','','','','','','','ปี 2553 เป็นปีอันรุ่งโรจน์ทางด้านการงานของชาวราศีพฤษภ มีความคิดสร้างสรรค์มากล้น นำมาซึ่งความก้าวหน้าทางด้านการงาน จะได้ริเริ่มโครงการใหม่ๆ ได้เป็นหัวหน้า ได้เป็นผู้นำทีม และด้วยการที่ต้องเป็นผู้นำคนอื่นอาจมีเรื่องให้เครียดจากผู้ใต้บังคับบัญชา บ้าง ฉะนั้นต้องปกครองคนด้วยคุณธรรม เอาใจเขามาใส่ใจเรา ในด้านความรักอาจจะมีเวลาให้กันน้อยไปสักนิด เพราะเป็นปีที่กำลังมุ่งมั่นกับการงาน เมื่อใดที่มีเวลาว่างควรหากิจกรรมที่ทำร่วมกันในครอบครัว จะทำให้บรรยากาศดีขึ้นได้ ทางด้านสุขภาพแข็งแรงดี แถมจะอ้วนท้วนขึ้นด้วยเพราะทุ่มเทเวลาให้กับการงานมากไป ควรเจียดเวลาให้กับการออกกำลังกายด้วย','2'),(18,'ราศีมิถุน','6','','','','','','','','','ปี 2553 เป็นปีแห่งความสุขของชาวราศีเมถุน เต็มไปด้วยเงินทอง ยศถาบรรดาศักดิ์ นำมาซึ่งความสมบูรณ์ทั้งร่างกายและจิตใจ ได้กินของดีของอร่อย ท่องเที่ยวอย่างสำราญ ในด้านของหัวใจจะชุ่มชื่นกว่าที่เคย คนที่มีคู่จะสุขใจยิ่งขึ้น มีเกณฑ์มีบุตร คนโสดจะตกหลุมรักอย่างง่ายดาย และมีโอกาสพบการพัดหวนของรักเก่า อย่างไรต้องพิจารณาให้ถ้วนถี่ แต่แม้ชีวิตส่วนตัวที่ดำเนินไปด้วยดี แต่อาจมีเรื่องของครอบครัวและบริวารมาให้ร้อนใจบ้างเป็นครั้งคราว แต่ก็ไม่หนักหนา คำแนะนำสำหรับราศีนี้คือหมั่นทำบุญทำทาน เข้าวัดฟังธรรมบ้าง เพราะชีวิตที่มีความสุขเกินไปอาจจะทำให้เกิดความประมาทได้','2'),(19,'ราศีกรกฎ','7','','','','','','','','','ปี 2553 ชาวกรกฏต้องมีสติอย่างมาก เพราะจะมีอุปสรรคผ่านเข้ามาให้ฝ่าฟัน เริ่มจากเรื่องสุขภาพที่จะต้องดูแลอย่างเคร่งครัด ห้ามละเลย อย่างน้อยต้องหาเวลาไปตรวจสุขภาพบ้าง เรื่องของการงานและความรักจะมีการเปลี่ยนแปลงที่ทำให้ต้องอึดอัดใจ แต่ทั้งหมดนี้จะผ่านเข้ามาและผ่านไปในที่สุด ชีวิตที่สวยงามรอคุณอยู่ที่ปลายทางแน่นอนถ้าคุณมุ่งมั่นที่จะแก้ปัญหา ความสุขในชีวิตของชาวกรกฏในปีนี้จะต้องสร้างขึ้นจากตัวเองเป็นหลักแล้ว ทุกอย่างจะดำเนินไปด้วยดี','2'),(20,'ราศีสิงห์','8','','','','','','','','','ชาวราศีสิงห์ จะพบความมั่งคั่งในปี 2553 เพราะด้วยพลังความสร้างสรรค์และพลังกายอันเต็มเปี่ยม ทำให้มีงานเข้ามาให้ทำไม่ขาดสาย ยิ่งขยันมากก็ยิ่งได้เงินเยอะ ถือเป็นปีที่จะได้เงินเป็นกอบเป็นกำ ได้ใช้จ่ายคล่องมือ ได้ของที่อยากได้มานาน มีดวงดีในการเสี่ยงโชค จะได้ลาภผลที่คาดไม่ถึง แต่ก็อย่าประมาทกับชีวิตเกินไป เพราะอาจจะมีเรื่องท้าทายเข้ามาทดสอบคุณเช่นกัน ในด้านความรัก ชาวสิงห์มีพลังงานแห่งความสุขสูงมากในปีนี้ คนที่มีคู่จะรักกันหวานชื่น คนโสดจะสมหวัง ไม่ว่าคุณจะอกหักหรือเหงาหงอยมานานก็จะได้ชื่นใจแน่นอน ครึ่งหลังของปีมีโอกาสลุ้นสูง','2'),(21,'ราศีกันย์','9','','','','','','','','','ปี 2553 ชาวราศีกันต์ต้องก้าวให้ช้าแต่เป็นความช้าที่นำมาซึ่งความมั่นคงในชีวิต ในเรื่องของรายได้ เงินจะไหลมาอย่างช้าๆ แต่สม่ำเสมอ ถ้าอดทนเก็บหอมรอมริบและบริหารเงินอย่างลงตัว คุณจะรวยแบบที่คุณคาดไม่ถึงเลยทีเดียว ในเรื่องของความรักก็เช่นกัน คุณต้องดำเนินชีวิตคู่ให้ช้าลง แต่ก้าวไปข้างหน้าอย่างมั่นคงและมีสติ เร่งสร้างรากฐานครอบครัวให้แข็งแรงเพื่อชีวิตคู่ที่คุณฝันไว้ในอนาคต สำหรับคนโสดคุณจะพบรักอย่างคาดไม่ถึงจากการเดินทาง','2'),(22,'ราศีตุลย์ ','10','','','','','','','','','ปี 2553 เป็นปีที่เหมาะกับการแก้ไขสิ่งผิดพลาดในปีที่ผ่านมาของชาวราศีตุลย์ เพราะมีโอกาสทางการงานการเงินให้คุณได้เริ่มต้นมากมาย ลองเลือกเป้าหมายมาสักหนึ่งสิ่งและลงมือทำอย่างค่อยเป็นค่อยไป รับรองว่าคุณจะได้ลาภผลและความมั่นคงในชีวิตแน่นอน แต่บนเส้นทางแห่งความสำเร็จคุณอาจสะดุดได้ด้วยอุปสรรคทั้งเรื่องคนและเรื่องงาน แต่ปัญหาทุกอย่างจะคลี่คลายลงได้เพียงแต่คุณต้องค่อยๆ คิดแก้ไขปัญหา อย่ารีบร้อน ส่วนเรื่องความรักจะมีเรื่องการเงินเข้ามาเกี่ยวข้องด้วย ในที่นี้หมายถึงคุณต้องการใช้เงินเพื่อจริงจังกับคนรักหรือสร้างรากฐานครอบครัวให้แข็งแรง','2'),(23,'ราศีพิจิก','11','','','','','','','','','ชาว ราศีพิจิกที่คิดว่าปีที่แล้วเป็นที่ไม่ดี ปี 2553 ที่กำลังจะมาถึงจะเป็นปีที่ดีของคุณ เต็มไปความสุขสมหวัง ลาภ ยศ สรรเสริญ เด่นมากในเรื่องของความรัก สำหรับใครที่โสด คุณจะได้พบรักแท้ เจอคู่ที่ถูกใจเป็นที่สุด คนที่มีคู่แล้วความรักของคุณจะลงตัวขึ้น มีความพร้อมที่จะสร้างรากฐานครอบครัวให้มั่นคง ในด้านชีวิตการงาน จะก้าวหน้าเป็นอย่างดี โดยเฉพาะการทำงานเป็นทีมจะสำเร็จลุล่วงเป็นพิเศษ และถ้าชาวพิจิกที่คิดริเริ่มงานใหม่ๆ ก็ต้องเริ่มต้นอย่างรอบคอบ เตรียมพร้อมรับความท้าทายที่จะผ่านเข้ามา แต่ปลายทางจะเป็นปลายทางแห่งความสุขแน่นอน','2'),(24,'ราศีธนู','12','','','','','','','','','ปี 2553 เป็นปีที่ชาวราศีธนูต้องใช้ชีวิตอย่างพอเพียงและไม่ประมาท ในด้านของการงานคุณอาจจะได้ทำงานที่ดี มีรายได้เข้ามามาก แต่ก็มีเรื่องให้ต้องเสียเงินโดยใช่เหตุเช่นกัน จึงอาจมีบางช่วงที่ทำให้เงินขาดมือ แต่ก็ไม่ต้องกังวลให้มากเพราะจะมีคนเข้ามาอุปถัมภ์ให้รอดพ้นวิกฤติได้เสมอ แต่ทางที่ดีควรจะประหยัดการใช้จ่ายจะดีที่สุด ความช่วยเหลือจากคนอื่นจะได้เป็นทางเลือกสุดท้าย ในด้านความรักก็เช่นกันชาวธนูยังคงรักอย่างออมใจ แอบรัก แอบชอบ แต่นั่นก็เป็นสิ่งที่ดีเพราะคนดีๆ ก็ต้องดูกันนานๆ ด้านสุขภาพห้ามประมาทเด็ดขาด หมั่นตรวจสุขภาพ เพราะถ้าปล่อยปละละเลยจะทำให้ล้มหมอนอนเสื่อได้ง่าย','2'),(25,'ราศีมังกร','1','','','','','','','','','ปี 2553 ที่กำลังจะมาถึงเป็นปีแห่งการต่อสู้ของชาวราศีมังกร เพราะต้องพบการงานที่หนักหน่วง ทำงานจนไม่มีเวลาพักผ่อน อาจเป็นสาเหตุให้ต้องล้มป่วยได้ง่าย ฉะนั้นต้องต่อสู้กับตัวเองอย่างหนักในการดูแลสุขภาพและออกกำลังกายเป็นพิเศษ เรื่องของหัวใจก็ต้องต่อสู้กับรักซ้อนที่จะเข้ามาพิสูจน์หัวใจของคุณว่ามั่น คงในความรักแค่ไหน แต่ถ้าสามารถผ่านพ้นวิกฤติครั้งนี้ไปได้ ความรักของคุณจะดำเนินไปด้วยดีจนถึงขีดสุด เรื่องของวัตถุนอกกายก็เป็นสิ่งที่เย้ายวนใจชาวมังกรเป็นอย่างมาก ต้องสู้กับใจของคุณเอง กำจัดความอยากในสิ่งที่ไม่จำเป็น มิเช่นนั้นจะชักหน้าไม่ถึงหลัง','3'),(26,'ราศีกุมภ์','2','','','','','','','','','ปี 2553 จะเป็นปีแห่งความสำเร็จทางด้านการงานของชาวราศีกุมภ์ จะได้ทำงานใหม่ๆ ที่ท้าทายความสามารถ หรือเริ่มต้นโครงการที่จะเกิดความสำเร็จสมบูรณ์ ใครที่ตกงานอยู่จะได้รับข่าวดี มีโชคในการสมัครงาน คนที่อยู่ในวัยเรียนจะสมหวังในสิ่งที่ปรารถนา ความรักของคนโสดจะเข้ามาอย่างหวือหวา ต้องศึกษากันให้ถ้วนถี่ มิเช่นนั้นอาจจะพบกับรักลวง สำหรับคนมีคู่ต้องใช้ความไว้ใจเป็นที่ตั้งแล้วจะผ่านอุปสรรคไปได้ด้วยดี สุขภาพระวังการกำเริบของโรคประจำตัว หรือโรคที่เป็นอยู่บ่อยๆ','3'),(27,'ราศีมีน','3','','','\r\n','\r\n','','\r\n','\r\n','','ปี 2553 เป็นปีแห่งความสุขของชาวราศีมีน จะมีสิ่งใหม่ๆ สิ่งดีๆ เกิดขึ้นมากมาย เริ่มจากการงานที่จะได้ริเริ่มทำงานแปลกใหม่ มีความคิดที่จะทำธุรกิจ ได้หุ้นส่วนที่ดีมีคุณธรรม ได้เพื่อนร่วมงานที่มาช่วยแบ่งเบาและร่วมผลักดันผลงานให้เข้าตาผู้บังคับ บัญชา และผลจากการกรำงานหนักจากปีที่แล้วส่งผลให้ค่าตอบแทนสูงตามไปด้วย คุณจะมีเงินไว้จับจ่ายของชิ้นใหญ่ที่อยากได้มานาน ด้านความรักหวานชื่นกว่าที่เคย นอกจากจะได้เดินทางร่วมกันอย่างสนุกสนานแล้ว คนรักยังจะนำโชคลาภมาสู่คุณอีกด้วย','3'),(28,'ราศีเมษ','4','','','','','','','','','ในปี 2553 ชาวราศีเมษจะมีอารมณ์ร้อนกว่าปีที่ผ่านมา ฉะนั้นไม่ว่าจะตัดสินใจเรื่องใด ต้องใช้สติเป็นอย่างมาก เรื่องการงานต้องระวังให้ดีถ้าจะมีการเซ็นสัญญาหรือการร่วมทุนระวังจะถูกต้ม ตุ๋น การทำงานกับคนหมู่มากก็ต้องระวังความคิดคำพูดให้จงหนักแล้วทุกอย่างจะดำเนิน ไปได้ด้วยดี เรื่องคาวมรักสำหรับคนมีคู่ต้องใช้หลักน้ำพึ่งเรือ เสือพึ่งป่า ครองรักกันด้วยเมตตาจิต สำหรับคนโสด เมื่อตกหลุมรักใครอย่าปักใจเชื่อแต่แรก รอให้เวลาเป็นเครื่องพิสูจน์ เพราะอาจมีรักลวงเข้ามาทำให้ปวดใจได้ง่ายในปีนี้ สุขภาพโดยรวมดีแต่ต้องระวังโรคที่เกิดจากความเครียด','3'),(29,'ราศีพฤษภ','5','','','','','','','','','ปี 2553 เป็นปีอันรุ่งโรจน์ทางด้านการงานของชาวราศีพฤษภ มีความคิดสร้างสรรค์มากล้น นำมาซึ่งความก้าวหน้าทางด้านการงาน จะได้ริเริ่มโครงการใหม่ๆ ได้เป็นหัวหน้า ได้เป็นผู้นำทีม และด้วยการที่ต้องเป็นผู้นำคนอื่นอาจมีเรื่องให้เครียดจากผู้ใต้บังคับบัญชา บ้าง ฉะนั้นต้องปกครองคนด้วยคุณธรรม เอาใจเขามาใส่ใจเรา ในด้านความรักอาจจะมีเวลาให้กันน้อยไปสักนิด เพราะเป็นปีที่กำลังมุ่งมั่นกับการงาน เมื่อใดที่มีเวลาว่างควรหากิจกรรมที่ทำร่วมกันในครอบครัว จะทำให้บรรยากาศดีขึ้นได้ ทางด้านสุขภาพแข็งแรงดี แถมจะอ้วนท้วนขึ้นด้วยเพราะทุ่มเทเวลาให้กับการงานมากไป ควรเจียดเวลาให้กับการออกกำลังกายด้วย','3'),(30,'ราศีมิถุน','6','','','','','','','','','ปี 2553 เป็นปีแห่งความสุขของชาวราศีเมถุน เต็มไปด้วยเงินทอง ยศถาบรรดาศักดิ์ นำมาซึ่งความสมบูรณ์ทั้งร่างกายและจิตใจ ได้กินของดีของอร่อย ท่องเที่ยวอย่างสำราญ ในด้านของหัวใจจะชุ่มชื่นกว่าที่เคย คนที่มีคู่จะสุขใจยิ่งขึ้น มีเกณฑ์มีบุตร คนโสดจะตกหลุมรักอย่างง่ายดาย และมีโอกาสพบการพัดหวนของรักเก่า อย่างไรต้องพิจารณาให้ถ้วนถี่ แต่แม้ชีวิตส่วนตัวที่ดำเนินไปด้วยดี แต่อาจมีเรื่องของครอบครัวและบริวารมาให้ร้อนใจบ้างเป็นครั้งคราว แต่ก็ไม่หนักหนา คำแนะนำสำหรับราศีนี้คือหมั่นทำบุญทำทาน เข้าวัดฟังธรรมบ้าง เพราะชีวิตที่มีความสุขเกินไปอาจจะทำให้เกิดความประมาทได้','3'),(31,'ราศีกรกฎ','7','','','','','','','','','ปี 2553 ชาวกรกฏต้องมีสติอย่างมาก เพราะจะมีอุปสรรคผ่านเข้ามาให้ฝ่าฟัน เริ่มจากเรื่องสุขภาพที่จะต้องดูแลอย่างเคร่งครัด ห้ามละเลย อย่างน้อยต้องหาเวลาไปตรวจสุขภาพบ้าง เรื่องของการงานและความรักจะมีการเปลี่ยนแปลงที่ทำให้ต้องอึดอัดใจ แต่ทั้งหมดนี้จะผ่านเข้ามาและผ่านไปในที่สุด ชีวิตที่สวยงามรอคุณอยู่ที่ปลายทางแน่นอนถ้าคุณมุ่งมั่นที่จะแก้ปัญหา ความสุขในชีวิตของชาวกรกฏในปีนี้จะต้องสร้างขึ้นจากตัวเองเป็นหลักแล้ว ทุกอย่างจะดำเนินไปด้วยดี','3'),(32,'ราศีสิงห์','8','','','','','','','','','ชาวราศีสิงห์ จะพบความมั่งคั่งในปี 2553 เพราะด้วยพลังความสร้างสรรค์และพลังกายอันเต็มเปี่ยม ทำให้มีงานเข้ามาให้ทำไม่ขาดสาย ยิ่งขยันมากก็ยิ่งได้เงินเยอะ ถือเป็นปีที่จะได้เงินเป็นกอบเป็นกำ ได้ใช้จ่ายคล่องมือ ได้ของที่อยากได้มานาน มีดวงดีในการเสี่ยงโชค จะได้ลาภผลที่คาดไม่ถึง แต่ก็อย่าประมาทกับชีวิตเกินไป เพราะอาจจะมีเรื่องท้าทายเข้ามาทดสอบคุณเช่นกัน ในด้านความรัก ชาวสิงห์มีพลังงานแห่งความสุขสูงมากในปีนี้ คนที่มีคู่จะรักกันหวานชื่น คนโสดจะสมหวัง ไม่ว่าคุณจะอกหักหรือเหงาหงอยมานานก็จะได้ชื่นใจแน่นอน ครึ่งหลังของปีมีโอกาสลุ้นสูง','3'),(33,'ราศีกันย์','9','','','','','','','','','ปี 2553 ชาวราศีกันต์ต้องก้าวให้ช้าแต่เป็นความช้าที่นำมาซึ่งความมั่นคงในชีวิต ในเรื่องของรายได้ เงินจะไหลมาอย่างช้าๆ แต่สม่ำเสมอ ถ้าอดทนเก็บหอมรอมริบและบริหารเงินอย่างลงตัว คุณจะรวยแบบที่คุณคาดไม่ถึงเลยทีเดียว ในเรื่องของความรักก็เช่นกัน คุณต้องดำเนินชีวิตคู่ให้ช้าลง แต่ก้าวไปข้างหน้าอย่างมั่นคงและมีสติ เร่งสร้างรากฐานครอบครัวให้แข็งแรงเพื่อชีวิตคู่ที่คุณฝันไว้ในอนาคต สำหรับคนโสดคุณจะพบรักอย่างคาดไม่ถึงจากการเดินทาง','3'),(34,'ราศีตุลย์','10','','','','','','','','','ปี 2553 เป็นปีที่เหมาะกับการแก้ไขสิ่งผิดพลาดในปีที่ผ่านมาของชาวราศีตุลย์ เพราะมีโอกาสทางการงานการเงินให้คุณได้เริ่มต้นมากมาย ลองเลือกเป้าหมายมาสักหนึ่งสิ่งและลงมือทำอย่างค่อยเป็นค่อยไป รับรองว่าคุณจะได้ลาภผลและความมั่นคงในชีวิตแน่นอน แต่บนเส้นทางแห่งความสำเร็จคุณอาจสะดุดได้ด้วยอุปสรรคทั้งเรื่องคนและเรื่องงาน แต่ปัญหาทุกอย่างจะคลี่คลายลงได้เพียงแต่คุณต้องค่อยๆ คิดแก้ไขปัญหา อย่ารีบร้อน ส่วนเรื่องความรักจะมีเรื่องการเงินเข้ามาเกี่ยวข้องด้วย ในที่นี้หมายถึงคุณต้องการใช้เงินเพื่อจริงจังกับคนรักหรือสร้างรากฐานครอบครัวให้แข็งแรง','3'),(35,'ราศีพิจิก','11','','','','','','','','','ชาว ราศีพิจิกที่คิดว่าปีที่แล้วเป็นที่ไม่ดี ปี 2553 ที่กำลังจะมาถึงจะเป็นปีที่ดีของคุณ เต็มไปความสุขสมหวัง ลาภ ยศ สรรเสริญ เด่นมากในเรื่องของความรัก สำหรับใครที่โสด คุณจะได้พบรักแท้ เจอคู่ที่ถูกใจเป็นที่สุด คนที่มีคู่แล้วความรักของคุณจะลงตัวขึ้น มีความพร้อมที่จะสร้างรากฐานครอบครัวให้มั่นคง ในด้านชีวิตการงาน จะก้าวหน้าเป็นอย่างดี โดยเฉพาะการทำงานเป็นทีมจะสำเร็จลุล่วงเป็นพิเศษ และถ้าชาวพิจิกที่คิดริเริ่มงานใหม่ๆ ก็ต้องเริ่มต้นอย่างรอบคอบ เตรียมพร้อมรับความท้าทายที่จะผ่านเข้ามา แต่ปลายทางจะเป็นปลายทางแห่งความสุขแน่นอน','3'),(36,'ราศีธนู','12','','','','','','','','','ปี 2553 เป็นปีที่ชาวราศีธนูต้องใช้ชีวิตอย่างพอเพียงและไม่ประมาท ในด้านของการงานคุณอาจจะได้ทำงานที่ดี มีรายได้เข้ามามาก แต่ก็มีเรื่องให้ต้องเสียเงินโดยใช่เหตุเช่นกัน จึงอาจมีบางช่วงที่ทำให้เงินขาดมือ แต่ก็ไม่ต้องกังวลให้มากเพราะจะมีคนเข้ามาอุปถัมภ์ให้รอดพ้นวิกฤติได้เสมอ แต่ทางที่ดีควรจะประหยัดการใช้จ่ายจะดีที่สุด ความช่วยเหลือจากคนอื่นจะได้เป็นทางเลือกสุดท้าย ในด้านความรักก็เช่นกันชาวธนูยังคงรักอย่างออมใจ แอบรัก แอบชอบ แต่นั่นก็เป็นสิ่งที่ดีเพราะคนดีๆ ก็ต้องดูกันนานๆ ด้านสุขภาพห้ามประมาทเด็ดขาด หมั่นตรวจสุขภาพ เพราะถ้าปล่อยปละละเลยจะทำให้ล้มหมอนอนเสื่อได้ง่าย','3'),(37,'ราศีมังกร','1','','','','','','','','','ปี 2553 ที่กำลังจะมาถึงเป็นปีแห่งการต่อสู้ของชาวราศีมังกร เพราะต้องพบการงานที่หนักหน่วง ทำงานจนไม่มีเวลาพักผ่อน อาจเป็นสาเหตุให้ต้องล้มป่วยได้ง่าย ฉะนั้นต้องต่อสู้กับตัวเองอย่างหนักในการดูแลสุขภาพและออกกำลังกายเป็นพิเศษ เรื่องของหัวใจก็ต้องต่อสู้กับรักซ้อนที่จะเข้ามาพิสูจน์หัวใจของคุณว่ามั่น คงในความรักแค่ไหน แต่ถ้าสามารถผ่านพ้นวิกฤติครั้งนี้ไปได้ ความรักของคุณจะดำเนินไปด้วยดีจนถึงขีดสุด เรื่องของวัตถุนอกกายก็เป็นสิ่งที่เย้ายวนใจชาวมังกรเป็นอย่างมาก ต้องสู้กับใจของคุณเอง กำจัดความอยากในสิ่งที่ไม่จำเป็น มิเช่นนั้นจะชักหน้าไม่ถึงหลัง','4'),(38,'ราศีกุมภ์','2','','','','','','','','','ปี 2553 จะเป็นปีแห่งความสำเร็จทางด้านการงานของชาวราศีกุมภ์ จะได้ทำงานใหม่ๆ ที่ท้าทายความสามารถ หรือเริ่มต้นโครงการที่จะเกิดความสำเร็จสมบูรณ์ ใครที่ตกงานอยู่จะได้รับข่าวดี มีโชคในการสมัครงาน คนที่อยู่ในวัยเรียนจะสมหวังในสิ่งที่ปรารถนา ความรักของคนโสดจะเข้ามาอย่างหวือหวา ต้องศึกษากันให้ถ้วนถี่ มิเช่นนั้นอาจจะพบกับรักลวง สำหรับคนมีคู่ต้องใช้ความไว้ใจเป็นที่ตั้งแล้วจะผ่านอุปสรรคไปได้ด้วยดี สุขภาพระวังการกำเริบของโรคประจำตัว หรือโรคที่เป็นอยู่บ่อยๆ','4'),(39,'ราศีมีน','3','','','\r\n','\r\n','','\r\n','\r\n','','ปี 2553 เป็นปีแห่งความสุขของชาวราศีมีน จะมีสิ่งใหม่ๆ สิ่งดีๆ เกิดขึ้นมากมาย เริ่มจากการงานที่จะได้ริเริ่มทำงานแปลกใหม่ มีความคิดที่จะทำธุรกิจ ได้หุ้นส่วนที่ดีมีคุณธรรม ได้เพื่อนร่วมงานที่มาช่วยแบ่งเบาและร่วมผลักดันผลงานให้เข้าตาผู้บังคับ บัญชา และผลจากการกรำงานหนักจากปีที่แล้วส่งผลให้ค่าตอบแทนสูงตามไปด้วย คุณจะมีเงินไว้จับจ่ายของชิ้นใหญ่ที่อยากได้มานาน ด้านความรักหวานชื่นกว่าที่เคย นอกจากจะได้เดินทางร่วมกันอย่างสนุกสนานแล้ว คนรักยังจะนำโชคลาภมาสู่คุณอีกด้วย','4'),(40,'ราศีเมษ','4','','','','','','','','','ในปี 2553 ชาวราศีเมษจะมีอารมณ์ร้อนกว่าปีที่ผ่านมา ฉะนั้นไม่ว่าจะตัดสินใจเรื่องใด ต้องใช้สติเป็นอย่างมาก เรื่องการงานต้องระวังให้ดีถ้าจะมีการเซ็นสัญญาหรือการร่วมทุนระวังจะถูกต้ม ตุ๋น การทำงานกับคนหมู่มากก็ต้องระวังความคิดคำพูดให้จงหนักแล้วทุกอย่างจะดำเนิน ไปได้ด้วยดี เรื่องคาวมรักสำหรับคนมีคู่ต้องใช้หลักน้ำพึ่งเรือ เสือพึ่งป่า ครองรักกันด้วยเมตตาจิต สำหรับคนโสด เมื่อตกหลุมรักใครอย่าปักใจเชื่อแต่แรก รอให้เวลาเป็นเครื่องพิสูจน์ เพราะอาจมีรักลวงเข้ามาทำให้ปวดใจได้ง่ายในปีนี้ สุขภาพโดยรวมดีแต่ต้องระวังโรคที่เกิดจากความเครียด','4'),(41,'ราศีพฤษภ','5','','','','','','','','','ปี 2553 เป็นปีอันรุ่งโรจน์ทางด้านการงานของชาวราศีพฤษภ มีความคิดสร้างสรรค์มากล้น นำมาซึ่งความก้าวหน้าทางด้านการงาน จะได้ริเริ่มโครงการใหม่ๆ ได้เป็นหัวหน้า ได้เป็นผู้นำทีม และด้วยการที่ต้องเป็นผู้นำคนอื่นอาจมีเรื่องให้เครียดจากผู้ใต้บังคับบัญชา บ้าง ฉะนั้นต้องปกครองคนด้วยคุณธรรม เอาใจเขามาใส่ใจเรา ในด้านความรักอาจจะมีเวลาให้กันน้อยไปสักนิด เพราะเป็นปีที่กำลังมุ่งมั่นกับการงาน เมื่อใดที่มีเวลาว่างควรหากิจกรรมที่ทำร่วมกันในครอบครัว จะทำให้บรรยากาศดีขึ้นได้ ทางด้านสุขภาพแข็งแรงดี แถมจะอ้วนท้วนขึ้นด้วยเพราะทุ่มเทเวลาให้กับการงานมากไป ควรเจียดเวลาให้กับการออกกำลังกายด้วย','4'),(42,'ราศีมิถุน','6','','','','','','','','','ปี 2553 เป็นปีแห่งความสุขของชาวราศีเมถุน เต็มไปด้วยเงินทอง ยศถาบรรดาศักดิ์ นำมาซึ่งความสมบูรณ์ทั้งร่างกายและจิตใจ ได้กินของดีของอร่อย ท่องเที่ยวอย่างสำราญ ในด้านของหัวใจจะชุ่มชื่นกว่าที่เคย คนที่มีคู่จะสุขใจยิ่งขึ้น มีเกณฑ์มีบุตร คนโสดจะตกหลุมรักอย่างง่ายดาย และมีโอกาสพบการพัดหวนของรักเก่า อย่างไรต้องพิจารณาให้ถ้วนถี่ แต่แม้ชีวิตส่วนตัวที่ดำเนินไปด้วยดี แต่อาจมีเรื่องของครอบครัวและบริวารมาให้ร้อนใจบ้างเป็นครั้งคราว แต่ก็ไม่หนักหนา คำแนะนำสำหรับราศีนี้คือหมั่นทำบุญทำทาน เข้าวัดฟังธรรมบ้าง เพราะชีวิตที่มีความสุขเกินไปอาจจะทำให้เกิดความประมาทได้','4'),(43,'ราศีกรกฎ','7','','','','','','','','','ปี 2553 ชาวกรกฏต้องมีสติอย่างมาก เพราะจะมีอุปสรรคผ่านเข้ามาให้ฝ่าฟัน เริ่มจากเรื่องสุขภาพที่จะต้องดูแลอย่างเคร่งครัด ห้ามละเลย อย่างน้อยต้องหาเวลาไปตรวจสุขภาพบ้าง เรื่องของการงานและความรักจะมีการเปลี่ยนแปลงที่ทำให้ต้องอึดอัดใจ แต่ทั้งหมดนี้จะผ่านเข้ามาและผ่านไปในที่สุด ชีวิตที่สวยงามรอคุณอยู่ที่ปลายทางแน่นอนถ้าคุณมุ่งมั่นที่จะแก้ปัญหา ความสุขในชีวิตของชาวกรกฏในปีนี้จะต้องสร้างขึ้นจากตัวเองเป็นหลักแล้ว ทุกอย่างจะดำเนินไปด้วยดี','4'),(44,'ราศีสิงห์','8','','','','','','','','','ชาวราศีสิงห์ จะพบความมั่งคั่งในปี 2553 เพราะด้วยพลังความสร้างสรรค์และพลังกายอันเต็มเปี่ยม ทำให้มีงานเข้ามาให้ทำไม่ขาดสาย ยิ่งขยันมากก็ยิ่งได้เงินเยอะ ถือเป็นปีที่จะได้เงินเป็นกอบเป็นกำ ได้ใช้จ่ายคล่องมือ ได้ของที่อยากได้มานาน มีดวงดีในการเสี่ยงโชค จะได้ลาภผลที่คาดไม่ถึง แต่ก็อย่าประมาทกับชีวิตเกินไป เพราะอาจจะมีเรื่องท้าทายเข้ามาทดสอบคุณเช่นกัน ในด้านความรัก ชาวสิงห์มีพลังงานแห่งความสุขสูงมากในปีนี้ คนที่มีคู่จะรักกันหวานชื่น คนโสดจะสมหวัง ไม่ว่าคุณจะอกหักหรือเหงาหงอยมานานก็จะได้ชื่นใจแน่นอน ครึ่งหลังของปีมีโอกาสลุ้นสูง','4'),(45,'ราศีกันย์','9','','','','','','','','','ปี 2553 ชาวราศีกันต์ต้องก้าวให้ช้าแต่เป็นความช้าที่นำมาซึ่งความมั่นคงในชีวิต ในเรื่องของรายได้ เงินจะไหลมาอย่างช้าๆ แต่สม่ำเสมอ ถ้าอดทนเก็บหอมรอมริบและบริหารเงินอย่างลงตัว คุณจะรวยแบบที่คุณคาดไม่ถึงเลยทีเดียว ในเรื่องของความรักก็เช่นกัน คุณต้องดำเนินชีวิตคู่ให้ช้าลง แต่ก้าวไปข้างหน้าอย่างมั่นคงและมีสติ เร่งสร้างรากฐานครอบครัวให้แข็งแรงเพื่อชีวิตคู่ที่คุณฝันไว้ในอนาคต สำหรับคนโสดคุณจะพบรักอย่างคาดไม่ถึงจากการเดินทาง','4'),(46,'ราศีตุลย์','10','','','','','','','','','ปี 2553 เป็นปีที่เหมาะกับการแก้ไขสิ่งผิดพลาดในปีที่ผ่านมาของชาวราศีตุลย์ เพราะมีโอกาสทางการงานการเงินให้คุณได้เริ่มต้นมากมาย ลองเลือกเป้าหมายมาสักหนึ่งสิ่งและลงมือทำอย่างค่อยเป็นค่อยไป รับรองว่าคุณจะได้ลาภผลและความมั่นคงในชีวิตแน่นอน แต่บนเส้นทางแห่งความสำเร็จคุณอาจสะดุดได้ด้วยอุปสรรคทั้งเรื่องคนและเรื่องงาน แต่ปัญหาทุกอย่างจะคลี่คลายลงได้เพียงแต่คุณต้องค่อยๆ คิดแก้ไขปัญหา อย่ารีบร้อน ส่วนเรื่องความรักจะมีเรื่องการเงินเข้ามาเกี่ยวข้องด้วย ในที่นี้หมายถึงคุณต้องการใช้เงินเพื่อจริงจังกับคนรักหรือสร้างรากฐานครอบครัวให้แข็งแรง','4'),(47,'ราศีพิจิก','11','','','','','','','','','ชาว ราศีพิจิกที่คิดว่าปีที่แล้วเป็นที่ไม่ดี ปี 2553 ที่กำลังจะมาถึงจะเป็นปีที่ดีของคุณ เต็มไปความสุขสมหวัง ลาภ ยศ สรรเสริญ เด่นมากในเรื่องของความรัก สำหรับใครที่โสด คุณจะได้พบรักแท้ เจอคู่ที่ถูกใจเป็นที่สุด คนที่มีคู่แล้วความรักของคุณจะลงตัวขึ้น มีความพร้อมที่จะสร้างรากฐานครอบครัวให้มั่นคง ในด้านชีวิตการงาน จะก้าวหน้าเป็นอย่างดี โดยเฉพาะการทำงานเป็นทีมจะสำเร็จลุล่วงเป็นพิเศษ และถ้าชาวพิจิกที่คิดริเริ่มงานใหม่ๆ ก็ต้องเริ่มต้นอย่างรอบคอบ เตรียมพร้อมรับความท้าทายที่จะผ่านเข้ามา แต่ปลายทางจะเป็นปลายทางแห่งความสุขแน่นอน','4'),(48,'ราศีธนู','12','','','','','','','','','ปี 2553 เป็นปีที่ชาวราศีธนูต้องใช้ชีวิตอย่างพอเพียงและไม่ประมาท ในด้านของการงานคุณอาจจะได้ทำงานที่ดี มีรายได้เข้ามามาก แต่ก็มีเรื่องให้ต้องเสียเงินโดยใช่เหตุเช่นกัน จึงอาจมีบางช่วงที่ทำให้เงินขาดมือ แต่ก็ไม่ต้องกังวลให้มากเพราะจะมีคนเข้ามาอุปถัมภ์ให้รอดพ้นวิกฤติได้เสมอ แต่ทางที่ดีควรจะประหยัดการใช้จ่ายจะดีที่สุด ความช่วยเหลือจากคนอื่นจะได้เป็นทางเลือกสุดท้าย ในด้านความรักก็เช่นกันชาวธนูยังคงรักอย่างออมใจ แอบรัก แอบชอบ แต่นั่นก็เป็นสิ่งที่ดีเพราะคนดีๆ ก็ต้องดูกันนานๆ ด้านสุขภาพห้ามประมาทเด็ดขาด หมั่นตรวจสุขภาพ เพราะถ้าปล่อยปละละเลยจะทำให้ล้มหมอนอนเสื่อได้ง่าย','4'),(49,'ราศีมังกร','1','','','','','','','','','ปี 2553 ที่กำลังจะมาถึงเป็นปีแห่งการต่อสู้ของชาวราศีมังกร เพราะต้องพบการงานที่หนักหน่วง ทำงานจนไม่มีเวลาพักผ่อน อาจเป็นสาเหตุให้ต้องล้มป่วยได้ง่าย ฉะนั้นต้องต่อสู้กับตัวเองอย่างหนักในการดูแลสุขภาพและออกกำลังกายเป็นพิเศษ เรื่องของหัวใจก็ต้องต่อสู้กับรักซ้อนที่จะเข้ามาพิสูจน์หัวใจของคุณว่ามั่น คงในความรักแค่ไหน แต่ถ้าสามารถผ่านพ้นวิกฤติครั้งนี้ไปได้ ความรักของคุณจะดำเนินไปด้วยดีจนถึงขีดสุด เรื่องของวัตถุนอกกายก็เป็นสิ่งที่เย้ายวนใจชาวมังกรเป็นอย่างมาก ต้องสู้กับใจของคุณเอง กำจัดความอยากในสิ่งที่ไม่จำเป็น มิเช่นนั้นจะชักหน้าไม่ถึงหลัง','5'),(50,'ราศีกุมภ์','2','','','','','','','','','ปี 2553 จะเป็นปีแห่งความสำเร็จทางด้านการงานของชาวราศีกุมภ์ จะได้ทำงานใหม่ๆ ที่ท้าทายความสามารถ หรือเริ่มต้นโครงการที่จะเกิดความสำเร็จสมบูรณ์ ใครที่ตกงานอยู่จะได้รับข่าวดี มีโชคในการสมัครงาน คนที่อยู่ในวัยเรียนจะสมหวังในสิ่งที่ปรารถนา ความรักของคนโสดจะเข้ามาอย่างหวือหวา ต้องศึกษากันให้ถ้วนถี่ มิเช่นนั้นอาจจะพบกับรักลวง สำหรับคนมีคู่ต้องใช้ความไว้ใจเป็นที่ตั้งแล้วจะผ่านอุปสรรคไปได้ด้วยดี สุขภาพระวังการกำเริบของโรคประจำตัว หรือโรคที่เป็นอยู่บ่อยๆ','5'),(51,'ราศีมีน','3','','','\r\n','\r\n','','\r\n','\r\n','','ปี 2553 เป็นปีแห่งความสุขของชาวราศีมีน จะมีสิ่งใหม่ๆ สิ่งดีๆ เกิดขึ้นมากมาย เริ่มจากการงานที่จะได้ริเริ่มทำงานแปลกใหม่ มีความคิดที่จะทำธุรกิจ ได้หุ้นส่วนที่ดีมีคุณธรรม ได้เพื่อนร่วมงานที่มาช่วยแบ่งเบาและร่วมผลักดันผลงานให้เข้าตาผู้บังคับ บัญชา และผลจากการกรำงานหนักจากปีที่แล้วส่งผลให้ค่าตอบแทนสูงตามไปด้วย คุณจะมีเงินไว้จับจ่ายของชิ้นใหญ่ที่อยากได้มานาน ด้านความรักหวานชื่นกว่าที่เคย นอกจากจะได้เดินทางร่วมกันอย่างสนุกสนานแล้ว คนรักยังจะนำโชคลาภมาสู่คุณอีกด้วย','5'),(52,'ราศีเมษ','4','','','','','','','','','ในปี 2553 ชาวราศีเมษจะมีอารมณ์ร้อนกว่าปีที่ผ่านมา ฉะนั้นไม่ว่าจะตัดสินใจเรื่องใด ต้องใช้สติเป็นอย่างมาก เรื่องการงานต้องระวังให้ดีถ้าจะมีการเซ็นสัญญาหรือการร่วมทุนระวังจะถูกต้ม ตุ๋น การทำงานกับคนหมู่มากก็ต้องระวังความคิดคำพูดให้จงหนักแล้วทุกอย่างจะดำเนิน ไปได้ด้วยดี เรื่องคาวมรักสำหรับคนมีคู่ต้องใช้หลักน้ำพึ่งเรือ เสือพึ่งป่า ครองรักกันด้วยเมตตาจิต สำหรับคนโสด เมื่อตกหลุมรักใครอย่าปักใจเชื่อแต่แรก รอให้เวลาเป็นเครื่องพิสูจน์ เพราะอาจมีรักลวงเข้ามาทำให้ปวดใจได้ง่ายในปีนี้ สุขภาพโดยรวมดีแต่ต้องระวังโรคที่เกิดจากความเครียด','5'),(53,'ราศีพฤษภ','5','','','','','','','','','ปี 2553 เป็นปีอันรุ่งโรจน์ทางด้านการงานของชาวราศีพฤษภ มีความคิดสร้างสรรค์มากล้น นำมาซึ่งความก้าวหน้าทางด้านการงาน จะได้ริเริ่มโครงการใหม่ๆ ได้เป็นหัวหน้า ได้เป็นผู้นำทีม และด้วยการที่ต้องเป็นผู้นำคนอื่นอาจมีเรื่องให้เครียดจากผู้ใต้บังคับบัญชา บ้าง ฉะนั้นต้องปกครองคนด้วยคุณธรรม เอาใจเขามาใส่ใจเรา ในด้านความรักอาจจะมีเวลาให้กันน้อยไปสักนิด เพราะเป็นปีที่กำลังมุ่งมั่นกับการงาน เมื่อใดที่มีเวลาว่างควรหากิจกรรมที่ทำร่วมกันในครอบครัว จะทำให้บรรยากาศดีขึ้นได้ ทางด้านสุขภาพแข็งแรงดี แถมจะอ้วนท้วนขึ้นด้วยเพราะทุ่มเทเวลาให้กับการงานมากไป ควรเจียดเวลาให้กับการออกกำลังกายด้วย','5'),(54,'ราศีมิถุน','6','','','','','','','','','ปี 2553 เป็นปีแห่งความสุขของชาวราศีเมถุน เต็มไปด้วยเงินทอง ยศถาบรรดาศักดิ์ นำมาซึ่งความสมบูรณ์ทั้งร่างกายและจิตใจ ได้กินของดีของอร่อย ท่องเที่ยวอย่างสำราญ ในด้านของหัวใจจะชุ่มชื่นกว่าที่เคย คนที่มีคู่จะสุขใจยิ่งขึ้น มีเกณฑ์มีบุตร คนโสดจะตกหลุมรักอย่างง่ายดาย และมีโอกาสพบการพัดหวนของรักเก่า อย่างไรต้องพิจารณาให้ถ้วนถี่ แต่แม้ชีวิตส่วนตัวที่ดำเนินไปด้วยดี แต่อาจมีเรื่องของครอบครัวและบริวารมาให้ร้อนใจบ้างเป็นครั้งคราว แต่ก็ไม่หนักหนา คำแนะนำสำหรับราศีนี้คือหมั่นทำบุญทำทาน เข้าวัดฟังธรรมบ้าง เพราะชีวิตที่มีความสุขเกินไปอาจจะทำให้เกิดความประมาทได้','5'),(55,'ราศีกรกฎ','7','','','','','','','','','ปี 2553 ชาวกรกฏต้องมีสติอย่างมาก เพราะจะมีอุปสรรคผ่านเข้ามาให้ฝ่าฟัน เริ่มจากเรื่องสุขภาพที่จะต้องดูแลอย่างเคร่งครัด ห้ามละเลย อย่างน้อยต้องหาเวลาไปตรวจสุขภาพบ้าง เรื่องของการงานและความรักจะมีการเปลี่ยนแปลงที่ทำให้ต้องอึดอัดใจ แต่ทั้งหมดนี้จะผ่านเข้ามาและผ่านไปในที่สุด ชีวิตที่สวยงามรอคุณอยู่ที่ปลายทางแน่นอนถ้าคุณมุ่งมั่นที่จะแก้ปัญหา ความสุขในชีวิตของชาวกรกฏในปีนี้จะต้องสร้างขึ้นจากตัวเองเป็นหลักแล้ว ทุกอย่างจะดำเนินไปด้วยดี','5'),(56,'ราศีสิงห์','8','','','','','','','','','ชาวราศีสิงห์ จะพบความมั่งคั่งในปี 2553 เพราะด้วยพลังความสร้างสรรค์และพลังกายอันเต็มเปี่ยม ทำให้มีงานเข้ามาให้ทำไม่ขาดสาย ยิ่งขยันมากก็ยิ่งได้เงินเยอะ ถือเป็นปีที่จะได้เงินเป็นกอบเป็นกำ ได้ใช้จ่ายคล่องมือ ได้ของที่อยากได้มานาน มีดวงดีในการเสี่ยงโชค จะได้ลาภผลที่คาดไม่ถึง แต่ก็อย่าประมาทกับชีวิตเกินไป เพราะอาจจะมีเรื่องท้าทายเข้ามาทดสอบคุณเช่นกัน ในด้านความรัก ชาวสิงห์มีพลังงานแห่งความสุขสูงมากในปีนี้ คนที่มีคู่จะรักกันหวานชื่น คนโสดจะสมหวัง ไม่ว่าคุณจะอกหักหรือเหงาหงอยมานานก็จะได้ชื่นใจแน่นอน ครึ่งหลังของปีมีโอกาสลุ้นสูง','5'),(57,'ราศีกันย์','9','','','','','','','','','ปี 2553 ชาวราศีกันต์ต้องก้าวให้ช้าแต่เป็นความช้าที่นำมาซึ่งความมั่นคงในชีวิต ในเรื่องของรายได้ เงินจะไหลมาอย่างช้าๆ แต่สม่ำเสมอ ถ้าอดทนเก็บหอมรอมริบและบริหารเงินอย่างลงตัว คุณจะรวยแบบที่คุณคาดไม่ถึงเลยทีเดียว ในเรื่องของความรักก็เช่นกัน คุณต้องดำเนินชีวิตคู่ให้ช้าลง แต่ก้าวไปข้างหน้าอย่างมั่นคงและมีสติ เร่งสร้างรากฐานครอบครัวให้แข็งแรงเพื่อชีวิตคู่ที่คุณฝันไว้ในอนาคต สำหรับคนโสดคุณจะพบรักอย่างคาดไม่ถึงจากการเดินทาง','5'),(58,'ราศีตุลย์','10','','','','','','','','','ปี 2553 เป็นปีที่เหมาะกับการแก้ไขสิ่งผิดพลาดในปีที่ผ่านมาของชาวราศีตุลย์ เพราะมีโอกาสทางการงานการเงินให้คุณได้เริ่มต้นมากมาย ลองเลือกเป้าหมายมาสักหนึ่งสิ่งและลงมือทำอย่างค่อยเป็นค่อยไป รับรองว่าคุณจะได้ลาภผลและความมั่นคงในชีวิตแน่นอน แต่บนเส้นทางแห่งความสำเร็จคุณอาจสะดุดได้ด้วยอุปสรรคทั้งเรื่องคนและเรื่องงาน แต่ปัญหาทุกอย่างจะคลี่คลายลงได้เพียงแต่คุณต้องค่อยๆ คิดแก้ไขปัญหา อย่ารีบร้อน ส่วนเรื่องความรักจะมีเรื่องการเงินเข้ามาเกี่ยวข้องด้วย ในที่นี้หมายถึงคุณต้องการใช้เงินเพื่อจริงจังกับคนรักหรือสร้างรากฐานครอบครัวให้แข็งแรง','5'),(59,'ราศีพิจิก','11','','','','','','','','','ชาว ราศีพิจิกที่คิดว่าปีที่แล้วเป็นที่ไม่ดี ปี 2553 ที่กำลังจะมาถึงจะเป็นปีที่ดีของคุณ เต็มไปความสุขสมหวัง ลาภ ยศ สรรเสริญ เด่นมากในเรื่องของความรัก สำหรับใครที่โสด คุณจะได้พบรักแท้ เจอคู่ที่ถูกใจเป็นที่สุด คนที่มีคู่แล้วความรักของคุณจะลงตัวขึ้น มีความพร้อมที่จะสร้างรากฐานครอบครัวให้มั่นคง ในด้านชีวิตการงาน จะก้าวหน้าเป็นอย่างดี โดยเฉพาะการทำงานเป็นทีมจะสำเร็จลุล่วงเป็นพิเศษ และถ้าชาวพิจิกที่คิดริเริ่มงานใหม่ๆ ก็ต้องเริ่มต้นอย่างรอบคอบ เตรียมพร้อมรับความท้าทายที่จะผ่านเข้ามา แต่ปลายทางจะเป็นปลายทางแห่งความสุขแน่นอน','5'),(60,'ราศีธนู','12','','','','','','','','','ปี 2553 เป็นปีที่ชาวราศีธนูต้องใช้ชีวิตอย่างพอเพียงและไม่ประมาท ในด้านของการงานคุณอาจจะได้ทำงานที่ดี มีรายได้เข้ามามาก แต่ก็มีเรื่องให้ต้องเสียเงินโดยใช่เหตุเช่นกัน จึงอาจมีบางช่วงที่ทำให้เงินขาดมือ แต่ก็ไม่ต้องกังวลให้มากเพราะจะมีคนเข้ามาอุปถัมภ์ให้รอดพ้นวิกฤติได้เสมอ แต่ทางที่ดีควรจะประหยัดการใช้จ่ายจะดีที่สุด ความช่วยเหลือจากคนอื่นจะได้เป็นทางเลือกสุดท้าย ในด้านความรักก็เช่นกันชาวธนูยังคงรักอย่างออมใจ แอบรัก แอบชอบ แต่นั่นก็เป็นสิ่งที่ดีเพราะคนดีๆ ก็ต้องดูกันนานๆ ด้านสุขภาพห้ามประมาทเด็ดขาด หมั่นตรวจสุขภาพ เพราะถ้าปล่อยปละละเลยจะทำให้ล้มหมอนอนเสื่อได้ง่าย','5'),(61,'ราศีมังกร','1','','','','','','','','','ปี 2553 ที่กำลังจะมาถึงเป็นปีแห่งการต่อสู้ของชาวราศีมังกร เพราะต้องพบการงานที่หนักหน่วง ทำงานจนไม่มีเวลาพักผ่อน อาจเป็นสาเหตุให้ต้องล้มป่วยได้ง่าย ฉะนั้นต้องต่อสู้กับตัวเองอย่างหนักในการดูแลสุขภาพและออกกำลังกายเป็นพิเศษ เรื่องของหัวใจก็ต้องต่อสู้กับรักซ้อนที่จะเข้ามาพิสูจน์หัวใจของคุณว่ามั่น คงในความรักแค่ไหน แต่ถ้าสามารถผ่านพ้นวิกฤติครั้งนี้ไปได้ ความรักของคุณจะดำเนินไปด้วยดีจนถึงขีดสุด เรื่องของวัตถุนอกกายก็เป็นสิ่งที่เย้ายวนใจชาวมังกรเป็นอย่างมาก ต้องสู้กับใจของคุณเอง กำจัดความอยากในสิ่งที่ไม่จำเป็น มิเช่นนั้นจะชักหน้าไม่ถึงหลัง','6'),(62,'ราศีกุมภ์','2','','','','','','','','','ปี 2553 จะเป็นปีแห่งความสำเร็จทางด้านการงานของชาวราศีกุมภ์ จะได้ทำงานใหม่ๆ ที่ท้าทายความสามารถ หรือเริ่มต้นโครงการที่จะเกิดความสำเร็จสมบูรณ์ ใครที่ตกงานอยู่จะได้รับข่าวดี มีโชคในการสมัครงาน คนที่อยู่ในวัยเรียนจะสมหวังในสิ่งที่ปรารถนา ความรักของคนโสดจะเข้ามาอย่างหวือหวา ต้องศึกษากันให้ถ้วนถี่ มิเช่นนั้นอาจจะพบกับรักลวง สำหรับคนมีคู่ต้องใช้ความไว้ใจเป็นที่ตั้งแล้วจะผ่านอุปสรรคไปได้ด้วยดี สุขภาพระวังการกำเริบของโรคประจำตัว หรือโรคที่เป็นอยู่บ่อยๆ','6'),(63,'ราศีมีน','3','','','\r\n','\r\n','','\r\n','\r\n','','ปี 2553 เป็นปีแห่งความสุขของชาวราศีมีน จะมีสิ่งใหม่ๆ สิ่งดีๆ เกิดขึ้นมากมาย เริ่มจากการงานที่จะได้ริเริ่มทำงานแปลกใหม่ มีความคิดที่จะทำธุรกิจ ได้หุ้นส่วนที่ดีมีคุณธรรม ได้เพื่อนร่วมงานที่มาช่วยแบ่งเบาและร่วมผลักดันผลงานให้เข้าตาผู้บังคับ บัญชา และผลจากการกรำงานหนักจากปีที่แล้วส่งผลให้ค่าตอบแทนสูงตามไปด้วย คุณจะมีเงินไว้จับจ่ายของชิ้นใหญ่ที่อยากได้มานาน ด้านความรักหวานชื่นกว่าที่เคย นอกจากจะได้เดินทางร่วมกันอย่างสนุกสนานแล้ว คนรักยังจะนำโชคลาภมาสู่คุณอีกด้วย','6'),(64,'ราศีเมษ','4','','','','','','','','','ในปี 2553 ชาวราศีเมษจะมีอารมณ์ร้อนกว่าปีที่ผ่านมา ฉะนั้นไม่ว่าจะตัดสินใจเรื่องใด ต้องใช้สติเป็นอย่างมาก เรื่องการงานต้องระวังให้ดีถ้าจะมีการเซ็นสัญญาหรือการร่วมทุนระวังจะถูกต้ม ตุ๋น การทำงานกับคนหมู่มากก็ต้องระวังความคิดคำพูดให้จงหนักแล้วทุกอย่างจะดำเนิน ไปได้ด้วยดี เรื่องคาวมรักสำหรับคนมีคู่ต้องใช้หลักน้ำพึ่งเรือ เสือพึ่งป่า ครองรักกันด้วยเมตตาจิต สำหรับคนโสด เมื่อตกหลุมรักใครอย่าปักใจเชื่อแต่แรก รอให้เวลาเป็นเครื่องพิสูจน์ เพราะอาจมีรักลวงเข้ามาทำให้ปวดใจได้ง่ายในปีนี้ สุขภาพโดยรวมดีแต่ต้องระวังโรคที่เกิดจากความเครียด','6'),(65,'ราศีพฤษภ','5','','','','','','','','','ปี 2553 เป็นปีอันรุ่งโรจน์ทางด้านการงานของชาวราศีพฤษภ มีความคิดสร้างสรรค์มากล้น นำมาซึ่งความก้าวหน้าทางด้านการงาน จะได้ริเริ่มโครงการใหม่ๆ ได้เป็นหัวหน้า ได้เป็นผู้นำทีม และด้วยการที่ต้องเป็นผู้นำคนอื่นอาจมีเรื่องให้เครียดจากผู้ใต้บังคับบัญชา บ้าง ฉะนั้นต้องปกครองคนด้วยคุณธรรม เอาใจเขามาใส่ใจเรา ในด้านความรักอาจจะมีเวลาให้กันน้อยไปสักนิด เพราะเป็นปีที่กำลังมุ่งมั่นกับการงาน เมื่อใดที่มีเวลาว่างควรหากิจกรรมที่ทำร่วมกันในครอบครัว จะทำให้บรรยากาศดีขึ้นได้ ทางด้านสุขภาพแข็งแรงดี แถมจะอ้วนท้วนขึ้นด้วยเพราะทุ่มเทเวลาให้กับการงานมากไป ควรเจียดเวลาให้กับการออกกำลังกายด้วย','6'),(66,'ราศีมิถุน','6','','','','','','','','','ปี 2553 เป็นปีแห่งความสุขของชาวราศีเมถุน เต็มไปด้วยเงินทอง ยศถาบรรดาศักดิ์ นำมาซึ่งความสมบูรณ์ทั้งร่างกายและจิตใจ ได้กินของดีของอร่อย ท่องเที่ยวอย่างสำราญ ในด้านของหัวใจจะชุ่มชื่นกว่าที่เคย คนที่มีคู่จะสุขใจยิ่งขึ้น มีเกณฑ์มีบุตร คนโสดจะตกหลุมรักอย่างง่ายดาย และมีโอกาสพบการพัดหวนของรักเก่า อย่างไรต้องพิจารณาให้ถ้วนถี่ แต่แม้ชีวิตส่วนตัวที่ดำเนินไปด้วยดี แต่อาจมีเรื่องของครอบครัวและบริวารมาให้ร้อนใจบ้างเป็นครั้งคราว แต่ก็ไม่หนักหนา คำแนะนำสำหรับราศีนี้คือหมั่นทำบุญทำทาน เข้าวัดฟังธรรมบ้าง เพราะชีวิตที่มีความสุขเกินไปอาจจะทำให้เกิดความประมาทได้','6'),(67,'ราศีกรกฎ','7','','','','','','','','','ปี 2553 ชาวกรกฏต้องมีสติอย่างมาก เพราะจะมีอุปสรรคผ่านเข้ามาให้ฝ่าฟัน เริ่มจากเรื่องสุขภาพที่จะต้องดูแลอย่างเคร่งครัด ห้ามละเลย อย่างน้อยต้องหาเวลาไปตรวจสุขภาพบ้าง เรื่องของการงานและความรักจะมีการเปลี่ยนแปลงที่ทำให้ต้องอึดอัดใจ แต่ทั้งหมดนี้จะผ่านเข้ามาและผ่านไปในที่สุด ชีวิตที่สวยงามรอคุณอยู่ที่ปลายทางแน่นอนถ้าคุณมุ่งมั่นที่จะแก้ปัญหา ความสุขในชีวิตของชาวกรกฏในปีนี้จะต้องสร้างขึ้นจากตัวเองเป็นหลักแล้ว ทุกอย่างจะดำเนินไปด้วยดี','6'),(68,'ราศีสิงห์','8','','','','','','','','','ชาวราศีสิงห์ จะพบความมั่งคั่งในปี 2553 เพราะด้วยพลังความสร้างสรรค์และพลังกายอันเต็มเปี่ยม ทำให้มีงานเข้ามาให้ทำไม่ขาดสาย ยิ่งขยันมากก็ยิ่งได้เงินเยอะ ถือเป็นปีที่จะได้เงินเป็นกอบเป็นกำ ได้ใช้จ่ายคล่องมือ ได้ของที่อยากได้มานาน มีดวงดีในการเสี่ยงโชค จะได้ลาภผลที่คาดไม่ถึง แต่ก็อย่าประมาทกับชีวิตเกินไป เพราะอาจจะมีเรื่องท้าทายเข้ามาทดสอบคุณเช่นกัน ในด้านความรัก ชาวสิงห์มีพลังงานแห่งความสุขสูงมากในปีนี้ คนที่มีคู่จะรักกันหวานชื่น คนโสดจะสมหวัง ไม่ว่าคุณจะอกหักหรือเหงาหงอยมานานก็จะได้ชื่นใจแน่นอน ครึ่งหลังของปีมีโอกาสลุ้นสูง','6'),(69,'ราศีกันย์','9','','','','','','','','','ปี 2553 ชาวราศีกันต์ต้องก้าวให้ช้าแต่เป็นความช้าที่นำมาซึ่งความมั่นคงในชีวิต ในเรื่องของรายได้ เงินจะไหลมาอย่างช้าๆ แต่สม่ำเสมอ ถ้าอดทนเก็บหอมรอมริบและบริหารเงินอย่างลงตัว คุณจะรวยแบบที่คุณคาดไม่ถึงเลยทีเดียว ในเรื่องของความรักก็เช่นกัน คุณต้องดำเนินชีวิตคู่ให้ช้าลง แต่ก้าวไปข้างหน้าอย่างมั่นคงและมีสติ เร่งสร้างรากฐานครอบครัวให้แข็งแรงเพื่อชีวิตคู่ที่คุณฝันไว้ในอนาคต สำหรับคนโสดคุณจะพบรักอย่างคาดไม่ถึงจากการเดินทาง','6'),(70,'ราศีตุลย์','10','','','','','','','','','ปี 2553 เป็นปีที่เหมาะกับการแก้ไขสิ่งผิดพลาดในปีที่ผ่านมาของชาวราศีตุลย์ เพราะมีโอกาสทางการงานการเงินให้คุณได้เริ่มต้นมากมาย ลองเลือกเป้าหมายมาสักหนึ่งสิ่งและลงมือทำอย่างค่อยเป็นค่อยไป รับรองว่าคุณจะได้ลาภผลและความมั่นคงในชีวิตแน่นอน แต่บนเส้นทางแห่งความสำเร็จคุณอาจสะดุดได้ด้วยอุปสรรคทั้งเรื่องคนและเรื่องงาน แต่ปัญหาทุกอย่างจะคลี่คลายลงได้เพียงแต่คุณต้องค่อยๆ คิดแก้ไขปัญหา อย่ารีบร้อน ส่วนเรื่องความรักจะมีเรื่องการเงินเข้ามาเกี่ยวข้องด้วย ในที่นี้หมายถึงคุณต้องการใช้เงินเพื่อจริงจังกับคนรักหรือสร้างรากฐานครอบครัวให้แข็งแรง','6'),(71,'ราศีพิจิก','11','','','','','','','','','ชาว ราศีพิจิกที่คิดว่าปีที่แล้วเป็นที่ไม่ดี ปี 2553 ที่กำลังจะมาถึงจะเป็นปีที่ดีของคุณ เต็มไปความสุขสมหวัง ลาภ ยศ สรรเสริญ เด่นมากในเรื่องของความรัก สำหรับใครที่โสด คุณจะได้พบรักแท้ เจอคู่ที่ถูกใจเป็นที่สุด คนที่มีคู่แล้วความรักของคุณจะลงตัวขึ้น มีความพร้อมที่จะสร้างรากฐานครอบครัวให้มั่นคง ในด้านชีวิตการงาน จะก้าวหน้าเป็นอย่างดี โดยเฉพาะการทำงานเป็นทีมจะสำเร็จลุล่วงเป็นพิเศษ และถ้าชาวพิจิกที่คิดริเริ่มงานใหม่ๆ ก็ต้องเริ่มต้นอย่างรอบคอบ เตรียมพร้อมรับความท้าทายที่จะผ่านเข้ามา แต่ปลายทางจะเป็นปลายทางแห่งความสุขแน่นอน','6'),(72,'ราศีธนู','12','','','','','','','','','ปี 2553 เป็นปีที่ชาวราศีธนูต้องใช้ชีวิตอย่างพอเพียงและไม่ประมาท ในด้านของการงานคุณอาจจะได้ทำงานที่ดี มีรายได้เข้ามามาก แต่ก็มีเรื่องให้ต้องเสียเงินโดยใช่เหตุเช่นกัน จึงอาจมีบางช่วงที่ทำให้เงินขาดมือ แต่ก็ไม่ต้องกังวลให้มากเพราะจะมีคนเข้ามาอุปถัมภ์ให้รอดพ้นวิกฤติได้เสมอ แต่ทางที่ดีควรจะประหยัดการใช้จ่ายจะดีที่สุด ความช่วยเหลือจากคนอื่นจะได้เป็นทางเลือกสุดท้าย ในด้านความรักก็เช่นกันชาวธนูยังคงรักอย่างออมใจ แอบรัก แอบชอบ แต่นั่นก็เป็นสิ่งที่ดีเพราะคนดีๆ ก็ต้องดูกันนานๆ ด้านสุขภาพห้ามประมาทเด็ดขาด หมั่นตรวจสุขภาพ เพราะถ้าปล่อยปละละเลยจะทำให้ล้มหมอนอนเสื่อได้ง่าย','6'),(73,'ราศีมังกร','1','','','','','','','','','ปี 2553 ที่กำลังจะมาถึงเป็นปีแห่งการต่อสู้ของชาวราศีมังกร เพราะต้องพบการงานที่หนักหน่วง ทำงานจนไม่มีเวลาพักผ่อน อาจเป็นสาเหตุให้ต้องล้มป่วยได้ง่าย ฉะนั้นต้องต่อสู้กับตัวเองอย่างหนักในการดูแลสุขภาพและออกกำลังกายเป็นพิเศษ เรื่องของหัวใจก็ต้องต่อสู้กับรักซ้อนที่จะเข้ามาพิสูจน์หัวใจของคุณว่ามั่น คงในความรักแค่ไหน แต่ถ้าสามารถผ่านพ้นวิกฤติครั้งนี้ไปได้ ความรักของคุณจะดำเนินไปด้วยดีจนถึงขีดสุด เรื่องของวัตถุนอกกายก็เป็นสิ่งที่เย้ายวนใจชาวมังกรเป็นอย่างมาก ต้องสู้กับใจของคุณเอง กำจัดความอยากในสิ่งที่ไม่จำเป็น มิเช่นนั้นจะชักหน้าไม่ถึงหลัง','7'),(74,'ราศีกุมภ์','2','','','','','','','','','ปี 2553 จะเป็นปีแห่งความสำเร็จทางด้านการงานของชาวราศีกุมภ์ จะได้ทำงานใหม่ๆ ที่ท้าทายความสามารถ หรือเริ่มต้นโครงการที่จะเกิดความสำเร็จสมบูรณ์ ใครที่ตกงานอยู่จะได้รับข่าวดี มีโชคในการสมัครงาน คนที่อยู่ในวัยเรียนจะสมหวังในสิ่งที่ปรารถนา ความรักของคนโสดจะเข้ามาอย่างหวือหวา ต้องศึกษากันให้ถ้วนถี่ มิเช่นนั้นอาจจะพบกับรักลวง สำหรับคนมีคู่ต้องใช้ความไว้ใจเป็นที่ตั้งแล้วจะผ่านอุปสรรคไปได้ด้วยดี สุขภาพระวังการกำเริบของโรคประจำตัว หรือโรคที่เป็นอยู่บ่อยๆ','7'),(75,'ราศีมีน','3','','','\r\n','\r\n','','\r\n','\r\n','','ปี 2553 เป็นปีแห่งความสุขของชาวราศีมีน จะมีสิ่งใหม่ๆ สิ่งดีๆ เกิดขึ้นมากมาย เริ่มจากการงานที่จะได้ริเริ่มทำงานแปลกใหม่ มีความคิดที่จะทำธุรกิจ ได้หุ้นส่วนที่ดีมีคุณธรรม ได้เพื่อนร่วมงานที่มาช่วยแบ่งเบาและร่วมผลักดันผลงานให้เข้าตาผู้บังคับ บัญชา และผลจากการกรำงานหนักจากปีที่แล้วส่งผลให้ค่าตอบแทนสูงตามไปด้วย คุณจะมีเงินไว้จับจ่ายของชิ้นใหญ่ที่อยากได้มานาน ด้านความรักหวานชื่นกว่าที่เคย นอกจากจะได้เดินทางร่วมกันอย่างสนุกสนานแล้ว คนรักยังจะนำโชคลาภมาสู่คุณอีกด้วย','7'),(76,'ราศีเมษ','4','','','','','','','','','ในปี 2553 ชาวราศีเมษจะมีอารมณ์ร้อนกว่าปีที่ผ่านมา ฉะนั้นไม่ว่าจะตัดสินใจเรื่องใด ต้องใช้สติเป็นอย่างมาก เรื่องการงานต้องระวังให้ดีถ้าจะมีการเซ็นสัญญาหรือการร่วมทุนระวังจะถูกต้ม ตุ๋น การทำงานกับคนหมู่มากก็ต้องระวังความคิดคำพูดให้จงหนักแล้วทุกอย่างจะดำเนิน ไปได้ด้วยดี เรื่องคาวมรักสำหรับคนมีคู่ต้องใช้หลักน้ำพึ่งเรือ เสือพึ่งป่า ครองรักกันด้วยเมตตาจิต สำหรับคนโสด เมื่อตกหลุมรักใครอย่าปักใจเชื่อแต่แรก รอให้เวลาเป็นเครื่องพิสูจน์ เพราะอาจมีรักลวงเข้ามาทำให้ปวดใจได้ง่ายในปีนี้ สุขภาพโดยรวมดีแต่ต้องระวังโรคที่เกิดจากความเครียด','7'),(77,'ราศีพฤษภ','5','','','','','','','','','ปี 2553 เป็นปีอันรุ่งโรจน์ทางด้านการงานของชาวราศีพฤษภ มีความคิดสร้างสรรค์มากล้น นำมาซึ่งความก้าวหน้าทางด้านการงาน จะได้ริเริ่มโครงการใหม่ๆ ได้เป็นหัวหน้า ได้เป็นผู้นำทีม และด้วยการที่ต้องเป็นผู้นำคนอื่นอาจมีเรื่องให้เครียดจากผู้ใต้บังคับบัญชา บ้าง ฉะนั้นต้องปกครองคนด้วยคุณธรรม เอาใจเขามาใส่ใจเรา ในด้านความรักอาจจะมีเวลาให้กันน้อยไปสักนิด เพราะเป็นปีที่กำลังมุ่งมั่นกับการงาน เมื่อใดที่มีเวลาว่างควรหากิจกรรมที่ทำร่วมกันในครอบครัว จะทำให้บรรยากาศดีขึ้นได้ ทางด้านสุขภาพแข็งแรงดี แถมจะอ้วนท้วนขึ้นด้วยเพราะทุ่มเทเวลาให้กับการงานมากไป ควรเจียดเวลาให้กับการออกกำลังกายด้วย','7'),(78,'ราศีมิถุน','6','','','','','','','','','ปี 2553 เป็นปีแห่งความสุขของชาวราศีเมถุน เต็มไปด้วยเงินทอง ยศถาบรรดาศักดิ์ นำมาซึ่งความสมบูรณ์ทั้งร่างกายและจิตใจ ได้กินของดีของอร่อย ท่องเที่ยวอย่างสำราญ ในด้านของหัวใจจะชุ่มชื่นกว่าที่เคย คนที่มีคู่จะสุขใจยิ่งขึ้น มีเกณฑ์มีบุตร คนโสดจะตกหลุมรักอย่างง่ายดาย และมีโอกาสพบการพัดหวนของรักเก่า อย่างไรต้องพิจารณาให้ถ้วนถี่ แต่แม้ชีวิตส่วนตัวที่ดำเนินไปด้วยดี แต่อาจมีเรื่องของครอบครัวและบริวารมาให้ร้อนใจบ้างเป็นครั้งคราว แต่ก็ไม่หนักหนา คำแนะนำสำหรับราศีนี้คือหมั่นทำบุญทำทาน เข้าวัดฟังธรรมบ้าง เพราะชีวิตที่มีความสุขเกินไปอาจจะทำให้เกิดความประมาทได้','7'),(79,'ราศีกรกฎ','7','','','','','','','','','ปี 2553 ชาวกรกฏต้องมีสติอย่างมาก เพราะจะมีอุปสรรคผ่านเข้ามาให้ฝ่าฟัน เริ่มจากเรื่องสุขภาพที่จะต้องดูแลอย่างเคร่งครัด ห้ามละเลย อย่างน้อยต้องหาเวลาไปตรวจสุขภาพบ้าง เรื่องของการงานและความรักจะมีการเปลี่ยนแปลงที่ทำให้ต้องอึดอัดใจ แต่ทั้งหมดนี้จะผ่านเข้ามาและผ่านไปในที่สุด ชีวิตที่สวยงามรอคุณอยู่ที่ปลายทางแน่นอนถ้าคุณมุ่งมั่นที่จะแก้ปัญหา ความสุขในชีวิตของชาวกรกฏในปีนี้จะต้องสร้างขึ้นจากตัวเองเป็นหลักแล้ว ทุกอย่างจะดำเนินไปด้วยดี','7'),(80,'ราศีสิงห์','8','','','','','','','','','ชาวราศีสิงห์ จะพบความมั่งคั่งในปี 2553 เพราะด้วยพลังความสร้างสรรค์และพลังกายอันเต็มเปี่ยม ทำให้มีงานเข้ามาให้ทำไม่ขาดสาย ยิ่งขยันมากก็ยิ่งได้เงินเยอะ ถือเป็นปีที่จะได้เงินเป็นกอบเป็นกำ ได้ใช้จ่ายคล่องมือ ได้ของที่อยากได้มานาน มีดวงดีในการเสี่ยงโชค จะได้ลาภผลที่คาดไม่ถึง แต่ก็อย่าประมาทกับชีวิตเกินไป เพราะอาจจะมีเรื่องท้าทายเข้ามาทดสอบคุณเช่นกัน ในด้านความรัก ชาวสิงห์มีพลังงานแห่งความสุขสูงมากในปีนี้ คนที่มีคู่จะรักกันหวานชื่น คนโสดจะสมหวัง ไม่ว่าคุณจะอกหักหรือเหงาหงอยมานานก็จะได้ชื่นใจแน่นอน ครึ่งหลังของปีมีโอกาสลุ้นสูง','7'),(81,'ราศีกันย์','9','','','','','','','','','ปี 2553 ชาวราศีกันต์ต้องก้าวให้ช้าแต่เป็นความช้าที่นำมาซึ่งความมั่นคงในชีวิต ในเรื่องของรายได้ เงินจะไหลมาอย่างช้าๆ แต่สม่ำเสมอ ถ้าอดทนเก็บหอมรอมริบและบริหารเงินอย่างลงตัว คุณจะรวยแบบที่คุณคาดไม่ถึงเลยทีเดียว ในเรื่องของความรักก็เช่นกัน คุณต้องดำเนินชีวิตคู่ให้ช้าลง แต่ก้าวไปข้างหน้าอย่างมั่นคงและมีสติ เร่งสร้างรากฐานครอบครัวให้แข็งแรงเพื่อชีวิตคู่ที่คุณฝันไว้ในอนาคต สำหรับคนโสดคุณจะพบรักอย่างคาดไม่ถึงจากการเดินทาง','7'),(82,'ราศีตุลย์','10','','','','','','','','','ปี 2553 เป็นปีที่เหมาะกับการแก้ไขสิ่งผิดพลาดในปีที่ผ่านมาของชาวราศีตุลย์ เพราะมีโอกาสทางการงานการเงินให้คุณได้เริ่มต้นมากมาย ลองเลือกเป้าหมายมาสักหนึ่งสิ่งและลงมือทำอย่างค่อยเป็นค่อยไป รับรองว่าคุณจะได้ลาภผลและความมั่นคงในชีวิตแน่นอน แต่บนเส้นทางแห่งความสำเร็จคุณอาจสะดุดได้ด้วยอุปสรรคทั้งเรื่องคนและเรื่องงาน แต่ปัญหาทุกอย่างจะคลี่คลายลงได้เพียงแต่คุณต้องค่อยๆ คิดแก้ไขปัญหา อย่ารีบร้อน ส่วนเรื่องความรักจะมีเรื่องการเงินเข้ามาเกี่ยวข้องด้วย ในที่นี้หมายถึงคุณต้องการใช้เงินเพื่อจริงจังกับคนรักหรือสร้างรากฐานครอบครัวให้แข็งแรง','7'),(83,'ราศีพิจิก','11','','','','','','','','','ชาว ราศีพิจิกที่คิดว่าปีที่แล้วเป็นที่ไม่ดี ปี 2553 ที่กำลังจะมาถึงจะเป็นปีที่ดีของคุณ เต็มไปความสุขสมหวัง ลาภ ยศ สรรเสริญ เด่นมากในเรื่องของความรัก สำหรับใครที่โสด คุณจะได้พบรักแท้ เจอคู่ที่ถูกใจเป็นที่สุด คนที่มีคู่แล้วความรักของคุณจะลงตัวขึ้น มีความพร้อมที่จะสร้างรากฐานครอบครัวให้มั่นคง ในด้านชีวิตการงาน จะก้าวหน้าเป็นอย่างดี โดยเฉพาะการทำงานเป็นทีมจะสำเร็จลุล่วงเป็นพิเศษ และถ้าชาวพิจิกที่คิดริเริ่มงานใหม่ๆ ก็ต้องเริ่มต้นอย่างรอบคอบ เตรียมพร้อมรับความท้าทายที่จะผ่านเข้ามา แต่ปลายทางจะเป็นปลายทางแห่งความสุขแน่นอน','7'),(84,'ราศีธนู','12','','','','','','','','','ปี 2553 เป็นปีที่ชาวราศีธนูต้องใช้ชีวิตอย่างพอเพียงและไม่ประมาท ในด้านของการงานคุณอาจจะได้ทำงานที่ดี มีรายได้เข้ามามาก แต่ก็มีเรื่องให้ต้องเสียเงินโดยใช่เหตุเช่นกัน จึงอาจมีบางช่วงที่ทำให้เงินขาดมือ แต่ก็ไม่ต้องกังวลให้มากเพราะจะมีคนเข้ามาอุปถัมภ์ให้รอดพ้นวิกฤติได้เสมอ แต่ทางที่ดีควรจะประหยัดการใช้จ่ายจะดีที่สุด ความช่วยเหลือจากคนอื่นจะได้เป็นทางเลือกสุดท้าย ในด้านความรักก็เช่นกันชาวธนูยังคงรักอย่างออมใจ แอบรัก แอบชอบ แต่นั่นก็เป็นสิ่งที่ดีเพราะคนดีๆ ก็ต้องดูกันนานๆ ด้านสุขภาพห้ามประมาทเด็ดขาด หมั่นตรวจสุขภาพ เพราะถ้าปล่อยปละละเลยจะทำให้ล้มหมอนอนเสื่อได้ง่าย','7'),(85,'ราศีมังกร','1','','','','','','','','','ปี 2553 ที่กำลังจะมาถึงเป็นปีแห่งการต่อสู้ของชาวราศีมังกร เพราะต้องพบการงานที่หนักหน่วง ทำงานจนไม่มีเวลาพักผ่อน อาจเป็นสาเหตุให้ต้องล้มป่วยได้ง่าย ฉะนั้นต้องต่อสู้กับตัวเองอย่างหนักในการดูแลสุขภาพและออกกำลังกายเป็นพิเศษ เรื่องของหัวใจก็ต้องต่อสู้กับรักซ้อนที่จะเข้ามาพิสูจน์หัวใจของคุณว่ามั่น คงในความรักแค่ไหน แต่ถ้าสามารถผ่านพ้นวิกฤติครั้งนี้ไปได้ ความรักของคุณจะดำเนินไปด้วยดีจนถึงขีดสุด เรื่องของวัตถุนอกกายก็เป็นสิ่งที่เย้ายวนใจชาวมังกรเป็นอย่างมาก ต้องสู้กับใจของคุณเอง กำจัดความอยากในสิ่งที่ไม่จำเป็น มิเช่นนั้นจะชักหน้าไม่ถึงหลัง','8'),(86,'ราศีกุมภ์','2','','','','','','','','','ปี 2553 จะเป็นปีแห่งความสำเร็จทางด้านการงานของชาวราศีกุมภ์ จะได้ทำงานใหม่ๆ ที่ท้าทายความสามารถ หรือเริ่มต้นโครงการที่จะเกิดความสำเร็จสมบูรณ์ ใครที่ตกงานอยู่จะได้รับข่าวดี มีโชคในการสมัครงาน คนที่อยู่ในวัยเรียนจะสมหวังในสิ่งที่ปรารถนา ความรักของคนโสดจะเข้ามาอย่างหวือหวา ต้องศึกษากันให้ถ้วนถี่ มิเช่นนั้นอาจจะพบกับรักลวง สำหรับคนมีคู่ต้องใช้ความไว้ใจเป็นที่ตั้งแล้วจะผ่านอุปสรรคไปได้ด้วยดี สุขภาพระวังการกำเริบของโรคประจำตัว หรือโรคที่เป็นอยู่บ่อยๆ','8'),(87,'ราศีมีน','3','','','\r\n','\r\n','','\r\n','\r\n','','ปี 2553 เป็นปีแห่งความสุขของชาวราศีมีน จะมีสิ่งใหม่ๆ สิ่งดีๆ เกิดขึ้นมากมาย เริ่มจากการงานที่จะได้ริเริ่มทำงานแปลกใหม่ มีความคิดที่จะทำธุรกิจ ได้หุ้นส่วนที่ดีมีคุณธรรม ได้เพื่อนร่วมงานที่มาช่วยแบ่งเบาและร่วมผลักดันผลงานให้เข้าตาผู้บังคับ บัญชา และผลจากการกรำงานหนักจากปีที่แล้วส่งผลให้ค่าตอบแทนสูงตามไปด้วย คุณจะมีเงินไว้จับจ่ายของชิ้นใหญ่ที่อยากได้มานาน ด้านความรักหวานชื่นกว่าที่เคย นอกจากจะได้เดินทางร่วมกันอย่างสนุกสนานแล้ว คนรักยังจะนำโชคลาภมาสู่คุณอีกด้วย','8'),(88,'ราศีเมษ','4','','','','','','','','','ในปี 2553 ชาวราศีเมษจะมีอารมณ์ร้อนกว่าปีที่ผ่านมา ฉะนั้นไม่ว่าจะตัดสินใจเรื่องใด ต้องใช้สติเป็นอย่างมาก เรื่องการงานต้องระวังให้ดีถ้าจะมีการเซ็นสัญญาหรือการร่วมทุนระวังจะถูกต้ม ตุ๋น การทำงานกับคนหมู่มากก็ต้องระวังความคิดคำพูดให้จงหนักแล้วทุกอย่างจะดำเนิน ไปได้ด้วยดี เรื่องคาวมรักสำหรับคนมีคู่ต้องใช้หลักน้ำพึ่งเรือ เสือพึ่งป่า ครองรักกันด้วยเมตตาจิต สำหรับคนโสด เมื่อตกหลุมรักใครอย่าปักใจเชื่อแต่แรก รอให้เวลาเป็นเครื่องพิสูจน์ เพราะอาจมีรักลวงเข้ามาทำให้ปวดใจได้ง่ายในปีนี้ สุขภาพโดยรวมดีแต่ต้องระวังโรคที่เกิดจากความเครียด','8'),(89,'ราศีพฤษภ','5','','','','','','','','','ปี 2553 เป็นปีอันรุ่งโรจน์ทางด้านการงานของชาวราศีพฤษภ มีความคิดสร้างสรรค์มากล้น นำมาซึ่งความก้าวหน้าทางด้านการงาน จะได้ริเริ่มโครงการใหม่ๆ ได้เป็นหัวหน้า ได้เป็นผู้นำทีม และด้วยการที่ต้องเป็นผู้นำคนอื่นอาจมีเรื่องให้เครียดจากผู้ใต้บังคับบัญชา บ้าง ฉะนั้นต้องปกครองคนด้วยคุณธรรม เอาใจเขามาใส่ใจเรา ในด้านความรักอาจจะมีเวลาให้กันน้อยไปสักนิด เพราะเป็นปีที่กำลังมุ่งมั่นกับการงาน เมื่อใดที่มีเวลาว่างควรหากิจกรรมที่ทำร่วมกันในครอบครัว จะทำให้บรรยากาศดีขึ้นได้ ทางด้านสุขภาพแข็งแรงดี แถมจะอ้วนท้วนขึ้นด้วยเพราะทุ่มเทเวลาให้กับการงานมากไป ควรเจียดเวลาให้กับการออกกำลังกายด้วย','8'),(90,'ราศีมิถุน','6','','','','','','','','','ปี 2553 เป็นปีแห่งความสุขของชาวราศีเมถุน เต็มไปด้วยเงินทอง ยศถาบรรดาศักดิ์ นำมาซึ่งความสมบูรณ์ทั้งร่างกายและจิตใจ ได้กินของดีของอร่อย ท่องเที่ยวอย่างสำราญ ในด้านของหัวใจจะชุ่มชื่นกว่าที่เคย คนที่มีคู่จะสุขใจยิ่งขึ้น มีเกณฑ์มีบุตร คนโสดจะตกหลุมรักอย่างง่ายดาย และมีโอกาสพบการพัดหวนของรักเก่า อย่างไรต้องพิจารณาให้ถ้วนถี่ แต่แม้ชีวิตส่วนตัวที่ดำเนินไปด้วยดี แต่อาจมีเรื่องของครอบครัวและบริวารมาให้ร้อนใจบ้างเป็นครั้งคราว แต่ก็ไม่หนักหนา คำแนะนำสำหรับราศีนี้คือหมั่นทำบุญทำทาน เข้าวัดฟังธรรมบ้าง เพราะชีวิตที่มีความสุขเกินไปอาจจะทำให้เกิดความประมาทได้','8'),(91,'ราศีกรกฎ','7','','','','','','','','','ปี 2553 ชาวกรกฏต้องมีสติอย่างมาก เพราะจะมีอุปสรรคผ่านเข้ามาให้ฝ่าฟัน เริ่มจากเรื่องสุขภาพที่จะต้องดูแลอย่างเคร่งครัด ห้ามละเลย อย่างน้อยต้องหาเวลาไปตรวจสุขภาพบ้าง เรื่องของการงานและความรักจะมีการเปลี่ยนแปลงที่ทำให้ต้องอึดอัดใจ แต่ทั้งหมดนี้จะผ่านเข้ามาและผ่านไปในที่สุด ชีวิตที่สวยงามรอคุณอยู่ที่ปลายทางแน่นอนถ้าคุณมุ่งมั่นที่จะแก้ปัญหา ความสุขในชีวิตของชาวกรกฏในปีนี้จะต้องสร้างขึ้นจากตัวเองเป็นหลักแล้ว ทุกอย่างจะดำเนินไปด้วยดี','8'),(92,'ราศีสิงห์','8','','','','','','','','','ชาวราศีสิงห์ จะพบความมั่งคั่งในปี 2553 เพราะด้วยพลังความสร้างสรรค์และพลังกายอันเต็มเปี่ยม ทำให้มีงานเข้ามาให้ทำไม่ขาดสาย ยิ่งขยันมากก็ยิ่งได้เงินเยอะ ถือเป็นปีที่จะได้เงินเป็นกอบเป็นกำ ได้ใช้จ่ายคล่องมือ ได้ของที่อยากได้มานาน มีดวงดีในการเสี่ยงโชค จะได้ลาภผลที่คาดไม่ถึง แต่ก็อย่าประมาทกับชีวิตเกินไป เพราะอาจจะมีเรื่องท้าทายเข้ามาทดสอบคุณเช่นกัน ในด้านความรัก ชาวสิงห์มีพลังงานแห่งความสุขสูงมากในปีนี้ คนที่มีคู่จะรักกันหวานชื่น คนโสดจะสมหวัง ไม่ว่าคุณจะอกหักหรือเหงาหงอยมานานก็จะได้ชื่นใจแน่นอน ครึ่งหลังของปีมีโอกาสลุ้นสูง','8'),(93,'ราศีกันย์','9','','','','','','','','','ปี 2553 ชาวราศีกันต์ต้องก้าวให้ช้าแต่เป็นความช้าที่นำมาซึ่งความมั่นคงในชีวิต ในเรื่องของรายได้ เงินจะไหลมาอย่างช้าๆ แต่สม่ำเสมอ ถ้าอดทนเก็บหอมรอมริบและบริหารเงินอย่างลงตัว คุณจะรวยแบบที่คุณคาดไม่ถึงเลยทีเดียว ในเรื่องของความรักก็เช่นกัน คุณต้องดำเนินชีวิตคู่ให้ช้าลง แต่ก้าวไปข้างหน้าอย่างมั่นคงและมีสติ เร่งสร้างรากฐานครอบครัวให้แข็งแรงเพื่อชีวิตคู่ที่คุณฝันไว้ในอนาคต สำหรับคนโสดคุณจะพบรักอย่างคาดไม่ถึงจากการเดินทาง','8'),(94,'ราศีตุลย์','10','','','','','','','','','ปี 2553 เป็นปีที่เหมาะกับการแก้ไขสิ่งผิดพลาดในปีที่ผ่านมาของชาวราศีตุลย์ เพราะมีโอกาสทางการงานการเงินให้คุณได้เริ่มต้นมากมาย ลองเลือกเป้าหมายมาสักหนึ่งสิ่งและลงมือทำอย่างค่อยเป็นค่อยไป รับรองว่าคุณจะได้ลาภผลและความมั่นคงในชีวิตแน่นอน แต่บนเส้นทางแห่งความสำเร็จคุณอาจสะดุดได้ด้วยอุปสรรคทั้งเรื่องคนและเรื่องงาน แต่ปัญหาทุกอย่างจะคลี่คลายลงได้เพียงแต่คุณต้องค่อยๆ คิดแก้ไขปัญหา อย่ารีบร้อน ส่วนเรื่องความรักจะมีเรื่องการเงินเข้ามาเกี่ยวข้องด้วย ในที่นี้หมายถึงคุณต้องการใช้เงินเพื่อจริงจังกับคนรักหรือสร้างรากฐานครอบครัวให้แข็งแรง','8'),(95,'ราศีพิจิก','11','','','','','','','','','ชาว ราศีพิจิกที่คิดว่าปีที่แล้วเป็นที่ไม่ดี ปี 2553 ที่กำลังจะมาถึงจะเป็นปีที่ดีของคุณ เต็มไปความสุขสมหวัง ลาภ ยศ สรรเสริญ เด่นมากในเรื่องของความรัก สำหรับใครที่โสด คุณจะได้พบรักแท้ เจอคู่ที่ถูกใจเป็นที่สุด คนที่มีคู่แล้วความรักของคุณจะลงตัวขึ้น มีความพร้อมที่จะสร้างรากฐานครอบครัวให้มั่นคง ในด้านชีวิตการงาน จะก้าวหน้าเป็นอย่างดี โดยเฉพาะการทำงานเป็นทีมจะสำเร็จลุล่วงเป็นพิเศษ และถ้าชาวพิจิกที่คิดริเริ่มงานใหม่ๆ ก็ต้องเริ่มต้นอย่างรอบคอบ เตรียมพร้อมรับความท้าทายที่จะผ่านเข้ามา แต่ปลายทางจะเป็นปลายทางแห่งความสุขแน่นอน','8'),(96,'ราศีธนู','12','','','','','','','','','ปี 2553 เป็นปีที่ชาวราศีธนูต้องใช้ชีวิตอย่างพอเพียงและไม่ประมาท ในด้านของการงานคุณอาจจะได้ทำงานที่ดี มีรายได้เข้ามามาก แต่ก็มีเรื่องให้ต้องเสียเงินโดยใช่เหตุเช่นกัน จึงอาจมีบางช่วงที่ทำให้เงินขาดมือ แต่ก็ไม่ต้องกังวลให้มากเพราะจะมีคนเข้ามาอุปถัมภ์ให้รอดพ้นวิกฤติได้เสมอ แต่ทางที่ดีควรจะประหยัดการใช้จ่ายจะดีที่สุด ความช่วยเหลือจากคนอื่นจะได้เป็นทางเลือกสุดท้าย ในด้านความรักก็เช่นกันชาวธนูยังคงรักอย่างออมใจ แอบรัก แอบชอบ แต่นั่นก็เป็นสิ่งที่ดีเพราะคนดีๆ ก็ต้องดูกันนานๆ ด้านสุขภาพห้ามประมาทเด็ดขาด หมั่นตรวจสุขภาพ เพราะถ้าปล่อยปละละเลยจะทำให้ล้มหมอนอนเสื่อได้ง่าย','8'),(97,'ราศีมังกร','1','','','','','','','','','ปี 2553 ที่กำลังจะมาถึงเป็นปีแห่งการต่อสู้ของชาวราศีมังกร เพราะต้องพบการงานที่หนักหน่วง ทำงานจนไม่มีเวลาพักผ่อน อาจเป็นสาเหตุให้ต้องล้มป่วยได้ง่าย ฉะนั้นต้องต่อสู้กับตัวเองอย่างหนักในการดูแลสุขภาพและออกกำลังกายเป็นพิเศษ เรื่องของหัวใจก็ต้องต่อสู้กับรักซ้อนที่จะเข้ามาพิสูจน์หัวใจของคุณว่ามั่น คงในความรักแค่ไหน แต่ถ้าสามารถผ่านพ้นวิกฤติครั้งนี้ไปได้ ความรักของคุณจะดำเนินไปด้วยดีจนถึงขีดสุด เรื่องของวัตถุนอกกายก็เป็นสิ่งที่เย้ายวนใจชาวมังกรเป็นอย่างมาก ต้องสู้กับใจของคุณเอง กำจัดความอยากในสิ่งที่ไม่จำเป็น มิเช่นนั้นจะชักหน้าไม่ถึงหลัง','9'),(98,'ราศีกุมภ์','2','','','','','','','','','ปี 2553 จะเป็นปีแห่งความสำเร็จทางด้านการงานของชาวราศีกุมภ์ จะได้ทำงานใหม่ๆ ที่ท้าทายความสามารถ หรือเริ่มต้นโครงการที่จะเกิดความสำเร็จสมบูรณ์ ใครที่ตกงานอยู่จะได้รับข่าวดี มีโชคในการสมัครงาน คนที่อยู่ในวัยเรียนจะสมหวังในสิ่งที่ปรารถนา ความรักของคนโสดจะเข้ามาอย่างหวือหวา ต้องศึกษากันให้ถ้วนถี่ มิเช่นนั้นอาจจะพบกับรักลวง สำหรับคนมีคู่ต้องใช้ความไว้ใจเป็นที่ตั้งแล้วจะผ่านอุปสรรคไปได้ด้วยดี สุขภาพระวังการกำเริบของโรคประจำตัว หรือโรคที่เป็นอยู่บ่อยๆ','9'),(99,'ราศีมีน','3','','','\r\n','\r\n','','\r\n','\r\n','','ปี 2553 เป็นปีแห่งความสุขของชาวราศีมีน จะมีสิ่งใหม่ๆ สิ่งดีๆ เกิดขึ้นมากมาย เริ่มจากการงานที่จะได้ริเริ่มทำงานแปลกใหม่ มีความคิดที่จะทำธุรกิจ ได้หุ้นส่วนที่ดีมีคุณธรรม ได้เพื่อนร่วมงานที่มาช่วยแบ่งเบาและร่วมผลักดันผลงานให้เข้าตาผู้บังคับ บัญชา และผลจากการกรำงานหนักจากปีที่แล้วส่งผลให้ค่าตอบแทนสูงตามไปด้วย คุณจะมีเงินไว้จับจ่ายของชิ้นใหญ่ที่อยากได้มานาน ด้านความรักหวานชื่นกว่าที่เคย นอกจากจะได้เดินทางร่วมกันอย่างสนุกสนานแล้ว คนรักยังจะนำโชคลาภมาสู่คุณอีกด้วย','9'),(100,'ราศีเมษ','4','','','','','','','','','ในปี 2553 ชาวราศีเมษจะมีอารมณ์ร้อนกว่าปีที่ผ่านมา ฉะนั้นไม่ว่าจะตัดสินใจเรื่องใด ต้องใช้สติเป็นอย่างมาก เรื่องการงานต้องระวังให้ดีถ้าจะมีการเซ็นสัญญาหรือการร่วมทุนระวังจะถูกต้ม ตุ๋น การทำงานกับคนหมู่มากก็ต้องระวังความคิดคำพูดให้จงหนักแล้วทุกอย่างจะดำเนิน ไปได้ด้วยดี เรื่องคาวมรักสำหรับคนมีคู่ต้องใช้หลักน้ำพึ่งเรือ เสือพึ่งป่า ครองรักกันด้วยเมตตาจิต สำหรับคนโสด เมื่อตกหลุมรักใครอย่าปักใจเชื่อแต่แรก รอให้เวลาเป็นเครื่องพิสูจน์ เพราะอาจมีรักลวงเข้ามาทำให้ปวดใจได้ง่ายในปีนี้ สุขภาพโดยรวมดีแต่ต้องระวังโรคที่เกิดจากความเครียด','9'),(101,'ราศีพฤษภ','5','','','','','','','','','ปี 2553 เป็นปีอันรุ่งโรจน์ทางด้านการงานของชาวราศีพฤษภ มีความคิดสร้างสรรค์มากล้น นำมาซึ่งความก้าวหน้าทางด้านการงาน จะได้ริเริ่มโครงการใหม่ๆ ได้เป็นหัวหน้า ได้เป็นผู้นำทีม และด้วยการที่ต้องเป็นผู้นำคนอื่นอาจมีเรื่องให้เครียดจากผู้ใต้บังคับบัญชา บ้าง ฉะนั้นต้องปกครองคนด้วยคุณธรรม เอาใจเขามาใส่ใจเรา ในด้านความรักอาจจะมีเวลาให้กันน้อยไปสักนิด เพราะเป็นปีที่กำลังมุ่งมั่นกับการงาน เมื่อใดที่มีเวลาว่างควรหากิจกรรมที่ทำร่วมกันในครอบครัว จะทำให้บรรยากาศดีขึ้นได้ ทางด้านสุขภาพแข็งแรงดี แถมจะอ้วนท้วนขึ้นด้วยเพราะทุ่มเทเวลาให้กับการงานมากไป ควรเจียดเวลาให้กับการออกกำลังกายด้วย','9'),(102,'ราศีมิถุน','6','','','','','','','','','ปี 2553 เป็นปีแห่งความสุขของชาวราศีเมถุน เต็มไปด้วยเงินทอง ยศถาบรรดาศักดิ์ นำมาซึ่งความสมบูรณ์ทั้งร่างกายและจิตใจ ได้กินของดีของอร่อย ท่องเที่ยวอย่างสำราญ ในด้านของหัวใจจะชุ่มชื่นกว่าที่เคย คนที่มีคู่จะสุขใจยิ่งขึ้น มีเกณฑ์มีบุตร คนโสดจะตกหลุมรักอย่างง่ายดาย และมีโอกาสพบการพัดหวนของรักเก่า อย่างไรต้องพิจารณาให้ถ้วนถี่ แต่แม้ชีวิตส่วนตัวที่ดำเนินไปด้วยดี แต่อาจมีเรื่องของครอบครัวและบริวารมาให้ร้อนใจบ้างเป็นครั้งคราว แต่ก็ไม่หนักหนา คำแนะนำสำหรับราศีนี้คือหมั่นทำบุญทำทาน เข้าวัดฟังธรรมบ้าง เพราะชีวิตที่มีความสุขเกินไปอาจจะทำให้เกิดความประมาทได้','9'),(103,'ราศีกรกฎ','7','','','','','','','','','ปี 2553 ชาวกรกฏต้องมีสติอย่างมาก เพราะจะมีอุปสรรคผ่านเข้ามาให้ฝ่าฟัน เริ่มจากเรื่องสุขภาพที่จะต้องดูแลอย่างเคร่งครัด ห้ามละเลย อย่างน้อยต้องหาเวลาไปตรวจสุขภาพบ้าง เรื่องของการงานและความรักจะมีการเปลี่ยนแปลงที่ทำให้ต้องอึดอัดใจ แต่ทั้งหมดนี้จะผ่านเข้ามาและผ่านไปในที่สุด ชีวิตที่สวยงามรอคุณอยู่ที่ปลายทางแน่นอนถ้าคุณมุ่งมั่นที่จะแก้ปัญหา ความสุขในชีวิตของชาวกรกฏในปีนี้จะต้องสร้างขึ้นจากตัวเองเป็นหลักแล้ว ทุกอย่างจะดำเนินไปด้วยดี','9'),(104,'ราศีสิงห์','8','','','','','','','','','ชาวราศีสิงห์ จะพบความมั่งคั่งในปี 2553 เพราะด้วยพลังความสร้างสรรค์และพลังกายอันเต็มเปี่ยม ทำให้มีงานเข้ามาให้ทำไม่ขาดสาย ยิ่งขยันมากก็ยิ่งได้เงินเยอะ ถือเป็นปีที่จะได้เงินเป็นกอบเป็นกำ ได้ใช้จ่ายคล่องมือ ได้ของที่อยากได้มานาน มีดวงดีในการเสี่ยงโชค จะได้ลาภผลที่คาดไม่ถึง แต่ก็อย่าประมาทกับชีวิตเกินไป เพราะอาจจะมีเรื่องท้าทายเข้ามาทดสอบคุณเช่นกัน ในด้านความรัก ชาวสิงห์มีพลังงานแห่งความสุขสูงมากในปีนี้ คนที่มีคู่จะรักกันหวานชื่น คนโสดจะสมหวัง ไม่ว่าคุณจะอกหักหรือเหงาหงอยมานานก็จะได้ชื่นใจแน่นอน ครึ่งหลังของปีมีโอกาสลุ้นสูง','9'),(105,'ราศีกันย์','9','','','','','','','','','ปี 2553 ชาวราศีกันต์ต้องก้าวให้ช้าแต่เป็นความช้าที่นำมาซึ่งความมั่นคงในชีวิต ในเรื่องของรายได้ เงินจะไหลมาอย่างช้าๆ แต่สม่ำเสมอ ถ้าอดทนเก็บหอมรอมริบและบริหารเงินอย่างลงตัว คุณจะรวยแบบที่คุณคาดไม่ถึงเลยทีเดียว ในเรื่องของความรักก็เช่นกัน คุณต้องดำเนินชีวิตคู่ให้ช้าลง แต่ก้าวไปข้างหน้าอย่างมั่นคงและมีสติ เร่งสร้างรากฐานครอบครัวให้แข็งแรงเพื่อชีวิตคู่ที่คุณฝันไว้ในอนาคต สำหรับคนโสดคุณจะพบรักอย่างคาดไม่ถึงจากการเดินทาง','9'),(106,'ราศีตุลย์','10','','','','','','','','','ปี 2553 เป็นปีที่เหมาะกับการแก้ไขสิ่งผิดพลาดในปีที่ผ่านมาของชาวราศีตุลย์ เพราะมีโอกาสทางการงานการเงินให้คุณได้เริ่มต้นมากมาย ลองเลือกเป้าหมายมาสักหนึ่งสิ่งและลงมือทำอย่างค่อยเป็นค่อยไป รับรองว่าคุณจะได้ลาภผลและความมั่นคงในชีวิตแน่นอน แต่บนเส้นทางแห่งความสำเร็จคุณอาจสะดุดได้ด้วยอุปสรรคทั้งเรื่องคนและเรื่องงาน แต่ปัญหาทุกอย่างจะคลี่คลายลงได้เพียงแต่คุณต้องค่อยๆ คิดแก้ไขปัญหา อย่ารีบร้อน ส่วนเรื่องความรักจะมีเรื่องการเงินเข้ามาเกี่ยวข้องด้วย ในที่นี้หมายถึงคุณต้องการใช้เงินเพื่อจริงจังกับคนรักหรือสร้างรากฐานครอบครัวให้แข็งแรง','9'),(107,'ราศีพิจิก','11','','','','','','','','','ชาว ราศีพิจิกที่คิดว่าปีที่แล้วเป็นที่ไม่ดี ปี 2553 ที่กำลังจะมาถึงจะเป็นปีที่ดีของคุณ เต็มไปความสุขสมหวัง ลาภ ยศ สรรเสริญ เด่นมากในเรื่องของความรัก สำหรับใครที่โสด คุณจะได้พบรักแท้ เจอคู่ที่ถูกใจเป็นที่สุด คนที่มีคู่แล้วความรักของคุณจะลงตัวขึ้น มีความพร้อมที่จะสร้างรากฐานครอบครัวให้มั่นคง ในด้านชีวิตการงาน จะก้าวหน้าเป็นอย่างดี โดยเฉพาะการทำงานเป็นทีมจะสำเร็จลุล่วงเป็นพิเศษ และถ้าชาวพิจิกที่คิดริเริ่มงานใหม่ๆ ก็ต้องเริ่มต้นอย่างรอบคอบ เตรียมพร้อมรับความท้าทายที่จะผ่านเข้ามา แต่ปลายทางจะเป็นปลายทางแห่งความสุขแน่นอน','9'),(108,'ราศีธนู','12','','','','','','','','','ปี 2553 เป็นปีที่ชาวราศีธนูต้องใช้ชีวิตอย่างพอเพียงและไม่ประมาท ในด้านของการงานคุณอาจจะได้ทำงานที่ดี มีรายได้เข้ามามาก แต่ก็มีเรื่องให้ต้องเสียเงินโดยใช่เหตุเช่นกัน จึงอาจมีบางช่วงที่ทำให้เงินขาดมือ แต่ก็ไม่ต้องกังวลให้มากเพราะจะมีคนเข้ามาอุปถัมภ์ให้รอดพ้นวิกฤติได้เสมอ แต่ทางที่ดีควรจะประหยัดการใช้จ่ายจะดีที่สุด ความช่วยเหลือจากคนอื่นจะได้เป็นทางเลือกสุดท้าย ในด้านความรักก็เช่นกันชาวธนูยังคงรักอย่างออมใจ แอบรัก แอบชอบ แต่นั่นก็เป็นสิ่งที่ดีเพราะคนดีๆ ก็ต้องดูกันนานๆ ด้านสุขภาพห้ามประมาทเด็ดขาด หมั่นตรวจสุขภาพ เพราะถ้าปล่อยปละละเลยจะทำให้ล้มหมอนอนเสื่อได้ง่าย','9'),(109,'ราศีมังกร','1','','','','','','','','','ปี 2553 ที่กำลังจะมาถึงเป็นปีแห่งการต่อสู้ของชาวราศีมังกร เพราะต้องพบการงานที่หนักหน่วง ทำงานจนไม่มีเวลาพักผ่อน อาจเป็นสาเหตุให้ต้องล้มป่วยได้ง่าย ฉะนั้นต้องต่อสู้กับตัวเองอย่างหนักในการดูแลสุขภาพและออกกำลังกายเป็นพิเศษ เรื่องของหัวใจก็ต้องต่อสู้กับรักซ้อนที่จะเข้ามาพิสูจน์หัวใจของคุณว่ามั่น คงในความรักแค่ไหน แต่ถ้าสามารถผ่านพ้นวิกฤติครั้งนี้ไปได้ ความรักของคุณจะดำเนินไปด้วยดีจนถึงขีดสุด เรื่องของวัตถุนอกกายก็เป็นสิ่งที่เย้ายวนใจชาวมังกรเป็นอย่างมาก ต้องสู้กับใจของคุณเอง กำจัดความอยากในสิ่งที่ไม่จำเป็น มิเช่นนั้นจะชักหน้าไม่ถึงหลัง','10'),(110,'ราศีกุมภ์','2','','','','','','','','','ปี 2553 จะเป็นปีแห่งความสำเร็จทางด้านการงานของชาวราศีกุมภ์ จะได้ทำงานใหม่ๆ ที่ท้าทายความสามารถ หรือเริ่มต้นโครงการที่จะเกิดความสำเร็จสมบูรณ์ ใครที่ตกงานอยู่จะได้รับข่าวดี มีโชคในการสมัครงาน คนที่อยู่ในวัยเรียนจะสมหวังในสิ่งที่ปรารถนา ความรักของคนโสดจะเข้ามาอย่างหวือหวา ต้องศึกษากันให้ถ้วนถี่ มิเช่นนั้นอาจจะพบกับรักลวง สำหรับคนมีคู่ต้องใช้ความไว้ใจเป็นที่ตั้งแล้วจะผ่านอุปสรรคไปได้ด้วยดี สุขภาพระวังการกำเริบของโรคประจำตัว หรือโรคที่เป็นอยู่บ่อยๆ','10'),(111,'ราศีมีน','3','','','\r\n','\r\n','','\r\n','\r\n','','ปี 2553 เป็นปีแห่งความสุขของชาวราศีมีน จะมีสิ่งใหม่ๆ สิ่งดีๆ เกิดขึ้นมากมาย เริ่มจากการงานที่จะได้ริเริ่มทำงานแปลกใหม่ มีความคิดที่จะทำธุรกิจ ได้หุ้นส่วนที่ดีมีคุณธรรม ได้เพื่อนร่วมงานที่มาช่วยแบ่งเบาและร่วมผลักดันผลงานให้เข้าตาผู้บังคับ บัญชา และผลจากการกรำงานหนักจากปีที่แล้วส่งผลให้ค่าตอบแทนสูงตามไปด้วย คุณจะมีเงินไว้จับจ่ายของชิ้นใหญ่ที่อยากได้มานาน ด้านความรักหวานชื่นกว่าที่เคย นอกจากจะได้เดินทางร่วมกันอย่างสนุกสนานแล้ว คนรักยังจะนำโชคลาภมาสู่คุณอีกด้วย','10'),(112,'ราศีเมษ','4','','','','','','','','','ในปี 2553 ชาวราศีเมษจะมีอารมณ์ร้อนกว่าปีที่ผ่านมา ฉะนั้นไม่ว่าจะตัดสินใจเรื่องใด ต้องใช้สติเป็นอย่างมาก เรื่องการงานต้องระวังให้ดีถ้าจะมีการเซ็นสัญญาหรือการร่วมทุนระวังจะถูกต้ม ตุ๋น การทำงานกับคนหมู่มากก็ต้องระวังความคิดคำพูดให้จงหนักแล้วทุกอย่างจะดำเนิน ไปได้ด้วยดี เรื่องคาวมรักสำหรับคนมีคู่ต้องใช้หลักน้ำพึ่งเรือ เสือพึ่งป่า ครองรักกันด้วยเมตตาจิต สำหรับคนโสด เมื่อตกหลุมรักใครอย่าปักใจเชื่อแต่แรก รอให้เวลาเป็นเครื่องพิสูจน์ เพราะอาจมีรักลวงเข้ามาทำให้ปวดใจได้ง่ายในปีนี้ สุขภาพโดยรวมดีแต่ต้องระวังโรคที่เกิดจากความเครียด','10'),(113,'ราศีพฤษภ','5','','','','','','','','','ปี 2553 เป็นปีอันรุ่งโรจน์ทางด้านการงานของชาวราศีพฤษภ มีความคิดสร้างสรรค์มากล้น นำมาซึ่งความก้าวหน้าทางด้านการงาน จะได้ริเริ่มโครงการใหม่ๆ ได้เป็นหัวหน้า ได้เป็นผู้นำทีม และด้วยการที่ต้องเป็นผู้นำคนอื่นอาจมีเรื่องให้เครียดจากผู้ใต้บังคับบัญชา บ้าง ฉะนั้นต้องปกครองคนด้วยคุณธรรม เอาใจเขามาใส่ใจเรา ในด้านความรักอาจจะมีเวลาให้กันน้อยไปสักนิด เพราะเป็นปีที่กำลังมุ่งมั่นกับการงาน เมื่อใดที่มีเวลาว่างควรหากิจกรรมที่ทำร่วมกันในครอบครัว จะทำให้บรรยากาศดีขึ้นได้ ทางด้านสุขภาพแข็งแรงดี แถมจะอ้วนท้วนขึ้นด้วยเพราะทุ่มเทเวลาให้กับการงานมากไป ควรเจียดเวลาให้กับการออกกำลังกายด้วย','10'),(114,'ราศีมิถุน','6','','','','','','','','','ปี 2553 เป็นปีแห่งความสุขของชาวราศีเมถุน เต็มไปด้วยเงินทอง ยศถาบรรดาศักดิ์ นำมาซึ่งความสมบูรณ์ทั้งร่างกายและจิตใจ ได้กินของดีของอร่อย ท่องเที่ยวอย่างสำราญ ในด้านของหัวใจจะชุ่มชื่นกว่าที่เคย คนที่มีคู่จะสุขใจยิ่งขึ้น มีเกณฑ์มีบุตร คนโสดจะตกหลุมรักอย่างง่ายดาย และมีโอกาสพบการพัดหวนของรักเก่า อย่างไรต้องพิจารณาให้ถ้วนถี่ แต่แม้ชีวิตส่วนตัวที่ดำเนินไปด้วยดี แต่อาจมีเรื่องของครอบครัวและบริวารมาให้ร้อนใจบ้างเป็นครั้งคราว แต่ก็ไม่หนักหนา คำแนะนำสำหรับราศีนี้คือหมั่นทำบุญทำทาน เข้าวัดฟังธรรมบ้าง เพราะชีวิตที่มีความสุขเกินไปอาจจะทำให้เกิดความประมาทได้','10'),(115,'ราศีกรกฎ','7','','','','','','','','','ปี 2553 ชาวกรกฏต้องมีสติอย่างมาก เพราะจะมีอุปสรรคผ่านเข้ามาให้ฝ่าฟัน เริ่มจากเรื่องสุขภาพที่จะต้องดูแลอย่างเคร่งครัด ห้ามละเลย อย่างน้อยต้องหาเวลาไปตรวจสุขภาพบ้าง เรื่องของการงานและความรักจะมีการเปลี่ยนแปลงที่ทำให้ต้องอึดอัดใจ แต่ทั้งหมดนี้จะผ่านเข้ามาและผ่านไปในที่สุด ชีวิตที่สวยงามรอคุณอยู่ที่ปลายทางแน่นอนถ้าคุณมุ่งมั่นที่จะแก้ปัญหา ความสุขในชีวิตของชาวกรกฏในปีนี้จะต้องสร้างขึ้นจากตัวเองเป็นหลักแล้ว ทุกอย่างจะดำเนินไปด้วยดี','10'),(116,'ราศีสิงห์','8','','','','','','','','','ชาวราศีสิงห์ จะพบความมั่งคั่งในปี 2553 เพราะด้วยพลังความสร้างสรรค์และพลังกายอันเต็มเปี่ยม ทำให้มีงานเข้ามาให้ทำไม่ขาดสาย ยิ่งขยันมากก็ยิ่งได้เงินเยอะ ถือเป็นปีที่จะได้เงินเป็นกอบเป็นกำ ได้ใช้จ่ายคล่องมือ ได้ของที่อยากได้มานาน มีดวงดีในการเสี่ยงโชค จะได้ลาภผลที่คาดไม่ถึง แต่ก็อย่าประมาทกับชีวิตเกินไป เพราะอาจจะมีเรื่องท้าทายเข้ามาทดสอบคุณเช่นกัน ในด้านความรัก ชาวสิงห์มีพลังงานแห่งความสุขสูงมากในปีนี้ คนที่มีคู่จะรักกันหวานชื่น คนโสดจะสมหวัง ไม่ว่าคุณจะอกหักหรือเหงาหงอยมานานก็จะได้ชื่นใจแน่นอน ครึ่งหลังของปีมีโอกาสลุ้นสูง','10'),(117,'ราศีกันย์','9','','','','','','','','','ปี 2553 ชาวราศีกันต์ต้องก้าวให้ช้าแต่เป็นความช้าที่นำมาซึ่งความมั่นคงในชีวิต ในเรื่องของรายได้ เงินจะไหลมาอย่างช้าๆ แต่สม่ำเสมอ ถ้าอดทนเก็บหอมรอมริบและบริหารเงินอย่างลงตัว คุณจะรวยแบบที่คุณคาดไม่ถึงเลยทีเดียว ในเรื่องของความรักก็เช่นกัน คุณต้องดำเนินชีวิตคู่ให้ช้าลง แต่ก้าวไปข้างหน้าอย่างมั่นคงและมีสติ เร่งสร้างรากฐานครอบครัวให้แข็งแรงเพื่อชีวิตคู่ที่คุณฝันไว้ในอนาคต สำหรับคนโสดคุณจะพบรักอย่างคาดไม่ถึงจากการเดินทาง','10'),(118,'ราศีตุลย์','10','','','','','','','','','ปี 2553 เป็นปีที่เหมาะกับการแก้ไขสิ่งผิดพลาดในปีที่ผ่านมาของชาวราศีตุลย์ เพราะมีโอกาสทางการงานการเงินให้คุณได้เริ่มต้นมากมาย ลองเลือกเป้าหมายมาสักหนึ่งสิ่งและลงมือทำอย่างค่อยเป็นค่อยไป รับรองว่าคุณจะได้ลาภผลและความมั่นคงในชีวิตแน่นอน แต่บนเส้นทางแห่งความสำเร็จคุณอาจสะดุดได้ด้วยอุปสรรคทั้งเรื่องคนและเรื่องงาน แต่ปัญหาทุกอย่างจะคลี่คลายลงได้เพียงแต่คุณต้องค่อยๆ คิดแก้ไขปัญหา อย่ารีบร้อน ส่วนเรื่องความรักจะมีเรื่องการเงินเข้ามาเกี่ยวข้องด้วย ในที่นี้หมายถึงคุณต้องการใช้เงินเพื่อจริงจังกับคนรักหรือสร้างรากฐานครอบครัวให้แข็งแรง','10'),(119,'ราศีพิจิก','11','','','','','','','','','ชาว ราศีพิจิกที่คิดว่าปีที่แล้วเป็นที่ไม่ดี ปี 2553 ที่กำลังจะมาถึงจะเป็นปีที่ดีของคุณ เต็มไปความสุขสมหวัง ลาภ ยศ สรรเสริญ เด่นมากในเรื่องของความรัก สำหรับใครที่โสด คุณจะได้พบรักแท้ เจอคู่ที่ถูกใจเป็นที่สุด คนที่มีคู่แล้วความรักของคุณจะลงตัวขึ้น มีความพร้อมที่จะสร้างรากฐานครอบครัวให้มั่นคง ในด้านชีวิตการงาน จะก้าวหน้าเป็นอย่างดี โดยเฉพาะการทำงานเป็นทีมจะสำเร็จลุล่วงเป็นพิเศษ และถ้าชาวพิจิกที่คิดริเริ่มงานใหม่ๆ ก็ต้องเริ่มต้นอย่างรอบคอบ เตรียมพร้อมรับความท้าทายที่จะผ่านเข้ามา แต่ปลายทางจะเป็นปลายทางแห่งความสุขแน่นอน','10'),(120,'ราศีธนู','12','','','','','','','','','ปี 2553 เป็นปีที่ชาวราศีธนูต้องใช้ชีวิตอย่างพอเพียงและไม่ประมาท ในด้านของการงานคุณอาจจะได้ทำงานที่ดี มีรายได้เข้ามามาก แต่ก็มีเรื่องให้ต้องเสียเงินโดยใช่เหตุเช่นกัน จึงอาจมีบางช่วงที่ทำให้เงินขาดมือ แต่ก็ไม่ต้องกังวลให้มากเพราะจะมีคนเข้ามาอุปถัมภ์ให้รอดพ้นวิกฤติได้เสมอ แต่ทางที่ดีควรจะประหยัดการใช้จ่ายจะดีที่สุด ความช่วยเหลือจากคนอื่นจะได้เป็นทางเลือกสุดท้าย ในด้านความรักก็เช่นกันชาวธนูยังคงรักอย่างออมใจ แอบรัก แอบชอบ แต่นั่นก็เป็นสิ่งที่ดีเพราะคนดีๆ ก็ต้องดูกันนานๆ ด้านสุขภาพห้ามประมาทเด็ดขาด หมั่นตรวจสุขภาพ เพราะถ้าปล่อยปละละเลยจะทำให้ล้มหมอนอนเสื่อได้ง่าย','10'),(121,'ราศีมังกร','1','','','','','','','','','ปี 2553 ที่กำลังจะมาถึงเป็นปีแห่งการต่อสู้ของชาวราศีมังกร เพราะต้องพบการงานที่หนักหน่วง ทำงานจนไม่มีเวลาพักผ่อน อาจเป็นสาเหตุให้ต้องล้มป่วยได้ง่าย ฉะนั้นต้องต่อสู้กับตัวเองอย่างหนักในการดูแลสุขภาพและออกกำลังกายเป็นพิเศษ เรื่องของหัวใจก็ต้องต่อสู้กับรักซ้อนที่จะเข้ามาพิสูจน์หัวใจของคุณว่ามั่น คงในความรักแค่ไหน แต่ถ้าสามารถผ่านพ้นวิกฤติครั้งนี้ไปได้ ความรักของคุณจะดำเนินไปด้วยดีจนถึงขีดสุด เรื่องของวัตถุนอกกายก็เป็นสิ่งที่เย้ายวนใจชาวมังกรเป็นอย่างมาก ต้องสู้กับใจของคุณเอง กำจัดความอยากในสิ่งที่ไม่จำเป็น มิเช่นนั้นจะชักหน้าไม่ถึงหลัง','11'),(122,'ราศีกุมภ์','2','','','','','','','','','ปี 2553 จะเป็นปีแห่งความสำเร็จทางด้านการงานของชาวราศีกุมภ์ จะได้ทำงานใหม่ๆ ที่ท้าทายความสามารถ หรือเริ่มต้นโครงการที่จะเกิดความสำเร็จสมบูรณ์ ใครที่ตกงานอยู่จะได้รับข่าวดี มีโชคในการสมัครงาน คนที่อยู่ในวัยเรียนจะสมหวังในสิ่งที่ปรารถนา ความรักของคนโสดจะเข้ามาอย่างหวือหวา ต้องศึกษากันให้ถ้วนถี่ มิเช่นนั้นอาจจะพบกับรักลวง สำหรับคนมีคู่ต้องใช้ความไว้ใจเป็นที่ตั้งแล้วจะผ่านอุปสรรคไปได้ด้วยดี สุขภาพระวังการกำเริบของโรคประจำตัว หรือโรคที่เป็นอยู่บ่อยๆ','11'),(123,'ราศีมีน','3','','','\r\n','\r\n','','\r\n','\r\n','','ปี 2553 เป็นปีแห่งความสุขของชาวราศีมีน จะมีสิ่งใหม่ๆ สิ่งดีๆ เกิดขึ้นมากมาย เริ่มจากการงานที่จะได้ริเริ่มทำงานแปลกใหม่ มีความคิดที่จะทำธุรกิจ ได้หุ้นส่วนที่ดีมีคุณธรรม ได้เพื่อนร่วมงานที่มาช่วยแบ่งเบาและร่วมผลักดันผลงานให้เข้าตาผู้บังคับ บัญชา และผลจากการกรำงานหนักจากปีที่แล้วส่งผลให้ค่าตอบแทนสูงตามไปด้วย คุณจะมีเงินไว้จับจ่ายของชิ้นใหญ่ที่อยากได้มานาน ด้านความรักหวานชื่นกว่าที่เคย นอกจากจะได้เดินทางร่วมกันอย่างสนุกสนานแล้ว คนรักยังจะนำโชคลาภมาสู่คุณอีกด้วย','11'),(124,'ราศีเมษ','4','','','','','','','','','ในปี 2553 ชาวราศีเมษจะมีอารมณ์ร้อนกว่าปีที่ผ่านมา ฉะนั้นไม่ว่าจะตัดสินใจเรื่องใด ต้องใช้สติเป็นอย่างมาก เรื่องการงานต้องระวังให้ดีถ้าจะมีการเซ็นสัญญาหรือการร่วมทุนระวังจะถูกต้ม ตุ๋น การทำงานกับคนหมู่มากก็ต้องระวังความคิดคำพูดให้จงหนักแล้วทุกอย่างจะดำเนิน ไปได้ด้วยดี เรื่องคาวมรักสำหรับคนมีคู่ต้องใช้หลักน้ำพึ่งเรือ เสือพึ่งป่า ครองรักกันด้วยเมตตาจิต สำหรับคนโสด เมื่อตกหลุมรักใครอย่าปักใจเชื่อแต่แรก รอให้เวลาเป็นเครื่องพิสูจน์ เพราะอาจมีรักลวงเข้ามาทำให้ปวดใจได้ง่ายในปีนี้ สุขภาพโดยรวมดีแต่ต้องระวังโรคที่เกิดจากความเครียด','11'),(125,'ราศีพฤษภ','5','','','','','','','','','ปี 2553 เป็นปีอันรุ่งโรจน์ทางด้านการงานของชาวราศีพฤษภ มีความคิดสร้างสรรค์มากล้น นำมาซึ่งความก้าวหน้าทางด้านการงาน จะได้ริเริ่มโครงการใหม่ๆ ได้เป็นหัวหน้า ได้เป็นผู้นำทีม และด้วยการที่ต้องเป็นผู้นำคนอื่นอาจมีเรื่องให้เครียดจากผู้ใต้บังคับบัญชา บ้าง ฉะนั้นต้องปกครองคนด้วยคุณธรรม เอาใจเขามาใส่ใจเรา ในด้านความรักอาจจะมีเวลาให้กันน้อยไปสักนิด เพราะเป็นปีที่กำลังมุ่งมั่นกับการงาน เมื่อใดที่มีเวลาว่างควรหากิจกรรมที่ทำร่วมกันในครอบครัว จะทำให้บรรยากาศดีขึ้นได้ ทางด้านสุขภาพแข็งแรงดี แถมจะอ้วนท้วนขึ้นด้วยเพราะทุ่มเทเวลาให้กับการงานมากไป ควรเจียดเวลาให้กับการออกกำลังกายด้วย','11'),(126,'ราศีมิถุน','6','','','','','','','','','ปี 2553 เป็นปีแห่งความสุขของชาวราศีเมถุน เต็มไปด้วยเงินทอง ยศถาบรรดาศักดิ์ นำมาซึ่งความสมบูรณ์ทั้งร่างกายและจิตใจ ได้กินของดีของอร่อย ท่องเที่ยวอย่างสำราญ ในด้านของหัวใจจะชุ่มชื่นกว่าที่เคย คนที่มีคู่จะสุขใจยิ่งขึ้น มีเกณฑ์มีบุตร คนโสดจะตกหลุมรักอย่างง่ายดาย และมีโอกาสพบการพัดหวนของรักเก่า อย่างไรต้องพิจารณาให้ถ้วนถี่ แต่แม้ชีวิตส่วนตัวที่ดำเนินไปด้วยดี แต่อาจมีเรื่องของครอบครัวและบริวารมาให้ร้อนใจบ้างเป็นครั้งคราว แต่ก็ไม่หนักหนา คำแนะนำสำหรับราศีนี้คือหมั่นทำบุญทำทาน เข้าวัดฟังธรรมบ้าง เพราะชีวิตที่มีความสุขเกินไปอาจจะทำให้เกิดความประมาทได้','11'),(127,'ราศีกรกฎ','7','','','','','','','','','ปี 2553 ชาวกรกฏต้องมีสติอย่างมาก เพราะจะมีอุปสรรคผ่านเข้ามาให้ฝ่าฟัน เริ่มจากเรื่องสุขภาพที่จะต้องดูแลอย่างเคร่งครัด ห้ามละเลย อย่างน้อยต้องหาเวลาไปตรวจสุขภาพบ้าง เรื่องของการงานและความรักจะมีการเปลี่ยนแปลงที่ทำให้ต้องอึดอัดใจ แต่ทั้งหมดนี้จะผ่านเข้ามาและผ่านไปในที่สุด ชีวิตที่สวยงามรอคุณอยู่ที่ปลายทางแน่นอนถ้าคุณมุ่งมั่นที่จะแก้ปัญหา ความสุขในชีวิตของชาวกรกฏในปีนี้จะต้องสร้างขึ้นจากตัวเองเป็นหลักแล้ว ทุกอย่างจะดำเนินไปด้วยดี','11'),(128,'ราศีสิงห์','8','','','','','','','','','ชาวราศีสิงห์ จะพบความมั่งคั่งในปี 2553 เพราะด้วยพลังความสร้างสรรค์และพลังกายอันเต็มเปี่ยม ทำให้มีงานเข้ามาให้ทำไม่ขาดสาย ยิ่งขยันมากก็ยิ่งได้เงินเยอะ ถือเป็นปีที่จะได้เงินเป็นกอบเป็นกำ ได้ใช้จ่ายคล่องมือ ได้ของที่อยากได้มานาน มีดวงดีในการเสี่ยงโชค จะได้ลาภผลที่คาดไม่ถึง แต่ก็อย่าประมาทกับชีวิตเกินไป เพราะอาจจะมีเรื่องท้าทายเข้ามาทดสอบคุณเช่นกัน ในด้านความรัก ชาวสิงห์มีพลังงานแห่งความสุขสูงมากในปีนี้ คนที่มีคู่จะรักกันหวานชื่น คนโสดจะสมหวัง ไม่ว่าคุณจะอกหักหรือเหงาหงอยมานานก็จะได้ชื่นใจแน่นอน ครึ่งหลังของปีมีโอกาสลุ้นสูง','11'),(129,'ราศีกันย์','9','','','','','','','','','ปี 2553 ชาวราศีกันต์ต้องก้าวให้ช้าแต่เป็นความช้าที่นำมาซึ่งความมั่นคงในชีวิต ในเรื่องของรายได้ เงินจะไหลมาอย่างช้าๆ แต่สม่ำเสมอ ถ้าอดทนเก็บหอมรอมริบและบริหารเงินอย่างลงตัว คุณจะรวยแบบที่คุณคาดไม่ถึงเลยทีเดียว ในเรื่องของความรักก็เช่นกัน คุณต้องดำเนินชีวิตคู่ให้ช้าลง แต่ก้าวไปข้างหน้าอย่างมั่นคงและมีสติ เร่งสร้างรากฐานครอบครัวให้แข็งแรงเพื่อชีวิตคู่ที่คุณฝันไว้ในอนาคต สำหรับคนโสดคุณจะพบรักอย่างคาดไม่ถึงจากการเดินทาง','11'),(130,'ราศีตุลย์','10','','','','','','','','','ปี 2553 เป็นปีที่เหมาะกับการแก้ไขสิ่งผิดพลาดในปีที่ผ่านมาของชาวราศีตุลย์ เพราะมีโอกาสทางการงานการเงินให้คุณได้เริ่มต้นมากมาย ลองเลือกเป้าหมายมาสักหนึ่งสิ่งและลงมือทำอย่างค่อยเป็นค่อยไป รับรองว่าคุณจะได้ลาภผลและความมั่นคงในชีวิตแน่นอน แต่บนเส้นทางแห่งความสำเร็จคุณอาจสะดุดได้ด้วยอุปสรรคทั้งเรื่องคนและเรื่องงาน แต่ปัญหาทุกอย่างจะคลี่คลายลงได้เพียงแต่คุณต้องค่อยๆ คิดแก้ไขปัญหา อย่ารีบร้อน ส่วนเรื่องความรักจะมีเรื่องการเงินเข้ามาเกี่ยวข้องด้วย ในที่นี้หมายถึงคุณต้องการใช้เงินเพื่อจริงจังกับคนรักหรือสร้างรากฐานครอบครัวให้แข็งแรง','11'),(131,'ราศีพิจิก','11','','','','','','','','','ชาว ราศีพิจิกที่คิดว่าปีที่แล้วเป็นที่ไม่ดี ปี 2553 ที่กำลังจะมาถึงจะเป็นปีที่ดีของคุณ เต็มไปความสุขสมหวัง ลาภ ยศ สรรเสริญ เด่นมากในเรื่องของความรัก สำหรับใครที่โสด คุณจะได้พบรักแท้ เจอคู่ที่ถูกใจเป็นที่สุด คนที่มีคู่แล้วความรักของคุณจะลงตัวขึ้น มีความพร้อมที่จะสร้างรากฐานครอบครัวให้มั่นคง ในด้านชีวิตการงาน จะก้าวหน้าเป็นอย่างดี โดยเฉพาะการทำงานเป็นทีมจะสำเร็จลุล่วงเป็นพิเศษ และถ้าชาวพิจิกที่คิดริเริ่มงานใหม่ๆ ก็ต้องเริ่มต้นอย่างรอบคอบ เตรียมพร้อมรับความท้าทายที่จะผ่านเข้ามา แต่ปลายทางจะเป็นปลายทางแห่งความสุขแน่นอน','11'),(132,'ราศีธนู','12','','','','','','','','','ปี 2553 เป็นปีที่ชาวราศีธนูต้องใช้ชีวิตอย่างพอเพียงและไม่ประมาท ในด้านของการงานคุณอาจจะได้ทำงานที่ดี มีรายได้เข้ามามาก แต่ก็มีเรื่องให้ต้องเสียเงินโดยใช่เหตุเช่นกัน จึงอาจมีบางช่วงที่ทำให้เงินขาดมือ แต่ก็ไม่ต้องกังวลให้มากเพราะจะมีคนเข้ามาอุปถัมภ์ให้รอดพ้นวิกฤติได้เสมอ แต่ทางที่ดีควรจะประหยัดการใช้จ่ายจะดีที่สุด ความช่วยเหลือจากคนอื่นจะได้เป็นทางเลือกสุดท้าย ในด้านความรักก็เช่นกันชาวธนูยังคงรักอย่างออมใจ แอบรัก แอบชอบ แต่นั่นก็เป็นสิ่งที่ดีเพราะคนดีๆ ก็ต้องดูกันนานๆ ด้านสุขภาพห้ามประมาทเด็ดขาด หมั่นตรวจสุขภาพ เพราะถ้าปล่อยปละละเลยจะทำให้ล้มหมอนอนเสื่อได้ง่าย','11'),(133,'ราศีมังกร','1','','','','','','','','','ปี 2553 ที่กำลังจะมาถึงเป็นปีแห่งการต่อสู้ของชาวราศีมังกร เพราะต้องพบการงานที่หนักหน่วง ทำงานจนไม่มีเวลาพักผ่อน อาจเป็นสาเหตุให้ต้องล้มป่วยได้ง่าย ฉะนั้นต้องต่อสู้กับตัวเองอย่างหนักในการดูแลสุขภาพและออกกำลังกายเป็นพิเศษ เรื่องของหัวใจก็ต้องต่อสู้กับรักซ้อนที่จะเข้ามาพิสูจน์หัวใจของคุณว่ามั่น คงในความรักแค่ไหน แต่ถ้าสามารถผ่านพ้นวิกฤติครั้งนี้ไปได้ ความรักของคุณจะดำเนินไปด้วยดีจนถึงขีดสุด เรื่องของวัตถุนอกกายก็เป็นสิ่งที่เย้ายวนใจชาวมังกรเป็นอย่างมาก ต้องสู้กับใจของคุณเอง กำจัดความอยากในสิ่งที่ไม่จำเป็น มิเช่นนั้นจะชักหน้าไม่ถึงหลัง','12'),(134,'ราศีกุมภ์','2','','','','','','','','','ปี 2553 จะเป็นปีแห่งความสำเร็จทางด้านการงานของชาวราศีกุมภ์ จะได้ทำงานใหม่ๆ ที่ท้าทายความสามารถ หรือเริ่มต้นโครงการที่จะเกิดความสำเร็จสมบูรณ์ ใครที่ตกงานอยู่จะได้รับข่าวดี มีโชคในการสมัครงาน คนที่อยู่ในวัยเรียนจะสมหวังในสิ่งที่ปรารถนา ความรักของคนโสดจะเข้ามาอย่างหวือหวา ต้องศึกษากันให้ถ้วนถี่ มิเช่นนั้นอาจจะพบกับรักลวง สำหรับคนมีคู่ต้องใช้ความไว้ใจเป็นที่ตั้งแล้วจะผ่านอุปสรรคไปได้ด้วยดี สุขภาพระวังการกำเริบของโรคประจำตัว หรือโรคที่เป็นอยู่บ่อยๆ','12'),(135,'ราศีมีน','3','','','\r\n','\r\n','','\r\n','\r\n','','ปี 2553 เป็นปีแห่งความสุขของชาวราศีมีน จะมีสิ่งใหม่ๆ สิ่งดีๆ เกิดขึ้นมากมาย เริ่มจากการงานที่จะได้ริเริ่มทำงานแปลกใหม่ มีความคิดที่จะทำธุรกิจ ได้หุ้นส่วนที่ดีมีคุณธรรม ได้เพื่อนร่วมงานที่มาช่วยแบ่งเบาและร่วมผลักดันผลงานให้เข้าตาผู้บังคับ บัญชา และผลจากการกรำงานหนักจากปีที่แล้วส่งผลให้ค่าตอบแทนสูงตามไปด้วย คุณจะมีเงินไว้จับจ่ายของชิ้นใหญ่ที่อยากได้มานาน ด้านความรักหวานชื่นกว่าที่เคย นอกจากจะได้เดินทางร่วมกันอย่างสนุกสนานแล้ว คนรักยังจะนำโชคลาภมาสู่คุณอีกด้วย','12'),(136,'ราศีเมษ','4','','','','','','','','','ในปี 2553 ชาวราศีเมษจะมีอารมณ์ร้อนกว่าปีที่ผ่านมา ฉะนั้นไม่ว่าจะตัดสินใจเรื่องใด ต้องใช้สติเป็นอย่างมาก เรื่องการงานต้องระวังให้ดีถ้าจะมีการเซ็นสัญญาหรือการร่วมทุนระวังจะถูกต้ม ตุ๋น การทำงานกับคนหมู่มากก็ต้องระวังความคิดคำพูดให้จงหนักแล้วทุกอย่างจะดำเนิน ไปได้ด้วยดี เรื่องคาวมรักสำหรับคนมีคู่ต้องใช้หลักน้ำพึ่งเรือ เสือพึ่งป่า ครองรักกันด้วยเมตตาจิต สำหรับคนโสด เมื่อตกหลุมรักใครอย่าปักใจเชื่อแต่แรก รอให้เวลาเป็นเครื่องพิสูจน์ เพราะอาจมีรักลวงเข้ามาทำให้ปวดใจได้ง่ายในปีนี้ สุขภาพโดยรวมดีแต่ต้องระวังโรคที่เกิดจากความเครียด','12'),(137,'ราศีพฤษภ','5','','','','','','','','','ปี 2553 เป็นปีอันรุ่งโรจน์ทางด้านการงานของชาวราศีพฤษภ มีความคิดสร้างสรรค์มากล้น นำมาซึ่งความก้าวหน้าทางด้านการงาน จะได้ริเริ่มโครงการใหม่ๆ ได้เป็นหัวหน้า ได้เป็นผู้นำทีม และด้วยการที่ต้องเป็นผู้นำคนอื่นอาจมีเรื่องให้เครียดจากผู้ใต้บังคับบัญชา บ้าง ฉะนั้นต้องปกครองคนด้วยคุณธรรม เอาใจเขามาใส่ใจเรา ในด้านความรักอาจจะมีเวลาให้กันน้อยไปสักนิด เพราะเป็นปีที่กำลังมุ่งมั่นกับการงาน เมื่อใดที่มีเวลาว่างควรหากิจกรรมที่ทำร่วมกันในครอบครัว จะทำให้บรรยากาศดีขึ้นได้ ทางด้านสุขภาพแข็งแรงดี แถมจะอ้วนท้วนขึ้นด้วยเพราะทุ่มเทเวลาให้กับการงานมากไป ควรเจียดเวลาให้กับการออกกำลังกายด้วย','12'),(138,'ราศีมิถุน','6','','','','','','','','','ปี 2553 เป็นปีแห่งความสุขของชาวราศีเมถุน เต็มไปด้วยเงินทอง ยศถาบรรดาศักดิ์ นำมาซึ่งความสมบูรณ์ทั้งร่างกายและจิตใจ ได้กินของดีของอร่อย ท่องเที่ยวอย่างสำราญ ในด้านของหัวใจจะชุ่มชื่นกว่าที่เคย คนที่มีคู่จะสุขใจยิ่งขึ้น มีเกณฑ์มีบุตร คนโสดจะตกหลุมรักอย่างง่ายดาย และมีโอกาสพบการพัดหวนของรักเก่า อย่างไรต้องพิจารณาให้ถ้วนถี่ แต่แม้ชีวิตส่วนตัวที่ดำเนินไปด้วยดี แต่อาจมีเรื่องของครอบครัวและบริวารมาให้ร้อนใจบ้างเป็นครั้งคราว แต่ก็ไม่หนักหนา คำแนะนำสำหรับราศีนี้คือหมั่นทำบุญทำทาน เข้าวัดฟังธรรมบ้าง เพราะชีวิตที่มีความสุขเกินไปอาจจะทำให้เกิดความประมาทได้','12'),(139,'ราศีกรกฎ','7','','','','','','','','','ปี 2553 ชาวกรกฏต้องมีสติอย่างมาก เพราะจะมีอุปสรรคผ่านเข้ามาให้ฝ่าฟัน เริ่มจากเรื่องสุขภาพที่จะต้องดูแลอย่างเคร่งครัด ห้ามละเลย อย่างน้อยต้องหาเวลาไปตรวจสุขภาพบ้าง เรื่องของการงานและความรักจะมีการเปลี่ยนแปลงที่ทำให้ต้องอึดอัดใจ แต่ทั้งหมดนี้จะผ่านเข้ามาและผ่านไปในที่สุด ชีวิตที่สวยงามรอคุณอยู่ที่ปลายทางแน่นอนถ้าคุณมุ่งมั่นที่จะแก้ปัญหา ความสุขในชีวิตของชาวกรกฏในปีนี้จะต้องสร้างขึ้นจากตัวเองเป็นหลักแล้ว ทุกอย่างจะดำเนินไปด้วยดี','12'),(140,'ราศีสิงห์','8','','','','','','','','','ชาวราศีสิงห์ จะพบความมั่งคั่งในปี 2553 เพราะด้วยพลังความสร้างสรรค์และพลังกายอันเต็มเปี่ยม ทำให้มีงานเข้ามาให้ทำไม่ขาดสาย ยิ่งขยันมากก็ยิ่งได้เงินเยอะ ถือเป็นปีที่จะได้เงินเป็นกอบเป็นกำ ได้ใช้จ่ายคล่องมือ ได้ของที่อยากได้มานาน มีดวงดีในการเสี่ยงโชค จะได้ลาภผลที่คาดไม่ถึง แต่ก็อย่าประมาทกับชีวิตเกินไป เพราะอาจจะมีเรื่องท้าทายเข้ามาทดสอบคุณเช่นกัน ในด้านความรัก ชาวสิงห์มีพลังงานแห่งความสุขสูงมากในปีนี้ คนที่มีคู่จะรักกันหวานชื่น คนโสดจะสมหวัง ไม่ว่าคุณจะอกหักหรือเหงาหงอยมานานก็จะได้ชื่นใจแน่นอน ครึ่งหลังของปีมีโอกาสลุ้นสูง','12'),(141,'ราศีกันย์','9','','','','','','','','','ปี 2553 ชาวราศีกันต์ต้องก้าวให้ช้าแต่เป็นความช้าที่นำมาซึ่งความมั่นคงในชีวิต ในเรื่องของรายได้ เงินจะไหลมาอย่างช้าๆ แต่สม่ำเสมอ ถ้าอดทนเก็บหอมรอมริบและบริหารเงินอย่างลงตัว คุณจะรวยแบบที่คุณคาดไม่ถึงเลยทีเดียว ในเรื่องของความรักก็เช่นกัน คุณต้องดำเนินชีวิตคู่ให้ช้าลง แต่ก้าวไปข้างหน้าอย่างมั่นคงและมีสติ เร่งสร้างรากฐานครอบครัวให้แข็งแรงเพื่อชีวิตคู่ที่คุณฝันไว้ในอนาคต สำหรับคนโสดคุณจะพบรักอย่างคาดไม่ถึงจากการเดินทาง','12'),(142,'ราศีตุลย์','10','','','','','','','','','ปี 2553 เป็นปีที่เหมาะกับการแก้ไขสิ่งผิดพลาดในปีที่ผ่านมาของชาวราศีตุลย์ เพราะมีโอกาสทางการงานการเงินให้คุณได้เริ่มต้นมากมาย ลองเลือกเป้าหมายมาสักหนึ่งสิ่งและลงมือทำอย่างค่อยเป็นค่อยไป รับรองว่าคุณจะได้ลาภผลและความมั่นคงในชีวิตแน่นอน แต่บนเส้นทางแห่งความสำเร็จคุณอาจสะดุดได้ด้วยอุปสรรคทั้งเรื่องคนและเรื่องงาน แต่ปัญหาทุกอย่างจะคลี่คลายลงได้เพียงแต่คุณต้องค่อยๆ คิดแก้ไขปัญหา อย่ารีบร้อน ส่วนเรื่องความรักจะมีเรื่องการเงินเข้ามาเกี่ยวข้องด้วย ในที่นี้หมายถึงคุณต้องการใช้เงินเพื่อจริงจังกับคนรักหรือสร้างรากฐานครอบครัวให้แข็งแรง','12'),(143,'ราศีพิจิก','11','','','','','','','','','ชาว ราศีพิจิกที่คิดว่าปีที่แล้วเป็นที่ไม่ดี ปี 2553 ที่กำลังจะมาถึงจะเป็นปีที่ดีของคุณ เต็มไปความสุขสมหวัง ลาภ ยศ สรรเสริญ เด่นมากในเรื่องของความรัก สำหรับใครที่โสด คุณจะได้พบรักแท้ เจอคู่ที่ถูกใจเป็นที่สุด คนที่มีคู่แล้วความรักของคุณจะลงตัวขึ้น มีความพร้อมที่จะสร้างรากฐานครอบครัวให้มั่นคง ในด้านชีวิตการงาน จะก้าวหน้าเป็นอย่างดี โดยเฉพาะการทำงานเป็นทีมจะสำเร็จลุล่วงเป็นพิเศษ และถ้าชาวพิจิกที่คิดริเริ่มงานใหม่ๆ ก็ต้องเริ่มต้นอย่างรอบคอบ เตรียมพร้อมรับความท้าทายที่จะผ่านเข้ามา แต่ปลายทางจะเป็นปลายทางแห่งความสุขแน่นอน','12'),(144,'ราศีธนู','12','','','','','','','','','ปี 2553 เป็นปีที่ชาวราศีธนูต้องใช้ชีวิตอย่างพอเพียงและไม่ประมาท ในด้านของการงานคุณอาจจะได้ทำงานที่ดี มีรายได้เข้ามามาก แต่ก็มีเรื่องให้ต้องเสียเงินโดยใช่เหตุเช่นกัน จึงอาจมีบางช่วงที่ทำให้เงินขาดมือ แต่ก็ไม่ต้องกังวลให้มากเพราะจะมีคนเข้ามาอุปถัมภ์ให้รอดพ้นวิกฤติได้เสมอ แต่ทางที่ดีควรจะประหยัดการใช้จ่ายจะดีที่สุด ความช่วยเหลือจากคนอื่นจะได้เป็นทางเลือกสุดท้าย ในด้านความรักก็เช่นกันชาวธนูยังคงรักอย่างออมใจ แอบรัก แอบชอบ แต่นั่นก็เป็นสิ่งที่ดีเพราะคนดีๆ ก็ต้องดูกันนานๆ ด้านสุขภาพห้ามประมาทเด็ดขาด หมั่นตรวจสุขภาพ เพราะถ้าปล่อยปละละเลยจะทำให้ล้มหมอนอนเสื่อได้ง่าย','12');
