INSERT INTO `order1` (`order_id`, `order_title`, `order_detail`) VALUES (1,'','<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td rowspan=\"3\" width=\"1\">\r\n				&nbsp;</td>\r\n			<td>\r\n				<strong><img height=\"5\" src=\"http://webnity.com/images/_trans.gif\" width=\"1\" /><br />\r\n				ขั้นตอนการชำระเงิน</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<img height=\"8\" src=\"http://webnity.com/images/_trans.gif\" width=\"1\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n					<tbody>\r\n						<tr>\r\n							<td>\r\n								<h4>\r\n									คุณสามารถเลือกชำระค่าบริการได้ 3 วิธี</h4>\r\n								<div class=\"payment_title\">\r\n									1. โอนเงินผ่านธนาคาร หรือตู้ ATM</div>\r\n								<p align=\"center\">\r\n									<b>ชื่อบัญชี &quot;</b>บริษัท แกรนด์ เอ็กซ์เซล จำกัด <b>&quot; </b></p>\r\n								<table cellpadding=\"7\" cellspacing=\"0\" class=\"tablespeed\" width=\"100%\">\r\n									<tbody>\r\n										<tr class=\"tablespeed_bg\">\r\n											<td style=\"border-bottom: 0pt none;\">\r\n												ธนาคาร</td>\r\n											<td style=\"border-bottom: 0pt none;\">\r\n												เลขที่บัญชีธนาคาร</td>\r\n											<td style=\"border-bottom: 0pt none;\">\r\n												ประเภทบัญชี</td>\r\n											<td style=\"border-bottom: 0pt none;\">\r\n												สาขา</td>\r\n										</tr>\r\n										<tr align=\"center\">\r\n											<td>\r\n												ธนาคาร กรุงศรีอยุธยา</td>\r\n											<td>\r\n												xxx-x-xxxxx-x</td>\r\n											<td>\r\n												กระแสรายวัน</td>\r\n											<td>\r\n												สวนมะลิ</td>\r\n										</tr>\r\n										<tr align=\"center\">\r\n											<td>\r\n												ธนาคาร กรุงเทพ</td>\r\n											<td>\r\n												xxx-x-xxxxx-x</td>\r\n											<td>\r\n												ออมทรัพย์</td>\r\n											<td>\r\n												บางซื่อ</td>\r\n										</tr>\r\n										<tr align=\"center\">\r\n											<td>\r\n												ธนาคาร กรุงไทย</td>\r\n											<td>\r\n												xxx-x-xxxxx-x</td>\r\n											<td>\r\n												ออมทรัพย์</td>\r\n											<td>\r\n												เตาปูน</td>\r\n										</tr>\r\n										<tr align=\"center\">\r\n											<td>\r\n												ธนาคาร กสิกรไทย</td>\r\n											<td>\r\n												xxx-x-xxxxx-x</td>\r\n											<td>\r\n												ออมทรัพย์</td>\r\n											<td>\r\n												เตาปูน</td>\r\n										</tr>\r\n										<tr align=\"center\">\r\n											<td>\r\n												ธนาคาร ไทยพาณิชย์</td>\r\n											<td>\r\n												xxx-x-xxxxx-x</td>\r\n											<td>\r\n												ออมทรัพย์</td>\r\n											<td>\r\n												เตาปูน</td>\r\n										</tr>\r\n									</tbody>\r\n								</table>\r\n								<p align=\"center\">\r\n									<b>หมายเหตุ :</b> ค่าธรรมเนียมในการโอนเงินเป็นความรับผิดชอบของลูกค้า ทางบริษัทฯ จะไม่รับผิดชอบในส่วนนี้</p>\r\n								<h4>\r\n									หลังจากคุณทำการชำระเงินแล้ว สามารถยืนยันการชำระค่าบริการ ตามวิธีนี้</h4>\r\n								<ul class=\"listarrow\">\r\n									<li>\r\n										อีเมล์แจ้งมาที่ <a class=\"more\" href=\"mailto:payment@siaminterhost.com\" target=\"_blank\">xxx@siaminterhost.com</a></li>\r\n									<li>\r\n										แฟกซ์สลิปใบโอนเงินมาที่หมายเลข (66) 2-912-2565 (กรุณาระบุหมายเลข Order หรือชื่อโดเมนเนมมาในสลิปใบโอนเงินด้วย)</li>\r\n									<li>\r\n										ยืนยันการชำระเงินออนไลน์ผ่านแบบฟอร์มของเราที่นี่</li>\r\n									<li>\r\n										โทรแจ้งเจ้าหน้าที่การเงินที่หมายเลข (66) 2-912-2558-64</li>\r\n								</ul>\r\n								<div class=\"payment_title\">\r\n									2. ชำระเงินออนไลน์ผ่านบัตรเครดิต</div>\r\n								<p align=\"center\">\r\n									<img alt=\"\" height=\"23\" src=\"http://www.siaminterhost.com/themes/rvtheme/images/icon_mcard.gif\" width=\"37\" />&nbsp;&nbsp;<img alt=\"\" height=\"23\" src=\"http://www.siaminterhost.com/themes/rvtheme/images/icon_visa.gif\" width=\"37\" /></p>\r\n								<p align=\"center\">\r\n									ชำระค่าบริการผ่านบัตรเครดิต VISA, MASTERCARD ออนไลน์ได้ตลอด 24 ชั่วโมง<br />\r\n									<b class=\"fontlightblue\"> (กรณีชำระผ่านบัตรเครดิต นิติบุคคลไม่สามารถทำการหักภาษี ณ ที่จ่ายได้)</b></p>\r\n								<p class=\"payment_title\">\r\n									3. ชำระเงินผ่านเช็ค</p>\r\n								<p>\r\n									<b>สั่งจ่ายเช็คในนาม &quot;บริษัท เว็บ เอ็คซเพิร์ท จำกัด&quot; หรือ คุณสามารถส่งเช็คมาให้เราตามที่อยู่ด้านล่างนี้</b></p>\r\n								<p class=\"padleft35\">\r\n									บริษัท แกรนด์ เอ็กซ์เซล จำกัด เลขที่ 52/37-38 ถ.สะพานปทุม-346 ต.บางปรอก อ.เมือง จ.ปทุมธานี 12000 โทร.02-978-0469 แฟกส์:02-978-0469 มือถือ:087-548-9458,087-595-4327 Email:team2009support@gmail.com</p>\r\n								<p class=\"para textindent\">\r\n									เรามีบริการรับเช็คที่สำนักงานหรือที่บ้าน ของคุณ (เฉพาะลูกค้าที่อาศัยอยู่ในเขตกรุงเทพฯ) สำหรับลูกค้าที่สั่งซื้อบริการเข้ามาตั้งแต่ 5,000 บาทขึ้นไป หากต้องการให้เข้าไปรับเช็ค กรุณาโทรแจ้งเจ้าหน้าที่ ได้ที่หมายเลข (66) 2-222-2222- 22 เพื่อนัดหมายวันและเวลา</p>\r\n								<p class=\"para\">\r\n									<font color=\"#ff0000\"><b>**หมายเหตุ**</b></font></p>\r\n								<p class=\"para textindent\">\r\n									ในกรณีที่บริษัทฯ ของท่านมีหนังสือรับรองภาษีหัก ณ ที่จ่าย ทางบริษัทฯ ขอรบกวนท่านส่งเอกสารมาให้ทางเราก่อน เมื่อได้รับเอกสารแล้ว ทางบริษัทฯ จะดำเนินการส่งใบเสร็จรับเงิน/ใบกำกับภาษีให้ตามที่อยู่ของท่านทันที</p>\r\n								<p class=\"para textindent\">\r\n									อนึ่ง หากท่านทำรายการชำระค่าบริการเป็นที่เรียบร้อยแล้ว แต่ไม่ได้ทำการยืนยันการชำระค่าบริการทางบริษัทฯ ดังวิธีการข้างต้น ทางบริษัทฯ จะไม่สามารถปิดยอดค่าบริการ ต่ออายุ หรือส่งใบเสร็จรับเงินให้ท่านได้ เนื่องจากเราไม่สามารถตรวจสอบยอดได้ว่า เป็นรายการโอนเงินของลูกค้าท่านใด เพราะในแต่ละวันมีรายการโอนเงินผ่านบัญชีธนาคารต่าง ๆ ของทางบริษัทฯ เป็นจำนวนมากรายการ</p>\r\n							</td>\r\n						</tr>\r\n					</tbody>\r\n				</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td rowspan=\"3\" width=\"1\">\r\n				&nbsp;</td>\r\n			<td>\r\n				<strong>หมายเหตุ:</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<img height=\"5\" src=\"http://webnity.com/images/_trans.gif\" width=\"1\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n					<tbody>\r\n						<tr>\r\n							<td align=\"right\" valign=\"top\" width=\"25\">\r\n								<img align=\"absbottom\" height=\"9\" src=\"http://webnity.com/images/bullet_02.gif\" width=\"9\" /></td>\r\n							<td>\r\n								ท่านสามารถโอนเงินจากธนาคารเดียวกันสาขาใดก็ได้ โดยไม่ต้องเสียค่าธรรมเนียมการโอนเงิน</td>\r\n						</tr>\r\n						<tr>\r\n							<td align=\"right\" valign=\"top\">\r\n								<img align=\"absbottom\" height=\"9\" src=\"http://webnity.com/images/bullet_02.gif\" width=\"9\" /></td>\r\n							<td>\r\n								การโอนเงินในต่างจังหวัด จะมีค่าธรรมเนียมเรียกเก็บตามประกาศของธนาคารนั้นๆ</td>\r\n						</tr>\r\n						<tr>\r\n							<td align=\"right\" valign=\"top\">\r\n								<img align=\"absbottom\" height=\"9\" src=\"http://webnity.com/images/bullet_02.gif\" width=\"9\" /></td>\r\n							<td>\r\n								ท่านที่ประสงค์จะรับใบเสร็จรับเงิน กรุณาชำระค่าบริการเพิ่ม 20 บาท สำหรับไปรษณีย์ลงทะเบียน เพื่อป้องกันการสูญหาย โดยท่านสามารถระบุ ชื่อ ที่อยู่ ที่ต้องการให้จัดส่งใบเสร็จรับเงินได้ เมื่อทำรายการยืนยันที่เมนู ยืนยันการชำระเงิน หรือแฟกซ์มาพร้อมกับหลักฐานการชำระเงินได้ที่หมายเลข 02-222-2222</td>\r\n						</tr>\r\n					</tbody>\r\n				</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n');
