ตร-นวมินทร์ แยกนวลจันทร์<br />\r\nสอบถาม 0838703423 คุณปู<br />\r\n<br />\r\n<br />\r\n&nbsp;','',0,20000,0,0,'','',33,1,47,231,'รัชดา',10250,',',0,'',0,'','N',0,0,0,0,'','2016-09-19','2016-09-19',NULL,'Y','รัชดา','N'),(267,0,2,1,894655650603761,'ให้เช่าป้ายโฆษณาในจังหวัดเชียงใหม่','<span style=\"color: rgb(75, 79, 86); font-family: helvetica, arial, sans-serif; font-size: 14px; white-space: pre-wrap;\">ให้เช่าป้ายโฆษณาในจังหวัดเชียงใหม่ ขนาดกว้าง 15.60 เมตร สูง 9 เมตร ที่ตั้งอยู่บนถนนเลียบคลองชลประทาน ต.สุเทพ อ.เมืองสนามบินเชียงใหม่, เชียงใหม่ ถนนที่มีหมู่บ้านตั้งอยู่มากที่สุดของเชียงใหม่ </span>','',0,20000,20000,0,'','',156,38,568,5126,' ถ.เลียบคลองชลประทาน ต.สุเทพ อ.เมือง , สนามบินเชียงใหม่, เชียงใหม่,',50200,',',0,'',0,'','N',0,0,0,0,'','2016-09-20','2016-09-20',NULL,'Y','','N'),(268,0,2,1,894655650603759,'ให้เช่าพื้นที่วางป้ายบิลบอร์ด/ป้ายโฆษณา 2 ทำเล ถ.ไทรน้อย-ลาดบัวหลวง ใกล้สามแยก (บางกรวย-ไทรน้อย)','ให้เช่าพื้นที่ตั้งป้ายบิลบอร์ด/ป้ายโฆษณา มี 2 ทำเล ริม ถ.ไทรน้อย-ลาดบัวหลวง ใกล้ สามแยก<br />\r\n<br />\r\nทำเลที่ 1 หลังบ้าน ซึ่งสร้างติด ถ.ไทรน้อย-ลาดบัวหลวง ที่ดินหน้ากว้าง 13 ม.<br />\r\nหน้าบ้าน ทิศตะวันตกเฉียงใต้ จุดสังเกต คือ ตรงข้ามโรงสีไทยเจริญกิจ 40/9 หมู่1 ถ.ไทรน้อย-ลาดบัวหลวง ต.คลองขวาง อ.ไทรน้อย จ.นนทบุรี 11150<br />\r\nค่าพิกัดแปลง : 13.987725,100.3153042<br />\r\n<br />\r\nทำเลที่ 2 อยู่ถัดจากทำเลที่ 1 ประมาณ 200 ม. เป็นร้านรับทำท่อ หม้อน้ำ มองเห็นจาก สามแยก เช่นกัน บน ถ.ไทรน้อย-ลาดบัวหลวง<br />\r\n*** ราคาเช่า ขึ้นอยู่กับพื้นที่ที่เช่า โดยจะไม่มีผลกระทบใดๆ กับผู้อยู่อาศัยในทำเลที่ 1 หรือร้านหม้อน้ำในทำเลที่ 2 ***<br />\r\n<br />\r\nสนใจติดต่อ 086-971-4691<br />\r\n<br />\r\n','',0,0,0,0,'','',40,3,62,339,'ไทรน้อย-ลาดบัวหลวง ',11150,',',0,'',0,'','N',0,0,0,0,'','2016-09-26','2016-10-06',NULL,'Y','','N');
